	(112, '1100', '2025', '193', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1ZlRZ_-oE4UrIvI70qebf9QvRRUtI5zyz?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'Menyiapkan berbagai media pengaduan, seperti: kotak saran, layanan hotline, email resmi, website, media sosial, dan aplikasi pengaduan.', '- Daftar kanal pengaduan yang tersedia\n- Bukti eksistensi kanal (foto, link dan nomor kontak)', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(113, '1101', '2025', '5', NULL, '2', '2,9', 'I. Penyusunan Tim Kerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Simeulue telah membentuk tim untuk melakukan pembangunan Zona Integritas', 'SK Tim Kerja Pembangunan ZI Menuju WBK/WBBK Tahun 2025', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(114, '1101', '2025', '6', NULL, '2', '2', 'I. Penyusunan Tim Kerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Penentuan anggota Tim pembangunan Zona Integritas sudah melalui prosedur dan mekanisme yang jelas', 'a) Undangan rapat pembentukan Tim Kerja Pembangunan ZI tahun 2025 yang telah disahkan oleh kepala;\nb)Notulen/laporan pelaksanaan rapat pembentukan Tim Kerja Pembangunan ZI tahun 2025 yang telah disahkan oleh kepala dan memuat dokumentasi;\nc) Mekanisme yang menjelaskan tata cara pemilihan anggota tim; dan\nd) Kertas kerja penentuan anggota tim kerja pembangunan ZI tahun 2025', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(115, '1101', '2025', '8', NULL, '2', '2', 'II. Rencana Pembangunan Zona Integritas', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Terdapat dokumen rencana kerja pembangunan ZI menuju WBK/WBBM', '(i) Dokumen rencana kerja pembangunan ZI tahun 2025  yang mencakup:\n- susunan tim pembangunan ZI\n- target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- rencana kerja rencana aksi\n- timeline realisasasirencana kerja \n- legalisasi pimpinan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(116, '1101', '2025', '9', NULL, '2', '2', 'II. Rencana Pembangunan Zona Integritas', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Terdapat dokumen rencana kerja pembangunan ZI menuju WBK/WBBM', '(i) Dokumen rencana kerja pembangunan ZI tahun 2025  yang mencakup:\n- susunan tim pembangunan ZI\n- target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- rencana kerja rencana aksi\n- timeline realisasasirencana kerja \n- legalisasi pimpinan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(117, '1101', '2025', '10', NULL, '12', '12', 'II. Rencana Pembangunan Zona Integritas', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Terdapat mekanisme dan media untuk mensosialisasikan pembangunan WBK/WBBM', 'Laporan pelaksanaan sosialisasi yang mencakup sosialisasi offline dan online (screen capture website, media sosial, atau pun foto kegiatan terkait serta link terkait)', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(118, '1101', '2025', '12', NULL, '2,12', '2,12', 'III. Pemantauan dan Evaluasi Pembangunan WBK/WBBM', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Seluruh kegiatan pembangunan sudah dilaksanakan sesuai dengan rencana', '(i) Dokumen rencana kerja pembangunan ZI tahun 2025\n(ii) Laporan pelaksanaan kegiatan pembangunan ZI tahun 2025', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(119, '1101', '2025', '13', NULL, '12', '12', 'III. Pemantauan dan Evaluasi Pembangunan WBK/WBBM', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Terdapat monitoring dan evaluasi terhadap pembangunan Zona Integritas', '(i) Laporan monitoring dan evaluasi pelaksanaan kegiatan memuat analisa kendala, solusi, dan rencana tindak lanjut atas masing-masing rencana aksi\n(ii) Undangan, daftar hadir, dan notulen pelaksanaan rapat evaluasi', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(120, '1101', '2025', '14', NULL, '12', '12', 'III. Pemantauan dan Evaluasi Pembangunan WBK/WBBM', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Hasil monitoring dan evaluasi telah ditindaklanjuti', '(i) Undangan, notulen/laporan monitoring dan evaluasi yang memuat rekomendasi', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(121, '1101', '2025', '16', NULL, '12', '12', 'IV. Perubahan Pola Pikir dan Budaya Kerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Pimpinan telah berperan sebagai role model dalam pelaksanaan Pembangunan WBK/WBBM', '(i) Laporan tahunan penerapan nilai-nilai organisasi (BerAKHLAK) oleh pimpinan sebagai role model tahun 2025', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(122, '1101', '2025', '17', NULL, '4,12', '4,12', 'IV. Perubahan Pola Pikir dan Budaya Kerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Agen perubahan telah ditetapkan', '(i) SK Agen Perubahan/Change Ambassador Tahun 2025 (Kabupaten dan Provinsi)\n(ii) Laporan agen perubahan Tahun 2025 yang memuat penjelasan detail perubahan konkret dari program kerja agen perubahan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(123, '1101', '2025', '18', NULL, '12', '12', 'IV. Perubahan Pola Pikir dan Budaya Kerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Budaya kerja dan pola pikir telah dibangun di BPS Kabupaten Simeulue', '(i) Laporan penerapan budaya kerja tahun 2025\n(ii) Matriks dampak penerapan perubahan budaya kerja dan pola pikir tahun 2025', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(124, '1101', '2025', '19', NULL, '2,12', '2,12', 'IV. Perubahan Pola Pikir dan Budaya Kerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Anggota organisasi terlibat dalam pembangunan ZI menuju WBK/WBBM', '(i) Dokumen pakta integritas seluruh pegawai\n(ii) Dokumen pelaksanaan rapat Monev ZI\n(iii) Dokumen yang memuat usulan-usulan anggota dari tindak lanjutnya', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(125, '1101', '2025', '22', NULL, '6,7', '6,7', 'https://drive.google.com/drive/folders/1HaiGCRkEOim4YCZON-_FCxM-cZ3Fp8dG?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Semua SOP unit telah mengacu peta proses\nbisnis dan juga melakukan inovasi yang selaras.', '(i) Dokumen Proses Bisnis GSBPM BPS tertuang dalam Buku arah perubahan BPS tahun 2021-2024 hal 59;\n(ii) SK Tim Kerja BPS Kabupaten Simeulue Tahun 2024;\n(iii) Dokumen SOP Teknis dan Non Teknis/Administrasi;\n(iii) Dokumen SOP Inovasi;\n(iv) Dokumen Naskah Dinas Aturan.', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(126, '1101', '2025', '23', NULL, '6,7', '6,7', 'https://drive.google.com/drive/folders/1SIJ9t4sD3WrtqepE1MO1d92XP97gSR-0?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah Sesuai', NULL, 'Unit kerja telah menerapkan seluruh SOP yang\nditetapkan organisasi dan juga melakukan inovasi\npada SOP yang diterapkan.', '(i) Memorandum pelaksanaan tugas sesuai SOP pada tiap penugasan\n(ii) Dokumen monitoring pelaksanaan penerapan\nSOP sesuai Perka BPS Nomor 19 Tahun 2013\ntentang Pedoman Penyusunan Standar\nOperasional Prosedur Administrasi Pemerintah di\nLingkungan BPS, halaman 47;\n(iii) Informasi Alur atau Prosedur Pelayanan;\n(iv) Dokumen SOP Kegiatan utama dan Inovasi.', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(127, '1101', '2025', '24', NULL, '6,7', '6,7', 'https://drive.google.com/drive/folders/1GX-76ACYSW4ilJR728a--ZKTfAJgZkQD?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah Sesuai', NULL, 'Seluruh SOP utama telah dievaluasi dan telah\nditindaklanjuti berupa perbaikan SOP atau usulan\nperbaikan SOP.', '(i) Arsip Rapat Monitoring Evaluasi SOP Tim Kerja 2025', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(128, '1101', '2025', '26', NULL, '10', '11', 'https://drive.google.com/drive/folders/19TXpq_6yDFcBZyaOXA357MnQctHfYv2p?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah Sesuai', NULL, 'Unit kerja memiliki sistem pengukuran kinerja (eperformance/e-sakip) yang menggunakan teknologi informasi dan juga melakukan inovasi.', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pengukuran kinerja unit;\n(ii) Dokumen Screen Shot aplikasi terkait pengukuran kinerja unit dan sudah berjalan (Simonev, FRA, dll) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pengukuran kinerja unit;\n(iiI) Inovasi unit kerja penggunaan website SIRAGI (Sistem Persuratan dan Kegiatan) untuk membantu pengelolaan administrasi kegiatan.', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(129, '1101', '2025', '27', NULL, '10', '11', 'https://drive.google.com/drive/folders/1nSBrC_PIRwOeeN3PmN5ZOdpUzR24ChPY?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah Sesuai', NULL, 'Unit kerja memiliki operasionalisasi manajemen SDM yang menggunakan teknologi informasi dan juga melakukan inovasi.', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait manajemen SDM;\n(ii) Dokumen Screen Shot penerapan teknologi informasi  terkait manajemen SDM dan sudah berjalan penggunaan/pemanfaatan aplikasi TI dalam manajemen SDM;\n(iiI) Inovasi unit kerja berupa aplikasi,  web SIRAGI (Sistem Persuratan dan Kegiatan), dan website Kominsi (Koempoelan Administrasi BPS Simeulue).', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(130, '1101', '2025', '28', NULL, '10', '11', 'https://drive.google.com/drive/folders/1_bnYKH2_bY1stBSFPmBhxGiS4MfzNNZQ?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah Sesuai', NULL, 'Unit kerja telah memberikan pelayanan kepada publik dengan menggunakan teknologi informasi\nterpusat/unit sendiri dan terdapat inovasi.', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pelayanan publik;\n(ii) Dokumen Screen Shot penerapan teknologi informasi  terkait pelayanan publik dan sudah berjalan yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pelayanan publik.\n(iii) Standar pelayanan statistik.', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(131, '1101', '2025', '29', NULL, '10', '11', 'https://drive.google.com/drive/folders/1X0H3a_8roPFsMUTBpwR4ed0_xaSD1TyE?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada:\n1. Laporan monitoring dan evaluasi pemanfaatan TI (Tw/sm)\n2. Dokumentasi rapat monitoring dan evaluasi pemanfaatan TI', NULL, 'Laporan monitoring dan evaluasi terhadap\npemanfaatan teknologi informasi dalam\npengukuran kinerja unit, operasionalisasi SDM,\ndan pemberian layanan kepada publik sudah\ndilakukan secara berkala.', '(i) Bukti pelaksanaan rapat monitoring dan evaluasi pemanfaatan TI dalam pengukuran kinerja unit, manajemen SDM, dan pelayanan publik (Undangan, daftar hadir, notulen) dan atau Laporan monitoring dan evaluasi pemanfaatan TI dalam pengukuran kinerja, operasionalisasi SDM, dan pelayanan publik;\n(ii) Laporan Monev website SIPECUT.', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(132, '1101', '2025', '31', NULL, '4,5', '4,5', 'https://drive.google.com/drive/folders/1zCEeb6l48_PFjpuJiK-8NPw2-M10GNYQ?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada SK PPID, Daftar informasi publik satker yang dapat di akses', NULL, 'Telah terdapat Pejabat Pengelola Informasi\nPublik (PPID) yang menyebarkan seluruh informasi yang dapat diakses secara mutakhir dan lengkap.', '(i) SK Unit Pendukung/Tim PPID tahun 2024;\n(ii) Daftar informasi publik satker yang dapat diakses (website satker, sirup, PPID, dll) sesuai Perki no.1 tahun 2021 serta dilampirkan screenshot.', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
