	(164, '1101', '2025', '75', NULL, '1,4,7,10,12', '1,4,7,10,12', 'https://drive.google.com/drive/folders/1N4iR-P7ERxPgh9OZST5gGcINJk_7GiPl?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Pengendalian gratifikasi yang dilakukan oleh Unit Pengendalian Gratifikasi (UPG) telah sesuai prosedur  diimplementasikan yang dibuktikan dengan adanya SK UPG, Mekanisme atau SOP, dan laporan.', 'Bukti Dukung:\n(i) SK terkait tim/unit pengendalian gratifikasi (UPG);\n(ii) Mekanisme atau SOP terkait pengendalian\ngratifikasi;\n(iii)Laporan monitoring dan evaluasi tim UPG dari triwulan I hingga triwulan iv tahun 2025.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(165, '1101', '2025', '77', NULL, '1', '1', 'https://drive.google.com/drive/folders/18S8fmW2eZ8_Bvi8KAK1AG60J5ppmLEgi?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung lengkap, notulen tidak ada pengesahan', NULL, 'Unit kerja telah membangun seluruh lingkungan\npengendalian sesuai dengan yang ditetapkan\norganisasi dan juga membuat inovasi terkait\nlingkungan pengendalian yang sesuai dengan\nkarakteristik unit kerja.', 'Bukti Dukung:\n(i) Dokumen sosialisasi SPIP;\n(ii) SK tim SPIP;\n(iii) Dokumen laporan penyelenggaraan SPIP.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(166, '1101', '2025', '78', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1KlUKy-MYnfD_9AhLKa5EEiDfZFpYzIx0?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'laporan tidak memuat penjelasan inovasi', NULL, 'Unit kerja telah melakukan penilaian risiko atas\nseluruh pelaksanaan kebijakan sesuai dengan\nyang ditetapkan organisasi dan juga membuat\ninovasi terkait lingkungan pengendalian yang\nsesuai dengan karakteristik unit kerja.', 'Bukti Dukung:\n(i) Laporan Manajemen Risiko SPIP;\n(ii) Laporan inovasi terkait SPIP;\n(iii) Laporan Quality Gates tahun 2025.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(167, '1101', '2025', '79', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/13y_NIObko6wFkHhT7usQXbVWX-oj-D5O?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'laporan tidak memuat penjelasan inovasi', NULL, 'Unit kerja telah melakukan kegiatan pengendalian untuk meminimalisir resiko sesuai dengan yang\nditetapkan organisasi dan juga membuat inovasi terkait kegiatan pengendalian untuk meminimalisir resiko yang sesuai dengan karakteristik unit kerja.', 'Bukti Dukung:\n(i) Laporan Manajemen Risiko SPIP;\n(ii) Laporan inovasi terkait SPIP;\n(iii) Laporan Quality Gates tahun 2025.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
