	(171, '1101', '2025', '84', NULL, '1,4,7,10,12', '1,4,7,10,12', 'https://drive.google.com/drive/folders/1qzBlC9Bs0kJXBPDMfYwpiNzVshZKK9tM?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak terdapat pengaduan masyarakat, rapat terkait evaluasi ZI tidak memuat pembahasan terkait pengaduan', NULL, 'Telah dilakukan monitoring dan evaluasi atas penanganan pengaduan masyarakat dan penanganan pengaduan masyarakat dimonitoring dan evaluasi secara berkala yang dibuktikan dengan laporan rekapitulasi hasil aduan, tindak lanjut, dan kendala dan solusi aduan.', 'Bukti Dukung:\n(i) Laporan pengelolaan pengaduan.\n(ii) Dokumentasi pelaksanaan rapat evaluasi dan\nmonitoring.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
