	(179, '1101', '2025', '94', NULL, '1,4,7,10,12', '1,4,7,10,12', 'https://drive.google.com/drive/folders/1wUXNWqg8rkuL83LDUpeX7C55JLXZTvDn?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'laporan belum sesuai format lampiran perka nomor 36 tahun 2023', NULL, 'Penanganan Benturan Kepentingan dievaluasi\nsecara berkala oleh unit kerja.', 'Bukti Dukung:\n(i) Laporan monitoring dan evaluasi penanganan\nbenturan kepentingan berdasarkan lampiran Perka\nBPS Nomor 36 Tahun 2023 tentang Pedoman\nPenanganan Benturan Kepentingan di Lingkungan\nBadan Pusat Statistik halaman 25.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
