	(181, '1101', '2025', '98', NULL, '12', '1,12', 'https://drive.google.com/drive/folders/1sL4EFtWkybao1rdzopUMojcHcbR-5Dl2?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung telah sesuai', NULL, 'Terdapat penetapan Standar Pelayanan terhadap\nseluruh jenis pelayanan, dan sesuai asas serta\nkomponen standar pelayanan publik yang berlaku.', '(i) Perka BPS No.65 Tahun 2024 tentang Standar\nPelayanan Statistik Terpadu;\n(ii) Dokumen SK standar pelayanan publik.', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(182, '1101', '2025', '99', NULL, '12', '12', 'https://drive.google.com/drive/folders/1vAb2GhqDJfiedEKbirZGaWxVPEI5pbvb?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung telah sesuai', NULL, 'Standar pelayanan telah dimaklumatkan pada seluruh jenis pelayanan dan dipublikasikan di website dan media lainnya', '(i) Dokumen maklumat standar pelayanan yang ditandatangani kepala satker dengan tanggal 7 hari setelah SK standar pelayanan terbit\n(ii) Capture/foto dokumen maklumat standar pelayanan di tempat pelayanan misal PST, website, dan media lainnya (social media)\n(iii) SK Maklumat', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(183, '1101', '2025', '100', NULL, '12', '12', 'https://drive.google.com/drive/folders/1SE2pt9UYnd7GHz4QNL1jeCvcHNUANOTY?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung telah sesuai', NULL, 'Dilakukan reviu dan perbaikan atas standar pelayanan dan dilakukan dengan memanfaatkan masukan hasil SKM dan pengaduan masyarakat, namun tanpa melibatkan stakeholders', '(i) Dokumentasi rapat reviu standar pelayanan  (dilengkapi Undangan, Daftar Hadir,\nNotulensi, Dokumentasi Rapat);\n(ii) Dokumen reviu standar pelayanan', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(184, '1101', '2025', '101', NULL, '12', '12', 'https://drive.google.com/drive/folders/1_hziwZy7Tsy0MhI6ImxH0a_J-SKwgqxG?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung telah sesuai', NULL, 'telah melakukan publikasi atas standar pelayanan dan maklumat pelayanan.', '(i) Dokumen bukti maklumat pelayanan telah\ndipublikasikan di berbagai media;\n(ii) Dokumen bukti standar pelayanan telah\ndipublikasikan di berbagai media.', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(185, '1101', '2025', '103', NULL, '12', '12', 'https://drive.google.com/drive/folders/1xv4YjwfXXO1kj0jNf7Fap6rpjdD9sZW5?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Output pada point (iii)) tidak relevan untuk pemenuhan bukti dukung pada subjek ini', NULL, 'Telah dilakukan pelatihan/sosialisasi pelayanan prima, dan  seluruh petugas/pelaksana layanan memiliki kompetensi sesuai kebutuhan jenis layanan', '(i) Dokumentasi Pelayanan Prima Telah dilaksanakan;\n(ii) Jadwal Refreshing Pelatihan Pembinaan Pelayanan Prima;\n(iii) Laporan Pelayanan Publik.', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(186, '1101', '2025', '104', NULL, '12', '12', 'https://drive.google.com/drive/folders/1UnFY-9V4bHKOKbmmFmud54jfBdf1zps6?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung belum sesuai:\n- tidak terdapat informasi tentang pelayanan yang dapat diakses pada medsos.\n- tidak terdapat flyer informasi sarana penyampaian pengaduan yang dilengkapi narasi', NULL, 'Seluruh Informasi tentang pelayanan dapat diakses secara online (website/media sosial), namun belum terhubung dengan sistem informasi pelayanan publik nasional', '(i) Dokumentasi Informasi Pelayanan Mudah Diakses\n(ii) Dokumentasi spanduk, banner, flyer informasi sarana penyampaian pengaduan yang dilengkapi Narasi (1)', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(187, '1101', '2025', '105', NULL, '12', '12', 'https://drive.google.com/drive/folders/1kaAp7hC4laxNB3BOwz2Vom5L70UkTlgE?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung belum sesuai:\n- pada dokumen mekanisme reward and punisment terkait Standar Pelayanan perlu perbaikan merujuk pada Standar Pelayanan PST kabupaten/Kota', NULL, 'Telah terdapat kebijakan pemberian penghargaan dan sanksi yang minimal memenuhi unsur penilaian: disiplin, kinerja, dan hasil penilaian pengguna layanan, dan telah diterapkan secara rutin/berkelanjutan', '(i) Dokumen mekanisme reward and punishment yang minimal memenuhi unsur penilaian disiplin, kinerja, dan hasil penilaian pengguna layanan\n(ii) Dokumen penghargaan atas pelaksanaan pelayanan yang baik secara tahunan', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(188, '1101', '2025', '106', NULL, '12', '12', 'https://drive.google.com/drive/folders/17qpuEx3cSUQMSPIW9jBUkUFbH4Hrkcb_?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung telah sesuai', NULL, 'Telah terdapat sistem pemberian kompensasi bila layanan tidak sesuai standar bagi penerima layanan di seluruh jenis layanan', '(i) Dokumen mekanisme pemberian kompensasi pada setiap jenis layanan\n(ii) Dokumen Laporan Tahunan Pelayanan Publik', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(189, '1101', '2025', '107', NULL, '12', '12', 'https://drive.google.com/drive/folders/1QPc7hQ14QedpCtJAR3MA0WPKNJ_JghMf?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung telah sesuai', NULL, 'Seluruh pelayanan sudah dilakukan secara terpadu/terintegrasi', '(i) Dokumentasi aplikasi layanan PST\n(ii) Dokumentasi layanan berbasis online (website) \n(iii) Dokumentasi layanan berbasis aplikasi (Allstat)', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(190, '1101', '2025', '108', NULL, '12', '12', 'https://drive.google.com/drive/folders/108hpTrqJkXFFo4WQ1GTi40KUEGwbcseg?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pojok statistik,road show/sosialisasi terkait pemberian layanan seperti yang dijelaskan pada output tidak terdapat pada link bukti dukung', NULL, 'Telah memiliki inovasi pelayanan yang  berbeda dengan unit kerja lain dan mendekatkan pelayanan dengan masyarakat', '(i) Dokumentasi inovasi pada pelayanan (Inovasi tidak harus yang berupa pengembangan aplikasi berbasis IT, namun dapat berupa penambahan dekoratif pada ruang layanan, penyediaan layanan bagi disabilitas, pemberian layanan secara jemput bola seperti pojok statistik, road show/sosialisasi terkait pemberian layanan)', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(191, '1101', '2025', '110', NULL, '12', '12', 'https://drive.google.com/drive/folders/1qMOif7rQj5_F4dMe1G0wBRCiA3aoXnp-?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pemenuhan bukti dukung telah sesuai', NULL, 'Terdapat media konsultasi dan pengaduan secara offline dan online, tersedia petugas khusus yang menangani, dan terintegrasi dengan SP4N-LAPOR!', '(i) SK/surtug Tim/Petugas khusus yg menangani aduan\n(ii) Screen shoot profil instansi BPS pada lapor.go.id\n(iii) Dokumentasi akses admin SP4N-LAPOR!\n(iv) Dokumentasi laporan dari kotak pengaduan ataupun media lainnya', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
