	(202, '1101', '2025', '131', NULL, '2,12', '2,12', 'R.2. Komitmen Pimpinan', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'Pimpinan telah berkomitmen terhadap pelaksanaan Reformasi Birokrasi, dengan adanya target capaian reformasi yang jelas di dokumen perencanaan', '(i) Dokumen rencana kerja dan realisasi capaiannya', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(203, '1101', '2025', '133', NULL, '2', '2', 'R.3. Membangun Budaya Kerja', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'BPS Kabupaten Simeulue telah membangun budaya kerja positif dan menerapkan nilai-nilai organisasi dalam pelaksaan tugas sehari-hari', '(i) Undangan, daftar hadir, notulis, dan dokumentasi internalisasi\n(ii) SOP kegiatan yang menghasilkan budaya kerja positif berupa SOP sharing knowledge, apel pagi, dan pelayanan informasi publik', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
