	(206, '1101', '2025', '139', NULL, '11', '11', 'https://drive.google.com/drive/folders/1f1ZPEw51ulf0VI9B-pHQEFic8LQ_ke9G?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada\n1. Daftar layanan pada pelayanan internal yg mengimplementasikan SPBE dan disertai narasi dampak implementasi SPBE\n2. Dokumen narasi penjelasan SPBE\n3. Dokumen yang menyatakan bahwa SPBE telah terintegrasi', NULL, 'Implementasi SPBE telah terintegrasi dan mampu\nmendorong pelaksanaan pelayanan internal unit\nkerja yang lebih cepat dan efisien', '(i) Daftar Layanan pada pelayanan internal organisasi yang mengimplementasikan SPBE (disertai narasi dampak implementasi SPBE, HANYA YANG BERSIFAT INTERNAL seperti BOS, Kipapp, Sipecut, dll)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
