	(216, '1101', '2025', '165', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1tJIHqqmwEVx77ebouBkaV46PD387qsDW?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'laporan belum sesuai', NULL, 'Telah dilakukan mekanisme pengendalian aktivitas secara berjenjang.', 'Bukti Dukung:\n(i) Laporan mekanisme pengendalian aktivitas secara\nberjenjang yang memuat: perencanaan penilaian\nrisiko, pelaksanaan, monitoring, pelaporan dan\ntelah menghasilkan peningkatan kinerja,\nmekanisme kerja baru yang lebih efektif, efisien,\ndan terkendali.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(217, '1101', '2025', '167', NULL, '1,4,7,10,12', '1,4,7,10,12', 'https://drive.google.com/drive/folders/112A3l9EXeJo3kb5HHoJ3GT62TZvj7dsu?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sesuai', NULL, 'Telah dilakukan prosedur pengelolaan pengaduan masyarakat yang tidak terdapat pengaduan yang tidak ditindaklanjuti yang artinya persentase penanganan pengaduan masyarakat yang ada di BPS Kabupaten Simeulue sebesar 100 persen.', 'Bukti Dukung:\n(i) Laporan pengelolaan pengaduan', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(218, '1101', '2025', '172', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'tidak ada link bukti dukung', NULL, 'Realisasi penghitungan Penyampaian Laporan Harta Kekayaan yang dilaporkan melaui elhkpn sebanyak 4 dari 4 pegawai di BPS Kabupaten Simeulue yang harus melaporkan telah melapor dengan persentase penyampaian LHKPN sebesar 100 persen.\n(Rincian jumlah yang harus melaporkan LHKPN = KPA, Bendahara, PPK, Pejabat Pengadaan berjumlah total 4 orang).', 'Bukti Dukung:\n(i) Keputusan Kepala BPS Provinsi Aceh No 113 tahun 2024 tentang Penyelenggara Negara yang wajib melaporkan LHKPN tahun 2024 di lingkungan BPS Provinsi Aceh;\n(ii) Surat BPS Provinsi Aceh no B-1903/11000/KP.350/2024 perihal Kewajiban Pelaporan LHKAN dan LHKPN Periode 2024;\n(iii) Daftar pegawai yang wajib mengisi LHKPN (Jumlah yang harus melaporkan LHKPN = KPA, Bendahara, PPK, Pejabat Pengadaan berjumlah total 4 orang) yang terlampir pada Kepka BPS Provinsi Aceh No 113 tahun 2024 dan surat BPS Provinsi Aceh no B-1903/11000/KP.350/2024 perihal Kewajiban Pelaporan LHKAN dan LHKPN Periode 2024;\n(iv) Screenshot bukti penyampaian LHKPN.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(219, '1101', '2025', '179', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'tidak ada link bukti dukung', NULL, 'Realisasi penghitungan Penyampaian Laporan Harta Kekayaan yang dilaporkan yang dilaporkan melalui Simpeg dengan persentase penyampaian Non LHKPN (Pelaporan SPT) di BPS Kabupaten Simeulue dengan rincian 1 pejabat pengawas, 17 fungsional dan pelaksana yang wajib dan 1 pejabat administrator.', 'Bukti Dukung:\n(i) Lampiran surat Inspektur Utama perihal Proses\nPelaporan LHKAN Periode 2024;\n(ii) Daftar pegawai yang wajib mengisi SPT (ASN yang\ntidak wajib LHKPN) dan dilegalisasi oleh kepala\nsatuan/unit kerja; dan\n(iii) Screenshot bukti penyampaian SPT', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
