	(261, '1102', '2025', '53', NULL, '7', NULL, 'https://drive.bps.go.id/s/ZMzbLfoAewe9HPq', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi', NULL, 'BPS Kabupaten Aceh Singkil telah berkomitmen untuk memberikan reward kepada pegawai secara triwulanan dengan mempertimbangkan nilai hasil Sasaran Kinerja Pegawai (SKP) Bulanan dari setiap pegawai', '1. Dokumen mekanisme pemberian reward pegawai (misalnya, Employee of the month)\r\n2. Kertas kerja pemberian reward\r\n3. Bukti reward (misalkan: sertifikat, dll)', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(262, '1102', '2025', '55', NULL, '4,7', '4,7', 'https://drive.bps.go.id/s/M3nJYXoFP3RED6J', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Setiap pegawai BPS Kabupaten Aceh Singkil telah menerapkan seluruh aturan disiplin/kode etik yang telah ditetapkan oleh organisasi dan telah menyusun Buku Saku Kode Etik Pegawai sebagai salah satu inovasi terkait sosialisasi aturan disiplin/kode etik kepada seluruh pegawai.', '1. Peraturan aturan disiplin/kode etik/kode perilaku, dll (internal)\r\n2. Laporan penegakan hukuman atas pelanggaran aturan disiplin/kode etik/kode perilaku\r\n3. Dokumen inovasi terkait aturan disiplin/kode etik/kode perilaku', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
