	(288, '1102', '2025', '91', NULL, '4,6,9,12', NULL, 'https://drive.bps.go.id/s/Y3ccSNETJmWqNHH', NULL, NULL, NULL, NULL, NULL, NULL, '3', '1. tidak memuat identifikasi benturan kepentingan sesuai perka 36 \n\n2. tidak melampirkan perka nomor 36 BPS', NULL, 'Telah dilakukan identifikasi/pemetaan benturan kepentingan pada seluruh tugas fungsi utama sesuai dengan pedoman  Perka BPS No.36 Tahun 2023', '1. Dokumen hasil identifikasi potensi benturan kepentingan dalam tugas fungsi utama untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 23\r\n2. Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(289, '1102', '2025', '92', NULL, '4,6,9,12', NULL, 'https://drive.bps.go.id/s/ZaKtkaMRKRNZ2XM', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada file', NULL, 'Telah dilakukan internalisasi terkait penanganan benturan kepentingan kepada seluruh  pegawai  di lingkungan BPS Kabupaten Aceh Singkil. Bentuk internalisasi berupa rapat sosialisasi maupun melalui kegiatan apel pagi', 'Dokumentasi internalisasi penanganan benturan kepentingan, antara lain: (1) rapat (undangan, daftar hadir, notulen, foto). (2) bimtek (laporan, foto). (3) apel pagi/sore (foto, teks arahan pimpinan)', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(290, '1102', '2025', '93', NULL, '4,6,9,12', NULL, 'https://drive.bps.go.id/s/GLwZ7zexmH5oZeH', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'dokumen tidak sesuai', NULL, 'Penanganan Benturan Kepentingan telah diimplementasikan ke seluruh layanan seperti penguatan komitmen pegawai dalam bentuk surat pernyataan bebas benturan kepentingan, pakta integritas, dan pelaporan wajib LHKPN oleh pejabat terkait', '1. Dokumen surat pernyataan bebas dari benturan kepentingan untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 22\r\n2. Laporan Benturan Kepentingan berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 24', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
