	(307, '1102', '2025', '115', NULL, '1,4,7,10', '1,4', 'https://drive.bps.go.id/s/icr2gjj2YKe7YAy', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'pemenuhan bukti dukung belum sesuai dengan output', NULL, 'BPS Kabupaten Aceh Singkil mempublikasikan hasil survei kepuasan masyarakat pada media cetak, website, website PPID, dan media sosial BPS Kabupaten Aceh Singkil.', '1. Link publikasi SKD yang telah diterbitkan pada website beserta screenshot-nya\r\n2. Dokumentasi Poster indeks kepuasan konsumen dan SKM/SKD triwulanan secara offline dan online.', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
