	(349, '1103', '2025', '22', NULL, '1,4,7', '1,4,7', 'https://drive.google.com/drive/folders/1W7FxeHbqwLgY8-RJSrpIVuEOFDcZ-eL0?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. SOP yang di ttd eselon 2\n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun SOP seluruh kegiatan, meliputi kegiatan Teknis, Administrasi dan kegiatan dari hasil inovasi, yang mengacu pada peta proses bisnis BPS', '1. Dokumen Proses Bisnis BPS tertuang dalam Buku arah perubahan BPS tahun 2021-2024 hal 59\n2. Dokumen SOP Teknis dan Non Teknis/Administrasi\n3. Dokumen SOP Inovasi', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(350, '1103', '2025', '23', NULL, '1,4,7', '1,4,7', 'https://drive.google.com/drive/folders/1lX037_x5c-QFHtSwNn35z7impwQAysO4?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. Dokumen monitoring pelaksanaan penerapan SOP (Perka BPS no 19 Thn 2013)', NULL, 'BPS Kabupaten Aceh Selatan telah melaksanakan penerapan SOP dalam setiap kegiatan teknis dan non-teknis, serta melakukan inovasi berupa monitoring dan evaluasi terhadap penerapan SOP', '1. Laporan pelaksanaan kegiatan yang memuat penjelasan penerapan SOP dalam pelaksanaan kegiatan\n2. Dokumen SOP Kegiatan utama', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(351, '1103', '2025', '24', NULL, '1,4,7', '1,4,7', 'https://drive.google.com/drive/folders/1TxT5kYGjd1Q19YGxpl-HJ-Z8sc2cB065?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. bukti pelaksanaan evaluasi SOP (undangan, daftar hadir dan notulen)\n2. kertas kerja evaluasi SOP \n3. SOP awal & perbaikan (jk SOP berubah)', NULL, 'BPS Kabupaten Aceh Selatan telah melaksanakan evaluasi terhadap seluruh Prosedur Operasional Tetap (SOP) guna memastikan kesesuaian dengan kondisi aktual serta peningkatan efisiensi dan kualitas pelayanan publik dalam mendukung pembangunan Zona Integritas menuju Wilayah Bebas dari Korupsi (WBK).', '1. Daftar SOP yang masih relevan dan diterapkan\n2. Daftar SOP yang direvisi atau dihapus\n3. Rekomendasi penyempurnaan SOP', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(352, '1103', '2025', '26', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1ZyX77pGepiKN56L4n_1AL3t5T0Sm4aZq?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Tidak ada daftar penerapan TI terkait pengukuran kinerja \n2. Dokumen Screenshot aplikasi tsb\n3. Apakah SIMONIK masih digunakan di tahun 2025? Tidak ada laporan inovasi (latarbelakang, pemanfaatan, buku pedoman/SOP penggunaan aplikasi)', NULL, 'Mengembangkan dan memperbarui aplikasi internal pendukung layanan statistik dan administrasi', 'Sistem Integrasi dan Monitoring Kegiatan Pegawai (SIMONIK)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(353, '1103', '2025', '27', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1J9VA9YA94bPKQAwujVMG013sdBTLA0qQ?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Judul Daftar penerapan TI di ganti menjadi TI yang terkait operasional manajemen SDM\n2. Laporan pemanfaatan aplikasi (jika ada inovasi)', NULL, 'Operasionalisasi SDM sudah menggunakan teknologi informasi dan juga sudah melakukan inovasi.', '1. Sistem Integrasi dan Monitoring Kegiatan Pegawai (SIMONIK)\n2. Manual Book Sistem Integrasi dan Monitoring Kegiatan Pegawai (SIMONIK)\n3. Daftar PEMANFAATAN TEKNOLOGI INFORMASI\nDALAM PENGUKURAN KINERJA UNIT', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(354, '1103', '2025', '28', NULL, '3,6,9', '3,6,9', 'https://drive.google.com/drive/folders/1dIslwzw5zDFL6CRzTcdoV7Zc9ne_NGMl?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada bukti dukung', NULL, 'Pemberian Pelayanan melalui beberapa kanal media sosial telah dilakukan dengan melakukan beberapa informasi yang informatif pada platform Instagram, Facebook, dan Website', '1. Website\n2. Facebook\n3. Intagram', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(355, '1103', '2025', '29', NULL, '3,6,9', '3,6,9', 'https://drive.google.com/drive/folders/1r30hMyuLy8CvVv4WqSswQZ9SYeD80H7y?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada bukti dukung', NULL, 'BPS Aceh Selatan telah melakukan monitoring dan evaluasi terhadap pemanfaatan teknologi informasi, pengelolaan SDM, dan pemberian layanan kepada publik namun tidak secara berkala.', '1. Website\n2. Facebook\n3. Intagram', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(356, '1103', '2025', '31', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1nJjPCSg8DSVBrFae96tiQJW6VDd0rKE5?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada Target dan realisasi', NULL, 'BPS Aceh Selatan telah menerapkan keterbukaan informasi publik dan sudah dibentuk Pejabat Pengelola Informasi Publik (PPID) melalui SK Nomor 007.B/RB/2024 tentang Unit Pendukung Pejabat Pengelola Informasi dan Dokumentasi di Lingkungan Badan Pusat Statistik Kabupaten Aceh Selatan Tahun Anggaran 2024 yang menyebarkan sebagian informasi yang dapat diakses secara mutakhir dan lengkap.', 'SK Nomor 007.B/RB/2024 tentang Unit Pendukung Pejabat Pengelola Informasi dan Dokumentasi di Lingkungan Badan Pusat Statistik Kabupaten Aceh Selatan Tahun Anggaran 2024', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
