	(399, '1103', '2025', '89', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(400, '1103', '2025', '91', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'Telah dilakukan identifikasi/pemetaan benturan kepentingan pada seluruh tugas fungsi utama sesuai dengan pedoman  Perka BPS No.36 Tahun 2023', '1. Dokumen hasil identifikasi potensi benturan kepentingan dalam tugas fungsi utama untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 23\n2. Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(401, '1103', '2025', '92', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(402, '1103', '2025', '93', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'Penanganan Benturan Kepentingan telah diimplementasikan ke seluruh layanan seperti penguatan komitmen pegawai dalam bentuk surat pernyataan bebas benturan kepentingan, pakta integritas, dan pelaporan wajib LHKPN oleh pejabat terkait', '1. Dokumen surat pernyataan bebas dari benturan kepentingan untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 22\n2. Laporan Benturan Kepentingan berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 24.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(403, '1103', '2025', '94', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(404, '1103', '2025', '95', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(405, '1103', '2025', '98', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah menetapkan standar pelayanan terhadap seluruh jenis pelayanan, dan sesuai asas serta komponen standar pelayanan publik yang berlaku. Standar Pelayanan ditetapkan melalui Keputusan Kepala BPS Kabupaten Aceh Selatan', '1. Perka BPS No.65 Tahun 2024 tentang Standar Pelayanan Statistik Terpadu\n2. Keputusan Pejabat Pengelola Informasi dan Dokumentasi Badan Pusat Statistik No. B-323/02400/HK.200/07/2022 tentang Standar Layanan Informasi Publik di lingkungan Badan Pusat Statistik\n3. Dokumen SK standar pelayanan publik', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(406, '1103', '2025', '99', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah memaklumatkan standar pelayanan pada seluruh jenis pelayanan dan dipublikasikan di media cetak, media sosial, website bps, dan website PPID.', '1. Dokumen maklumat standar pelayanan yang ditandatangani kepala satker paling lambat 7 hari setelah SK standar pelayanan terbit\n2. Capture/foto dokumen maklumat standar pelayanan di tempat pelayanan misal PST, website, dan media lainnya (social media)\n3. (iii) SK Maklumat Pelayanan', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(407, '1103', '2025', '100', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah melakukan reviu dan perbaikan atas standar pelayanan dengan melibatkan stakeholders serta memanfaatkan masukan hasil SKM dan pengaduan masyarakat.', '1. Dokumentasi rapat reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders dan masyarakat (dilengkapi Undangan, Daftar Hadir, Notulensi, Dokumentasi Rapat)\n2. Dokumen reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders (antara lain : tokoh masyarakat, akademisi, dunia usaha, dan lembaga swadaya masyarakat), serta memanfaatkan masukan hasil SKM/SKD dan pengaduan masyarakat', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(408, '1103', '2025', '101', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah mempublikasikan standar pelayanan dan maklumat pelayanan pada media cetak, media sosial, website bps, dan website ppid.', '1. Dokumen bukti maklumat pelayanan telah dipublikasikan di berbagai media\n2. Dokumen bukti standar pelayanan telah dipublikasikan di berbagai media.', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(409, '1103', '2025', '103', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah melakukan sosialisasi pelayanan prima secara berkelanjutan dan terjadwal, sehingga seluruh petugas/pelaksana layanan memiliki kompetensi sesuai kebutuhan jenis layanan serta telah terdapat monev yang melihat kemampuan/kecakapan petugas/pelaksana layanan.', '1. Dokumen pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan, antara lain: - rapat (undangan, daftar hadir, notulen)\n2. laporan dan materi pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan\n3. Dokumen jadwal pelatihan/sosialisasi yang menunjukkan bahwa pelatihan/sosialisasi dilakukan secara berkelanjutan dan terjadwal\n4. Dokumen monitoring dan evaluasi atas kualitas layanan yang diberikan oleh pegawai/petugas layanan', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(410, '1103', '2025', '104', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah mempublikasikan seluruh informasi tentang pelayanan yang dapat diakses secara online dan terhubung ke sistem informasi pelayanan publik nasional.', '1. Dokumen Capture sarana informasi tentang pelayanan yang disediakan pada berbagai media\n2. Dokumen Capture sarana informasi tentang pelayanan yang disediakan telah terdaftar dan muncul pada SIPPN', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(411, '1103', '2025', '105', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah menerapkan kebijakan pemberian penghargaan dan sanksi yang minimal memenuhi unsur penilaian: disiplin, kinerja, dan hasil penilaian pengguna layanan, dan telah diterapkan secara rutin/berkelanjutan.', '1. Dokumen mekanisme reward dan punishment yang minimal memenuhi unsur penilaian disiplin, kinerja, dan hasil penilaian pengguna layanan;\n2. Dokumen penghargaan atas pelaksanaan pelayanan yang baik secara tahunan', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
