	(413, '1103', '2025', '107', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'Seluruh pelayanan BPS Kabupaten Aceh Selatan sudah dilakukan secara terpadu/terintegrasi.', '1. Dokumentasi aplikasi layanan PST\n2. Dokumentasi layanan berbasis online (website)\n3. Dokumentasi layanan berbasis aplikasi (Allstat)', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
