	(451, '1102', '2025', '8', NULL, '3', '3', 'https://drive.bps.go.id/s/eKRy8TWnMjMYrA5', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun rencana kerja pembangunan Zona Integritas menuju WBK/WBBM', '1. Dokumen rencana pembangunan ZI yang mencakup:\n- Susunan Tim Pembangunan ZI\n- Target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- Rencana kerja dan rencana aksi\n- Rencana dan realisasi timeline pelaksanaan pembangunan ZI\n- Legalisasi pimpinan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(452, '1102', '2025', '9', NULL, '3', '3', 'https://drive.bps.go.id/s/YCJT5jQmHD8NbFr', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Dalam dokumen pembangunan yang telah disusun BPS Kabupaten Aceh Singkil, target-target prioritas telah relevan dengan tujuan pembangunan WBK/WBBM', '1. Dokumen rencana pembangunan ZI yang mencakup:\n- Susunan Tim Pembangunan ZI\n- Target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- Rencana kerja dan rencana aksi\n- Rencana dan realisasi timeline pelaksanaan pembangunan ZI\n- Legalisasi pimpinan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
