	(637, '1103', '2025', '107', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'Seluruh pelayanan BPS Kabupaten Aceh Selatan sudah dilakukan secara terpadu/terintegrasi.', '1. Dokumentasi aplikasi layanan PST\n2. Dokumentasi layanan berbasis online (website)\n3. Dokumentasi layanan berbasis aplikasi (Allstat)', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(638, '1103', '2025', '108', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan memiliki inovasi pelayanan berupa kolase aktualisasi', '1. Laporan inovasi pelayanan publik (Inovasi tidak harus yang berupa pengembangan aplikasi berbasis IT', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(639, '1103', '2025', '110', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan memiliki media konsultasi dan pengaduan secara offline dan online, tersedia petugas khusus yang menangani, dan terintegrasi dengan SP4N-LAPOR!.', '1. SK/surat tugas Tim/Petugas khusus yg menangani aduan\n2. Screenshot profil instansi BPS pada lapor.go.id\n3. Dokumentasi akses admin SP4N-LAPOR!\n4. Dokumentasi laporan dari kotak pengaduan ataupun media lainnya secara online dan offline', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(640, '1103', '2025', '111', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan memiliki tim khusus yang mengelola konsultasi dan pengaduan, serta terdapat SK yang menugaskan tim pengelola SP4N LAPOR!.', '1. Dokumentasi akses admin SP4N-LAPOR!\n2. Surat Keputusan/SK pengelola SP4N-LAPOR! di level unit kerja', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
