	(645, '1103', '2025', '118', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan menggunakan teknologi informasi pada seluruh proses pemberian layanan pada semua jenis pelayanan sehingga pemberian layanan menjadi lebih efektif dan memuaskan pengguna layanan.', '1. Screenshoot penerapan aplikasi dan inovasi pelayanan berbasis teknologi informasi\n2. Panduan Romantik Online\n3. Panduan Silastik\n4. Silastik\n5. Website BPS Aceh Selatan', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(646, '1103', '2025', '119', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah membangun database pelayanan yang ada sehingga konsumen tidak bingung ketika mengakses pelayanan BPS Kabupaten Aceh Selatan.', '1. Dokumen narasi terkait sistem pelayanan BPS yang terintegrasi menggunakan PST, dimana databasenya tersentralisir dan jenis layanannya dapat berupa pemanfaatan website BPS, aplikasi mobile Allstat, dan layanan konsultasi offline yang menggunakan tabel dinamis, dll)', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
