	(705, '1102', '2025', '48', NULL, '6,12', NULL, 'https://drive.bps.go.id/s/ssJs8APjZK7GQSN', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan monitoring dan evaluasi terhadap pengembangan kompetensi pegawai yang dibuktikan capaian penilaian kinerja seluruh pegawai berpredikat baik dan telah dipertahankan selama dua tahun berturut-turut', 'Laporan monitoring berupa matriks rekap jumlah Pelatihan/Diklat/Bimtek/Capacity building/Coaching selama periode 1 tahun serta evaluasi peningkatan kinerja', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(706, '1102', '2025', '50', NULL, '1', '1', 'https://drive.bps.go.id/s/8iwiq6BLQzJQ4m2', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'Penetapan kinerja untuk seluruh pegawai telah sesuai dan selaras dengan kinerja organisasi serta Sasaran Kinerja Pegawai (SKP)', '1. Dokumen SKP bulanan seluruh pegawai dari KipApp;\r\n2. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan;\r\n3. Dokumen penjelasan cascading indikator kinerja mulai dari Visi, misi, PK sampai IKI.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(707, '1102', '2025', '51', NULL, NULL, NULL, 'https://drive.bps.go.id/s/DW26e5r977J4ELZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi', NULL, 'Ukuran kinerja untuk seluruh pegawai telah sesuai dengan indikator kinerja kepala BPS Kabupaten Aceh Singkil', 'Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
