	(733, '1102', '2025', '87', NULL, '4,6,9,12', NULL, 'https://drive.bps.go.id/s/KKkerxZ4F9mfer7', NULL, NULL, NULL, NULL, NULL, NULL, '3', '1. SK Tim WBS belum ada uraian tugas\n\nBelum terdapat bukti dukung:\n\n2. Keputusan Inspektur Utama No. B-146/BPS/8000/10/2019 Tahun 2019 tentang Sistem Pengelolaan Pengaduan di Lingkungan Badan Pusat Statistik\n3. Dokumentasi spanduk/banner/flyer/media/sarana WBS yang dilengkapi dengan narasi\n4. Screenshot aplikasi WBS\n5. Laporan pengelolaan WBS', NULL, 'Telah diterapkan WBS sesuai dengan Perka BPS No 185 Tahun 2020 tentang sistem pengelolaan pengaduan pelayanan publik. Penerapan inovasi dilakukan melalui digitalisasi sistem pengaduan seperti pembuatan layanan pengaduan BPS Kabupaten Aceh Singkil', '1. SK Tim WBS\r\n2. Keputusan Inspektur Utama No. B-146/BPS/8000/10/2019 Tahun 2019 tentang Sistem Pengelolaan Pengaduan di Lingkungan Badan Pusat Statistik\r\n3. Dokumentasi spanduk/banner/flyer/media/sarana WBS yang dilengkapi dengan narasi\r\n4. Screenshot aplikasi WBS\r\n5. Laporan pengelolaan WBS', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
