	(781, '1102', '2025', '189', NULL, '1,2', NULL, 'https://drive.bps.go.id/s/LBrzTTnSDGLgqsX', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'pemenuhan bukti dukung belum sesuai', NULL, 'Sesuai dengan standar pelayanan, BPS Kabupaten Aceh Singkil memiliki 4 jenis pelayanan yaitu, perpustakaan, konsultasi statistik, produk statistik berbayar, dan rekomendasi statistik dan telah dipermudah oleh inovasi yang dilakukan oleh BPS Kabupaten Aceh Singkil.', '1. Dokumen daftar jumlah perijinan/pelayanan yang terdata/terdaftar di satuan/unit kerja (sesuai Perka BPS Nomor 65 Tahun 2024)\r\n2. Dokumen daftar jumlah perijinan/pelayanan di satuan/unit kerja yang telah dipermudah', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
