	(824, '1103', '2025', '60', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Kepala BPS Kabupaten Aceh Selatan telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Penetapan Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor proses revisi anggaran', '1. Undangan, notula, daftar hadir, foto rapat perencanaan kegiatan dan anggaran;\n2. Dokumen Perjanjian Kinerja (PK) 2025\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Dokumen perencanaan anggaran dan kegiatan dalam Petunjuk Operasional Kegiatan (POK)', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(825, '1103', '2025', '61', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Kepala BPS Kabupaten Aceh Selatan telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Perjanjian Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor penyusunan matriks peran hasil setiap pegawai', '1. Undangan, notula disertai kertas kerja dasar hitung dalam penentuan target kinerja, daftar hadir, dan foto rapat penyusunan penetapan kinerja\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(826, '1103', '2025', '62', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Kepala Kabupaten Aceh Selatan telah terlibat dalam setiap tahapan kegiatan, mulai dari penyusunan perencanaan, monitoring pelaksanaan rencana kerja dan anggaran, evaluasi capaian kinerja dan anggaran setiap triwulanan, hingga monitoring tindak lanjut hasil evaluasi kerja', 'Undangan, notula (disertai kendala, solusi, tindak lanjut, PIC tindak lanjut, dan batas waktu tindak lanjut), daftar hadir, foto rapat monitoring capaian kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(827, '1103', '2025', '64', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun Renstra 2020-2024 dan sudah dilakukan reviu, serta telah menyusun Perjanjian Kinerja yang sudah diupload di web PPID', '1. Rencana Strategis (Renstra) 2025–2029 dan Reviu Renstra 2025-2029\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link Renstra 2025–2029, Reviu Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(828, '1103', '2025', '65', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun Matriks Peran Hasil (MPH) setiap pegawai yang sesuai dengan dokumen Perencanaan Kinerja', '1. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link PK 2025 yang diupload di PPID\n3. Seluruh dokumen MPH dari aplikasi Kipapp yang ditandatangani oleh pimpinan', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(829, '1103', '2025', '66', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS telah menerbitkan Perka Nomor 3 Tahun 2022 tentang reviu IKU sebagai landasan penyusuna Perjanjian Kinerja (PK)', '1. Dokumen Peraturan Kepala BPS Nomor 3 Tahun 2022 terkait Reviu IKU di Lingkungan BPS Tahun 2020-2024;\n2. Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(830, '1103', '2025', '67', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Berdasarkan LAKIN BPS Kabupaten Aceh Selatan 2025, seluruh indikator kinerja telah Spesifik (Spesific), Terukur (Measurable), Dapat Dicapai (Achievable), Relevan (Relevant), serta memiliki Batas Waktu (Time-Bound)', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(831, '1103', '2025', '68', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun Laporan Kinerja (LAKIN) periode 2025 secara tepat waktu, dibuktikan dengan screenshot unggah dokumen LAKIN ke Simonev yang tepat waktu', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan secara tepat waktu;\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID;\n3. Screenshot bukti unggah Laporan Kinerja 2025 secara tepat waktu', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(832, '1103', '2025', '69', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Dokumen Laporan Kinerja (LAKIN) periode 2025 yang telah disusun sudah memberikan informasi yang lengkap mengenai kinerja dari BPS Kabupaten Aceh Selatan selama periode 2025', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(833, '1103', '2025', '70', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun sistem akuntabilitas kinerja yang dimulai dari pembentukan Tim Sistem Akuntabilitas Kinerja Instansi Pemerintah (SAKIP) di lingkungan BPS Kabupaten Aceh Selatan serta melakukan penyusunan SOP pengumpulan data Capaian Kinerja yang dikumpulkan secara periodik', '1. Peraturan Kepala Badan Pusat Statistik Nomor 9 Tahun 2015 tentang Pedoman Penyusunan Sistem Akuntabilitas Kinerja Instansi Pemerintah di Lingkungan Badan Pusat Statistik\n2. SK Tim SAKIP Tahun 2025\n3. SOP Pengumpulan Data Kinerja sesuai dengan kondisi masing-masing satuan kerja yang ditandatangani oleh pimpinan (mengacu pada surat Sekretaris Utama terkait Pelaporan Capaian Kinerja Triwulanan Tahun 2025).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(834, '1103', '2025', '71', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Sebanyak 14 dari 20 orang pegawai yang tergabung dalam Tim SAKIP BPS Kabupaten Aceh Selatan Tahun', '1. SK Tim SAKIP Tahun 2025\n2. Dokumen daftar data individu seluruh anggota Tim SAKIP yang memuat data kompetensi dan sertifikat pembinaan terkait akuntabilitas kinerja (akumulasi kompetensi hingga tahun 2025).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(835, '1103', '2025', '74', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah melakukan public campaign terkait pengendalian gratifikasi dan telah dipublikasikan secara berkala, diantaranya melalui: sosialisasi di media sosial setiap sebulan sekali, pemasangan banner dan spanduk tentang larangan gratifikasi, serta melakukan sosialisasi larangan gratifikasi pada rapat internal pegawai', '1. Dokumentasi atau screenshoot banner/spanduk/media sosial yang menunjukan pengendalian gratifikasi telah dipublikasikan secara berkala (per bulan/triwulan/semester)\n2. Dokumen sosialisasi larangan gratifikasi dalam rapat internal maupun eksternal (undangan, notulen, daftar hadir)', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(836, '1103', '2025', '75', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah membentuk Unit Pengendalian Gratifikasi (UPG) yang telah menyusun mekanisme pengendalian gratifikasi di lingkungan BPS Kabupaten Aceh Selatan, serta telah dilaksanakan dan dilakukan evaluasi terhadap upaya pengendalian gratifikasi', '1. SK terkait unit pengendalian gratifikasi (UPG);\n2. Mekanisme atau SOP terkait pengendalian gratifikasi;\n3. Laporan implementasi pengendalian gratifikasi.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(837, '1103', '2025', '77', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah melakukan sosialisasi SPIP kepada seluruh pegawai, dilanjutkan dengan membetuk Tim SPIP yang bertugas melakukan pengendalian internal di linkungan BPS Kabupaten Aceh Selatan. Beberapa upaya pengendalian yang telah dilakukan diantaranya adalah: \n- Sosialisasi terkait rencana pengendalian internal\n- Pengendalian dan Pengelolaan atas Sistem Informasi\n- Pengendalian atas Aset Fisik\n- Kegiatan Pengawasan dan Monitoring Kualitas yang memuat inovasi dari BPS Kabupaten Aceh Selatan\n- serta melakukan Monitoring dan evaluasi atas pelaksanaan upaya pengendalian', '1. Dokumen sosialisasi SPIP (undangan, notulen, materi/ paparan, daftar hadir, dokumentasi/foto)\n2. SK tim SPIP ;\n3. Dokumen laporan penyelenggaraan SPIP (tambahkan subbab terkait inovasi, jika ada).', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
