	(898, '1102', '2025', '6', NULL, '1', '1', 'https://drive.bps.go.id/s/DXaT4Qmx2eLQRFx', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah membentuk Tim Kerja Pembangunan Zona Integritas, melalui prosedur/mekanisme yang jelas dan mewakili seluruh unsur di BPS Kabupaten Aceh Singkil', '1. Notulen/laporan pelaksanaan rapat pembentukan Tim Kerja yang telah disahkan oleh kepala satker;\r\n2. Mekanisme yang menjelaskan tata cara pemilihan anggota Tim\r\n3. Kertas kerja penentuan anggota Tim Kerja', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(899, '1102', '2025', '8', NULL, '3', '3', 'https://drive.bps.go.id/s/eKRy8TWnMjMYrA5', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun rencana kerja pembangunan Zona Integritas menuju WBK/WBBM', '1. Dokumen rencana pembangunan ZI yang mencakup:\n- Susunan Tim Pembangunan ZI\n- Target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- Rencana kerja dan rencana aksi\n- Rencana dan realisasi timeline pelaksanaan pembangunan ZI\n- Legalisasi pimpinan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(900, '1102', '2025', '9', NULL, '3', '3', 'https://drive.bps.go.id/s/YCJT5jQmHD8NbFr', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Dalam dokumen pembangunan yang telah disusun BPS Kabupaten Aceh Singkil, target-target prioritas telah relevan dengan tujuan pembangunan WBK/WBBM', '1. Dokumen rencana pembangunan ZI yang mencakup:\n- Susunan Tim Pembangunan ZI\n- Target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- Rencana kerja dan rencana aksi\n- Rencana dan realisasi timeline pelaksanaan pembangunan ZI\n- Legalisasi pimpinan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(901, '1102', '2025', '10', NULL, '2', '2', 'https://drive.bps.go.id/s/HzSp3LkFSzpceKS', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Pembangunan WBK/WBBM di BPS Kabupaten Aceh Singkil telah dilakukan di berbagai media, baik secara online maupun offline dan dilakukan secara berkala', '1. Laporan pelaksanaan sosialisasi yang mencakup: sosialisasi offline dan online', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(902, '1102', '2025', '12', NULL, '3', '3', 'https://drive.bps.go.id/s/bTHLF3MGq7xN2SW', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Kegiatan Pembangunan Zona Integritas di BPS Kabupaten Aceh Singkil telah dilaksanakan seluruhnya sesuai rencana', '1. Dokumen rencana kerja pembangunan ZI\n2. Laporan pelaksanaan kegiatan pembangunan ZI', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(903, '1102', '2025', '13', NULL, '6', '6', 'https://drive.bps.go.id/s/fEKZgJB7bGjX6EC', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan monitoring dan evaluasi Pembangunan Zona Integritas secara berkala yang melibatkan pimpinan dan dilakukan secara berkala setiap triwulan', '1. Laporan monitoring dan evaluasi pelaksanaan kegiatan memuat analisa kendala, solusi, dan rencana tindak lanjut atas masing-masing rencana aksi;\r\n2. Undangan, daftar hadir, dan notulen pelaksanaan rapat evaluasi.', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(904, '1102', '2025', '14', NULL, '12', '12', 'https://drive.google.com/drive/folders/1FTnzm17sIHWLuXxvKJIrLy1DCSwRU2Dk?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah menindaklanjuti seluruh catatan hasil monitoring dan evaluasi capaian Pembangunan ZI Tahun 2025', '1. Notulen/laporan monitoring dan evaluasi yang memuat rekomendasi\r\n2. Laporan hasil tindak lanjut rekomendasi\r\n3. Dokumentasi pelaksanaan tindak lanjut', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(905, '1102', '2025', '16', NULL, '12', '12', 'https://drive.google.com/file/d/1kGNYRMIzyVIPAVw6DUPaBucnfyUnZDyF/view?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Kepala BPS Kabupaten Aceh Singkil telah menerapkan dan menjadi role model dalam pelaksanaan nilai-nilai organisasi yang selaras dengan Pembangunan ZWBK/WBBM', 'Laporan tahunan penerapan nilai-nilai organisasi (BerAKHLAK) oleh pimpinan sebagai role model/change leader.', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(906, '1102', '2025', '17', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1SGyHHbCg0pV-37l6U_DLnKZX_2UniDI2?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah menunjuk dan menetapkan Agen Perubahan dan telah berkontribusi memberikan perubahan positif di lingkungan kerja', '1. SK Agen Perubahan satker tahun 2025 (Change Champion dan/ Change Ambassador)\r\n2. Laporan agen perubahan satker tahun 2025 yang memuat penjelasan detail perubahan konkret dari program kerja agen perubahan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(907, '1102', '2025', '18', NULL, '12', '12', 'https://drive.google.com/drive/folders/1TJBKu8NNrhg_uZMqXaow67-tgQL0NlXY?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan upaya pembangunan budaya kerja dan pola pikir melalui kegiatan rapat rutin bulanan, olahraga rutin setiap jum\'at, dll, serta mengurangi resistensi atas perubahan', '1. Laporan penerapan budaya kerja 2025\r\n2. Matriks dampak penerapan perubahan budaya kerja dan pola pikir', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(908, '1102', '2025', '19', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1UgocpWHqh1e9NWcWwOyOvdBJbXHkJ_CT?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah melibatkan seluruh pegawai dalam kegiatan Pembangunan ZI menuju WBK/WBBM', '1. Dokumen pakta integritas seluruh pegawai\r\n2. Dokumen pelaksanaan rapat Monev ZI triwulanan\r\n3. Dokumen yang memuat usulan-usulan anggota dan tindak lanjutnya', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(909, '1102', '2025', '22', NULL, '1', '1', 'https://drive.bps.go.id/s/Bm95QrHqcbtHFTZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. SOP yang di ttd oleh eselon 2         \n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun SOP seluruh kegiatan, meliputi kegiatan Teknis, Administrasi dan kegiatan dari hasil inovasi, yang mengacu pada peta proses bisnis BPS', '1. Seluruh dokumen SOP Teknis dan Non Teknis/ Administrasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)\r\n2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(910, '1102', '2025', '23', NULL, '3', '3', 'https://drive.bps.go.id/s/i8DyEXzitnR3Xo2', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Dokumen monitoring pelaksanaan penerapan SOP               \n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Singkil telah melaksanakan penerapan SOP dalam setiap kegiatan teknis dan non-teknis, serta melakukan inovasi berupa monitoring dan evaluasi terhadap penerapan SOP', '1. Dokumen monitoring pelaksanaan penerapan SOP sesuai Perka BPS Nomor 19 Tahun 2013 tentang Pedoman Penyusunan Standar Operasional Prosedur Administrasi Pemerintah di Lingkungan BPS, halaman 47\r\n2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(911, '1102', '2025', '24', NULL, '1', '1', 'https://drive.bps.go.id/s/FFYpAzMep7HZCBZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Bukti pelaksanaan rapat evaluasi (Undangan, daftar hadir, notulen)          \n2. Kertas kerja evaluasi\n3. Jika ada perbaikan SOP (Dok awal & dok perbaikan)', NULL, 'Dokumen SOP Kegiatan selama tahun 2025 tidak terdapat\r\nperubahanmasih tetap sesuai dengan SOP Awal', 'Surat Pernyataan ZI SOP 2025', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(912, '1102', '2025', '26', NULL, '7', '7', 'https://drive.bps.go.id/s/oZs7CGkZy2Ya3yi', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Daftar TI yang digunakan terkait pengukuran kinerja (SImonev, FRA)\n2. Screenshot aplikasi yang digunakan\n3. Inovasi tidak dilengkapi dengan laporan (latar belakang aplikasi, pemanfaatan, buku pedoman/SOP penggunaan)', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan pengukuran kinerja yang berbasis TI, diantaranya adalah Simonev, FRA, Monev Bappenas, KipApp, E-Sakip, dan lain sebagainya, serta telah menerapkan inovasi yang berbasis TI, yaitu dokumentasi administrasi perkantoran yang terintegrasi melalui Website DIGULIS (Digitalisasi Urusan Laporan Terintegrasi).', '1. Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pengukuran kinerja unit (seperti Simonev, FRA, dan atau inovasi lainnya jika ada)\r\n2. Dokumen Screenshot aplikasi terkait pengukuran kinerja unit dan sudah berjalan (Simonev, FRA, dll) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pengukuran kinerja unit\r\n3. Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman penggunaan aplikasi', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
