	(1021, '1103', '2025', '22', NULL, '1,4,7', '1,4,7', 'https://drive.google.com/drive/folders/1W7FxeHbqwLgY8-RJSrpIVuEOFDcZ-eL0?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. SOP yang di ttd eselon 2\n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun SOP seluruh kegiatan, meliputi kegiatan Teknis, Administrasi dan kegiatan dari hasil inovasi, yang mengacu pada peta proses bisnis BPS', '1. Dokumen Proses Bisnis BPS tertuang dalam Buku arah perubahan BPS tahun 2021-2024 hal 59\n2. Dokumen SOP Teknis dan Non Teknis/Administrasi\n3. Dokumen SOP Inovasi', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1022, '1103', '2025', '23', NULL, '1,4,7', '1,4,7', 'https://drive.google.com/drive/folders/1lX037_x5c-QFHtSwNn35z7impwQAysO4?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. Dokumen monitoring pelaksanaan penerapan SOP (Perka BPS no 19 Thn 2013)', NULL, 'BPS Kabupaten Aceh Selatan telah melaksanakan penerapan SOP dalam setiap kegiatan teknis dan non-teknis, serta melakukan inovasi berupa monitoring dan evaluasi terhadap penerapan SOP', '1. Laporan pelaksanaan kegiatan yang memuat penjelasan penerapan SOP dalam pelaksanaan kegiatan\n2. Dokumen SOP Kegiatan utama', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1023, '1103', '2025', '24', NULL, '1,4,7', '1,4,7', 'https://drive.google.com/drive/folders/1TxT5kYGjd1Q19YGxpl-HJ-Z8sc2cB065?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. bukti pelaksanaan evaluasi SOP (undangan, daftar hadir dan notulen)\n2. kertas kerja evaluasi SOP \n3. SOP awal & perbaikan (jk SOP berubah)', NULL, 'BPS Kabupaten Aceh Selatan telah melaksanakan evaluasi terhadap seluruh Prosedur Operasional Tetap (SOP) guna memastikan kesesuaian dengan kondisi aktual serta peningkatan efisiensi dan kualitas pelayanan publik dalam mendukung pembangunan Zona Integritas menuju Wilayah Bebas dari Korupsi (WBK).', '1. Daftar SOP yang masih relevan dan diterapkan\n2. Daftar SOP yang direvisi atau dihapus\n3. Rekomendasi penyempurnaan SOP', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1024, '1103', '2025', '26', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1ZyX77pGepiKN56L4n_1AL3t5T0Sm4aZq?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Tidak ada daftar penerapan TI terkait pengukuran kinerja \n2. Dokumen Screenshot aplikasi tsb\n3. Apakah SIMONIK masih digunakan di tahun 2025? Tidak ada laporan inovasi (latarbelakang, pemanfaatan, buku pedoman/SOP penggunaan aplikasi)', NULL, 'Mengembangkan dan memperbarui aplikasi internal pendukung layanan statistik dan administrasi', 'Sistem Integrasi dan Monitoring Kegiatan Pegawai (SIMONIK)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1025, '1103', '2025', '27', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1J9VA9YA94bPKQAwujVMG013sdBTLA0qQ?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Judul Daftar penerapan TI di ganti menjadi TI yang terkait operasional manajemen SDM\n2. Laporan pemanfaatan aplikasi (jika ada inovasi)', NULL, 'Operasionalisasi SDM sudah menggunakan teknologi informasi dan juga sudah melakukan inovasi.', '1. Sistem Integrasi dan Monitoring Kegiatan Pegawai (SIMONIK)\n2. Manual Book Sistem Integrasi dan Monitoring Kegiatan Pegawai (SIMONIK)\n3. Daftar PEMANFAATAN TEKNOLOGI INFORMASI\nDALAM PENGUKURAN KINERJA UNIT', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1026, '1103', '2025', '28', NULL, '3,6,9', '3,6,9', 'https://drive.google.com/drive/folders/1dIslwzw5zDFL6CRzTcdoV7Zc9ne_NGMl?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada bukti dukung', NULL, 'Pemberian Pelayanan melalui beberapa kanal media sosial telah dilakukan dengan melakukan beberapa informasi yang informatif pada platform Instagram, Facebook, dan Website', '1. Website\n2. Facebook\n3. Intagram', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1027, '1103', '2025', '29', NULL, '3,6,9', '3,6,9', 'https://drive.google.com/drive/folders/1r30hMyuLy8CvVv4WqSswQZ9SYeD80H7y?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada bukti dukung', NULL, 'BPS Aceh Selatan telah melakukan monitoring dan evaluasi terhadap pemanfaatan teknologi informasi, pengelolaan SDM, dan pemberian layanan kepada publik namun tidak secara berkala.', '1. Website\n2. Facebook\n3. Intagram', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1028, '1103', '2025', '31', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1nJjPCSg8DSVBrFae96tiQJW6VDd0rKE5?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada Target dan realisasi', NULL, 'BPS Aceh Selatan telah menerapkan keterbukaan informasi publik dan sudah dibentuk Pejabat Pengelola Informasi Publik (PPID) melalui SK Nomor 007.B/RB/2024 tentang Unit Pendukung Pejabat Pengelola Informasi dan Dokumentasi di Lingkungan Badan Pusat Statistik Kabupaten Aceh Selatan Tahun Anggaran 2024 yang menyebarkan sebagian informasi yang dapat diakses secara mutakhir dan lengkap.', 'SK Nomor 007.B/RB/2024 tentang Unit Pendukung Pejabat Pengelola Informasi dan Dokumentasi di Lingkungan Badan Pusat Statistik Kabupaten Aceh Selatan Tahun Anggaran 2024', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1029, '1103', '2025', '32', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/18rCUON1SA3bT8g_JZBt-s77P2M23usY3?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada Target dan realisasi', NULL, 'BPS Aceh Selatan telah menerapkan keterbukaan informasi publik dan sudah dibentuk Pejabat Pengelola Informasi Publik (PPID) melalui SK Nomor 007.B/RB/2024 tentang Unit Pendukung Pejabat Pengelola Informasi dan Dokumentasi di Lingkungan Badan Pusat Statistik Kabupaten Aceh Selatan Tahun Anggaran 2024 yang menyebarkan sebagian informasi yang dapat diakses secara mutakhir dan lengkap.', 'SK Nomor 007.B/RB/2024 tentang Unit Pendukung Pejabat Pengelola Informasi dan Dokumentasi di Lingkungan Badan Pusat Statistik Kabupaten Aceh Selatan Tahun Anggaran 2024', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1030, '1103', '2025', '35', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Kebutuhan pegawai yang telah disusun oleh BPS Kabupaten Aceh Singkil sudah mengacu pada peta jabatan dan hasil ABK pada setiap jabatan sesuai Kepka BPS Nomor 281 tahun 2021 tentang Rekapitulasi Jabatan Hasil Analisis Beban Kerja di Lingkungan Badan Pusat Statistik 2021.\nBPS Kabupaten Aceh Singkil juga telah melakukan rapat pembinaan kepegawaian mengenai rencana mutasi dan rencana penerimaan/pengadaan pegawai.', '1. Dokumen Perencanaan SDM BPS Kabupaten Aceh Singkil Tahun 2024\n2. Perka No. 182 Tahun 2024_ABK BPS yang telah disahkan sebagai Perka\n3. Perka No. 281 Tahun 2021_ABK BPS yang telah disahkan sebagai Perka\n4. Dokumen Komposisi SDM existing \n5. Notulensi Hasil Rapat Pembina Kepegawaian mengenai Rencana mutasi', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1031, '1103', '2025', '36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Komposisi pegawai BPS Kabupaten Aceh Singkil sebagian besar telah mengacu pada hasil analisis kebutuhan pegawai.', '1. Perka No. 182 Tahun 2024_ABK BPS yang telah disahkan sebagai Perka\n2. Perka No. 281 Tahun 2021_ABK BPS yang telah disahkan sebagai Perka\n3. Dokumen Komposisi SDM existing pada satker dengan Mengcapture data pada SIMPEG BPS dan lakukan Rekapitulasi terhadap jabatan\n4. SK penempatan dan jabatan syahrul yuanda\n5. Analisis sederhana terkait kesesuaian formasi dengan komposisi pegawai\n6. SK penempatan dan jabatan Muhammad Azzam \n7. Surat Perintah Melaksanakan Tugas', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1032, '1103', '2025', '37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan monitoring dan evaluasi hasil mutasi dan kompetensi pegawai yang telah menghasilkan perbaikan kinerja.', '1. Laporan monitoring dan evaluasi pegawai yang mutasi/rotasi\n2. Notulensi Rapat BaperJakat 2\n3. SK Mutasi _ Rotasi Internal\n4. Analisis kesesuaiaan kompetensi\n5. Analisis kesesuaiaan kompetensi dengan melampirkan data riwayat pegawai', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1033, '1103', '2025', '39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Pada tahun 2024, telah ada 2 orang pegawai yang mutasi di BPS Kabupaten Aceh Singkil: 1 orang diantaranya adalah pegawai mutasi masuk; 1 orang pegawai pindah keluar.', '1. Notulensi Rapat Baperjakat\n2. SK Mutasi / Rotasi Internal', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1034, '1103', '2025', '40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Seluruh mutasi pegawai antar jabatan di BPS Kabupaten Aceh Singkil telah mempertimbangkan dan memperhatikan kompetensi jabatan dan mengikuti pola mutasi yang telah ditetapkan organisasi', '1. Notulensi Rapat BaperJakat\n2. SK Mutasi / Rotasi Internal\n3. analisis ketepatan kompetensi pada posisi jabatan\n4. 3.2.c.(i) Laporan berupa rekapitulasi mutasi_rotasi pada tahun periode berjalan.pdf', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1035, '1103', '2025', '41', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan monitoring dan evaluasi hasil mutasi dan kompetensi pegawai yang telah menghasilkan perbaikan kinerja.', '1. Laporan monitoring dan evaluasi pegawai yang mutasi/rotasi\n2. Notulensi Rapat BaperJakat 2\n3. SK Mutasi _ Rotasi Internal\n4. Analisis kesesuaiaan kompetensi\n5. Analisis kesesuaiaan kompetensi dengan melampirkan data riwayat pegawai', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1036, '1103', '2025', '43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Melakukan Training Need Analysis untuk pengembangan kompetensi sesuai dengan nilai-nilai dasar ASN yang akuntabel dan kompeten.', '1. Dokumen Analisa kebutuhan diklat/bimtek/pengembangan pegawai (Training Need Analysis).', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1037, '1103', '2025', '44', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Mempertimbangkan hasil pengelolaan kinerja pegawai untuk semua rencana pengembangan kompetensi pegawai sesuai dengan nilai-nilai dasar ASN yang akuntabel dan kompeten.', '1. Analisis kesenjangan kompetensi seluruh pegawai;\n2. Rencana pengembangan kompetensi pegawai;\n3. Analisa kebutuhan diklat.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1038, '1103', '2025', '45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Menyusun laporan analisis kesenjangan kompetensi pegawai.', '1. Laporan Analisis Kesenjangan Kompetensi Jabatan Pegawai', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1039, '1103', '2025', '46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Memberikan kesempatan/hak seluruh pegawai di Unit Kerja untuk mengikuti diklat maupun pengembangan kompetensi lainnya sesuai dengan nilai-nilai dasar ASN yang akuntabel, harmonis, dan kompeten.', '1. Dokumen rekap data pegawai yang mengikuti pelatihan/diklat/pengembangan kompetensi lainnya dilengkapi dengan link bukti sertifikat/usulan diklat/undangan', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1040, '1103', '2025', '47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Melakukan upaya pengembangan kompetensi kepada seluruh pegawai sesuai dengan nilai-nilai dasar ASN yang akuntabel, harmonis, dan kompeten.', '1. Laporan pelaksanaan Pelatihan/Diklat/Bimtek/Capacity building yang diselenggarakan oleh unit/satuan kerja terkait atau bukti usulan unit/satuan kerja perihal pengikutsertaan pegawai pada Pelatihan/Diklat/Bimtek/Capacity building (jika ada).', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1041, '1103', '2025', '48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Melakukan monitoring dan evaluasi terhadap hasil pengembangan kompetensi dalam kaitannya dengan perbaikan kinerja telah dilakukan secara berkala sesuai dengan nilai-nilai dasar ASN yang akuntabel dan kompeten.', '1. Laporan monitoring berupa matriks rekap jumlah Pelatihan/Diklat/Bimtek/Capacity building/Coaching selama periode 1 tahun serta evaluasi peningkatan kinerja.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1042, '1103', '2025', '50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Penetapan kinerja untuk seluruh pegawai telah sesuai dan selaras dengan kinerja organisasi serta Sasaran Kinerja Pegawai (SKP)', '1. Dokumen SKP bulanan seluruh pegawai dari KipApp;\n2. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan;\n3. Dokumen penjelasan cascading indikator kinerja mulai dari Visi, misi, PK sampai IKI.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
