	(1069, '1103', '2025', '87', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'Telah diterapkan WBS sesuai dengan Perka BPS No 185 Tahun 2020 tentang sistem pengelolaan pengaduan pelayanan publik. Penerapan inovasi dilakukan melalui digitalisasi sistem pengaduan seperti pembuatan layanan pengaduan BPS Kabupaten Aceh Selatan', '1. SK Penanganan WBS\n2. Dokumen kebijakan WBS\n3. Screenshoot aplikasi WBS pada website\n4. Dokumentasi banner penanganan WBS\n5. Laporan WBS', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
