	(1086, '1103', '2025', '108', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan memiliki inovasi pelayanan berupa kolase aktualisasi', '1. Laporan inovasi pelayanan publik (Inovasi tidak harus yang berupa pengembangan aplikasi berbasis IT', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(1087, '1103', '2025', '110', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan memiliki media konsultasi dan pengaduan secara offline dan online, tersedia petugas khusus yang menangani, dan terintegrasi dengan SP4N-LAPOR!.', '1. SK/surat tugas Tim/Petugas khusus yg menangani aduan\n2. Screenshot profil instansi BPS pada lapor.go.id\n3. Dokumentasi akses admin SP4N-LAPOR!\n4. Dokumentasi laporan dari kotak pengaduan ataupun media lainnya secara online dan offline', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
