	(1154, '1102', '2025', '50', NULL, '1', '1', 'https://drive.bps.go.id/s/8iwiq6BLQzJQ4m2', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'Penetapan kinerja untuk seluruh pegawai telah sesuai dan selaras dengan kinerja organisasi serta Sasaran Kinerja Pegawai (SKP)', '1. Dokumen SKP bulanan seluruh pegawai dari KipApp;\r\n2. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan;\r\n3. Dokumen penjelasan cascading indikator kinerja mulai dari Visi, misi, PK sampai IKI.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
