	(1157, '1102', '2025', '53', NULL, '7', NULL, 'https://drive.bps.go.id/s/ZMzbLfoAewe9HPq', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi', NULL, 'BPS Kabupaten Aceh Singkil telah berkomitmen untuk memberikan reward kepada pegawai secara triwulanan dengan mempertimbangkan nilai hasil Sasaran Kinerja Pegawai (SKP) Bulanan dari setiap pegawai', '1. Dokumen mekanisme pemberian reward pegawai (misalnya, Employee of the month)\r\n2. Kertas kerja pemberian reward\r\n3. Bukti reward (misalkan: sertifikat, dll)', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1158, '1102', '2025', '55', NULL, '4,7', '4,7', 'https://drive.bps.go.id/s/M3nJYXoFP3RED6J', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Setiap pegawai BPS Kabupaten Aceh Singkil telah menerapkan seluruh aturan disiplin/kode etik yang telah ditetapkan oleh organisasi dan telah menyusun Buku Saku Kode Etik Pegawai sebagai salah satu inovasi terkait sosialisasi aturan disiplin/kode etik kepada seluruh pegawai.', '1. Peraturan aturan disiplin/kode etik/kode perilaku, dll (internal)\r\n2. Laporan penegakan hukuman atas pelanggaran aturan disiplin/kode etik/kode perilaku\r\n3. Dokumen inovasi terkait aturan disiplin/kode etik/kode perilaku', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1159, '1102', '2025', '57', NULL, '7', NULL, 'https://drive.bps.go.id/s/Md57gDcjZMymMbP', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Setiap pegawai BPS Kabupaten Aceh Singkil memiliki hak akses untuk melakukan pemutakhiran data setiap ada perubahan data pegawai melalui web SIMPEG', '1. Laporan pemutakhiran data informasi kepegawaian yang ditandatangani oleh pimpinan\r\n2. Dokumen Entri Data Rekap Aktivitas dari SIMPEG', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1160, '1102', '2025', '60', NULL, '1', '1', 'https://drive.bps.go.id/s/QgN7ecyXGj9Y5yS', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'Kepala BPS Kabupaten Aceh Singkil telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Penetapan Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor proses revisi anggaran', '1. Undangan, notula, daftar hadir, foto rapat perencanaan kegiatan dan anggaran;\n2. Dokumen Perjanjian Kinerja (PK) 2025\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Dokumen perencanaan anggaran dan kegiatan dalam Petunjuk Operasional Kegiatan (POK)', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1161, '1102', '2025', '61', NULL, '1', '1', 'https://drive.bps.go.id/s/sZYMp9NdZrMGsX3', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'Kepala BPS Kabupaten Aceh Singkil telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Perjanjian Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor penyusunan matriks peran hasil setiap pegawai', '1. Undangan, notula disertai kertas kerja dasar hitung dalam penentuan target kinerja, daftar hadir, dan foto rapat penyusunan penetapan kinerja\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1162, '1102', '2025', '62', NULL, '4,7,10,12', '4', 'https://drive.bps.go.id/s/mGXpsjbmi4srHa7', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Kepala Kabupaten Aceh Singkil telah terlibat dalam setiap tahapan kegiatan, mulai dari penyusunan perencanaan, monitoring pelaksanaan rencana kerja dan anggaran, evaluasi capaian kinerja dan anggaran setiap triwulanan, hingga monitoring tindak lanjut hasil evaluasi kerja', 'Undangan, notula (disertai kendala, solusi, tindak lanjut, PIC tindak lanjut, dan batas waktu tindak lanjut), daftar hadir, foto rapat monitoring capaian kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1163, '1102', '2025', '64', NULL, '1', '1', 'https://drive.bps.go.id/s/5yFxbmcGTAWnG5J', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun Renstra 2020-2024 dan sudah dilakukan reviu, serta telah menyusun Perjanjian Kinerja yang sudah diupload di web PPID', '1. Rencana Strategis (Renstra) 2025–2029 dan Reviu Renstra 2025-2029\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link Renstra 2025–2029, Reviu Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1164, '1102', '2025', '65', NULL, '1', '1', 'https://drive.bps.go.id/s/8je3Lt5wDQtmQ9n', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun Matriks Peran Hasil (MPH) setiap pegawai yang sesuai dengan dokumen Perencanaan Kinerja', '1. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link PK 2025 yang diupload di PPID\n3. Seluruh dokumen MPH dari aplikasi Kipapp yang ditandatangani oleh pimpinan', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1165, '1102', '2025', '66', NULL, '2', '2', 'https://drive.bps.go.id/s/C75Xaj2sxo46ZLS', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'BPS telah menerbitkan Perka Nomor 3 Tahun 2022 tentang reviu IKU sebagai landasan penyusuna Perjanjian Kinerja (PK)', '1. Dokumen Peraturan Kepala BPS Nomor 3 Tahun 2022 terkait Reviu IKU di Lingkungan BPS Tahun 2020-2024;\n2. Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1166, '1102', '2025', '67', NULL, '12', NULL, 'https://drive.bps.go.id/s/qQCEDLPiXqeJEML', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak Ada Target', NULL, 'Berdasarkan LAKIN BPS Kabupaten Aceh Singkil 2025, seluruh indikator kinerja telah Spesifik (Spesific), Terukur (Measurable), Dapat Dicapai (Achievable), Relevan (Relevant), serta memiliki Batas Waktu (Time-Bound)', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1167, '1102', '2025', '68', NULL, '12', NULL, 'https://drive.bps.go.id/s/srRpgCpgiKMFrME', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak Ada Target', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun Laporan Kinerja (LAKIN) periode 2025 secara tepat waktu, dibuktikan dengan screenshot unggah dokumen LAKIN ke Simonev yang tepat waktu', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan secara tepat waktu;\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID;\n3. Screenshot bukti unggah Laporan Kinerja 2025 secara tepat waktu', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1168, '1102', '2025', '69', NULL, '12', NULL, 'https://drive.bps.go.id/s/JH5JYg4RmiLL4fB', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak Ada Target', NULL, 'Dokumen Laporan Kinerja (LAKIN) periode 2025 yang telah disusun sudah memberikan informasi yang lengkap mengenai kinerja dari BPS Kabupaten Aceh Singkil selama periode 2025', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1169, '1102', '2025', '70', NULL, '1', '1', 'https://drive.bps.go.id/s/6A2dJpEY6gaGfKY', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun sistem akuntabilitas kinerja yang dimulai dari pembentukan Tim Sistem Akuntabilitas Kinerja Instansi Pemerintah (SAKIP) di lingkungan BPS Kabupaten Aceh Singkil serta melakukan penyusunan SOP pengumpulan data Capaian Kinerja yang dikumpulkan secara periodik', '1. Peraturan Kepala Badan Pusat Statistik Nomor 9 Tahun 2015 tentang Pedoman Penyusunan Sistem Akuntabilitas Kinerja Instansi Pemerintah di Lingkungan Badan Pusat Statistik\n2. SK Tim SAKIP Tahun 2025\n3. SOP Pengumpulan Data Kinerja sesuai dengan kondisi masing-masing satuan kerja yang ditandatangani oleh pimpinan (mengacu pada surat Sekretaris Utama terkait Pelaporan Capaian Kinerja Triwulanan Tahun 2025).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1170, '1102', '2025', '71', NULL, '1', '1', 'https://drive.bps.go.id/s/gQg5zzg8JZjAA92', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sertifikat pembinaan terkait Akuntabilitas Kinerja Tim SAKIP belum dilampirkan', NULL, 'Sebanyak 14 dari 20 orang pegawai yang tergabung dalam Tim SAKIP BPS Kabupaten Aceh Singkil Tahun', '1. SK Tim SAKIP Tahun 2025\n2. Dokumen daftar data individu seluruh anggota Tim SAKIP yang memuat data kompetensi dan sertifikat pembinaan terkait akuntabilitas kinerja (akumulasi kompetensi hingga tahun 2025).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1171, '1102', '2025', '74', NULL, '1', '1', 'https://drive.bps.go.id/s/52XD3yej3HY9zkf', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum melampirkan dokumen sosialisasi', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan public campaign terkait pengendalian gratifikasi dan telah dipublikasikan secara berkala, diantaranya melalui: sosialisasi di media sosial setiap sebulan sekali, pemasangan banner dan spanduk tentang larangan gratifikasi, serta melakukan sosialisasi larangan gratifikasi pada rapat internal pegawai', '1. Dokumentasi atau screenshoot banner/spanduk/media sosial yang menunjukan pengendalian gratifikasi telah dipublikasikan secara berkala (per bulan/triwulan/semester)\r\n2. Dokumen sosialisasi larangan gratifikasi dalam rapat internal maupun eksternal (undangan, notulen, daftar hadir)', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1172, '1102', '2025', '75', NULL, '5,6,9,12', NULL, 'https://drive.bps.go.id/s/52F8ZwpixAj3Gyc', NULL, NULL, NULL, NULL, NULL, NULL, '3', '1. lapiran II SK terkait uraian tugas tidak dilampirkan\n\n2. Laporan tidak mencakup monitoring dan evaluasi tim UPG dari triwulan I hingga triwulan iv tahun 2025.', NULL, 'BPS Kabupaten Aceh Singkil telah membentuk Unit Pengendalian Gratifikasi (UPG) yang telah menyusun mekanisme pengendalian gratifikasi di lingkungan BPS Kabupaten Aceh Singkil, serta telah dilaksanakan dan dilakukan evaluasi terhadap upaya pengendalian gratifikasi', '1. SK terkait unit pengendalian gratifikasi (UPG);\r\n2. Mekanisme atau SOP terkait pengendalian gratifikasi;\r\n3. Laporan implementasi pengendalian gratifikasi.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1173, '1102', '2025', '77', NULL, '4,6,9,12', NULL, 'https://drive.bps.go.id/s/2eXCsKkXg7CGqXk', NULL, NULL, NULL, NULL, NULL, NULL, '3', '1. belum ada dokumen sosialisasi\n\n2. SK belum melampirkan uraian tugas\n\n3. Belum ada laporan', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan sosialisasi SPIP kepada seluruh pegawai, dilanjutkan dengan membetuk Tim SPIP yang bertugas melakukan pengendalian internal di linkungan BPS Kabupaten Aceh Singkil. Beberapa upaya pengendalian yang telah dilakukan diantaranya adalah: \r\n- Sosialisasi terkait rencana pengendalian internal\r\n- Pengendalian dan Pengelolaan atas Sistem Informasi\r\n- Pengendalian atas Aset Fisik\r\n- Kegiatan Pengawasan dan Monitoring Kualitas yang memuat inovasi dari BPS Kabupaten Aceh Singkil\r\n- serta melakukan Monitoring dan evaluasi atas pelaksanaan upaya pengendalian', '1. Dokumen sosialisasi SPIP (undangan, notulen, materi/ paparan, daftar hadir, dokumentasi/foto)\r\n2. SK tim SPIP ;\r\n3. Dokumen laporan penyelenggaraan SPIP (tambahkan subbab terkait inovasi, jika ada).', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1174, '1102', '2025', '78', NULL, '6,9,12', '6', 'https://drive.bps.go.id/s/XCzDHe33AFAao3p', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'laporan belum sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan penilaian resiko atas seluruh pelaksanaan kebijakan organisasi dan telah membuat suatu inovasi terkait pengendalian proses pengumpulan data di lapangan melalui Appsheet Monitoring Susenas 2025 untuk  mencegah terjadinya resiko pengumpulan data yang tidak selesai tepat waktu', '1. Laporan Manajemen Risiko yang memuat penilaian risiko\r\n2. Laporan terkait inovasi terkait lingkungan pengendalian yang sesuai dengan karakteristik unit kerja', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1175, '1102', '2025', '79', NULL, '6,9,12', NULL, 'https://drive.bps.go.id/s/PtwHTGknkDSQBY6', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum ada laporan', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan penilaian resiko atas seluruh pelaksanaan kebijakan organisasi dan telah membuat suatu inovasi terkait pengendalian proses pengumpulan data di lapangan melalui Appsheet Monitoring Susenas 2024 untuk  mencegah terjadinya resiko pengumpulan data yang tidak selesai tepat waktu', '1. Laporan Manajemen Risiko yang memuat kegiatan pengendalian risiko\r\n2. Laporan terkait inovasi dalam meminimalisir risiko', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1176, '1102', '2025', '80', NULL, '6,9,12', NULL, 'https://drive.bps.go.id/s/6omRFy6ykEfmDem', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'drive kosong', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan sosialisasi SPIP dan Manajemen Resiko kepada seluruh pegawai yang dilaksanakan secara bersamaan melalui kegiatan rapat internal tanggal 2 Januari 2025', 'Dokumentasi pelaksanaan internalisasi/sosialisasi SPI (SPIP, MR, dll) kepada seluruh pegawai (undangan, daftar hadir, notulen, dan naskah paparan)', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1177, '1102', '2025', '82', NULL, '4,6,9,12', NULL, 'https://drive.bps.go.id/s/rMzcyrmEqiGnm2r', NULL, NULL, NULL, NULL, NULL, NULL, '3', '1. SK belum ada uraian tugas\n2. belum ada Dokumen kebijakan pengaduan\n3. belum ada Dokumentasi media/sarana pengaduan masyarakat yang dilengkapi dengan narasi\n4. belum ada Dokumentasi spanduk/banner/flyer informasi sarana penyampaian pengaduan yang dilengkapi dengan narasi; dan\n5. belum ada Laporan pengelolaan pengaduan', NULL, 'BPS Kabupaten Aceh Singkil telah mengimplementasikan seluruh kebijakan pengaduan masyarakat, diantaranya yaitu:\r\n1. Pengaduan melalui link Form Pengaduan BPS Kabupaten Aceh Singkil yang informasinya ditampilkan pada website\r\n2. Pengaduan melalui website SP4N -LAPOR! yang informasinya ditampilkan pada banner di halaman kantor\r\n3. Pengaduan melalui WA BPS Kabupaten Aceh Singkil yang informasinya ditampilkan pada medsos\r\n4. Pengaduan melalui kotak saran yang diletakkan di ruang PST BPS Kabupaten Aceh Singkil', '1. SK petugas Pengelola Pengaduan Masyarakat\n2. Dokumen kebijakan pengaduan\n3. Dokumentasi media/sarana pengaduan masyarakat yang dilengkapi dengan narasi\n4. Dokumentasi spanduk/banner/flyer informasi sarana penyampaian pengaduan yang dilengkapi dengan narasi; dan\n5. Laporan pengelolaan pengaduan', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1178, '1102', '2025', '83', NULL, '4,7,10,12', NULL, 'https://drive.bps.go.id/s/Jo6CqjEMM29nc2B', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada file', NULL, 'Tidak ada laporan pengaduan yang masuk ke BPS Kabupaten Aceh Singkil selama periode 2025', '1. Rekapitulasi jumlah aduan per bulan (jenis aduan)\r\n2. Tindak lanjut aduan\r\n3. Kendala dan solusi dalam penanganan aduan', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1179, '1102', '2025', '84', NULL, '4,7,10,12', NULL, 'https://drive.bps.go.id/s/Wip5Q4kKRWaFTqB', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada file', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan monitoring dan evaluasi penanganan pengaduan masyarakat secara periodik pada setiap awal bulan, bersamaan dengan rapat rutin pegawai. Berdasarkan hasil rekap laporan pengelolaan pengaduan bulanan, BPS Kabupaten Aceh Singkil tidak mendapatkan laporan pengaduan selama periode 2025', '1. Rekapitulasi jumlah aduan per bulan (jenis aduan)\r\n2. Tindak lanjut aduan\r\n3. Kendala dan solusi dalam penanganan aduan\r\n4. Hasil evaluasi atas tindak lanjut penanganan pengaduan masyarakat\r\n5. Dokumentasi pelaksanaan rapat evaluasi dan monitoring (undangan, daftar hadir, notulen)', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
