	(1209, '1102', '2025', '127', NULL, '6,12', '6,12', 'https://drive.google.com/drive/folders/1Jyjrp3HlA1AC68zpFVjNjRcQP1Mv_rgW?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada kegiatan', NULL, 'Laporan agen perubahan telah memuat dokumentasi dan narasi pelaksanaan proyek perubahan selama tahun 2025', 'Laporan agen perubahan yang memuat dokumentasi dan narasi pelaksanaan proyek perubahan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
