	(1352, '1102', '2025', '14', NULL, '12', '12', 'https://drive.google.com/drive/folders/1FTnzm17sIHWLuXxvKJIrLy1DCSwRU2Dk?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah menindaklanjuti seluruh catatan hasil monitoring dan evaluasi capaian Pembangunan ZI Tahun 2025', '1. Notulen/laporan monitoring dan evaluasi yang memuat rekomendasi\r\n2. Laporan hasil tindak lanjut rekomendasi\r\n3. Dokumentasi pelaksanaan tindak lanjut', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(1353, '1102', '2025', '16', NULL, '12', '12', 'https://drive.google.com/file/d/1kGNYRMIzyVIPAVw6DUPaBucnfyUnZDyF/view?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Kepala BPS Kabupaten Aceh Singkil telah menerapkan dan menjadi role model dalam pelaksanaan nilai-nilai organisasi yang selaras dengan Pembangunan ZWBK/WBBM', 'Laporan tahunan penerapan nilai-nilai organisasi (BerAKHLAK) oleh pimpinan sebagai role model/change leader.', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(1354, '1102', '2025', '17', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1SGyHHbCg0pV-37l6U_DLnKZX_2UniDI2?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah menunjuk dan menetapkan Agen Perubahan dan telah berkontribusi memberikan perubahan positif di lingkungan kerja', '1. SK Agen Perubahan satker tahun 2025 (Change Champion dan/ Change Ambassador)\r\n2. Laporan agen perubahan satker tahun 2025 yang memuat penjelasan detail perubahan konkret dari program kerja agen perubahan', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(1355, '1102', '2025', '18', NULL, '12', '12', 'https://drive.google.com/drive/folders/1TJBKu8NNrhg_uZMqXaow67-tgQL0NlXY?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan upaya pembangunan budaya kerja dan pola pikir melalui kegiatan rapat rutin bulanan, olahraga rutin setiap jum\'at, dll, serta mengurangi resistensi atas perubahan', '1. Laporan penerapan budaya kerja 2025\r\n2. Matriks dampak penerapan perubahan budaya kerja dan pola pikir', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(1356, '1102', '2025', '19', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1UgocpWHqh1e9NWcWwOyOvdBJbXHkJ_CT?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah melibatkan seluruh pegawai dalam kegiatan Pembangunan ZI menuju WBK/WBBM', '1. Dokumen pakta integritas seluruh pegawai\r\n2. Dokumen pelaksanaan rapat Monev ZI triwulanan\r\n3. Dokumen yang memuat usulan-usulan anggota dan tindak lanjutnya', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(1357, '1102', '2025', '22', NULL, '1', '1', 'https://drive.bps.go.id/s/Bm95QrHqcbtHFTZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. SOP yang di ttd oleh eselon 2         \n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun SOP seluruh kegiatan, meliputi kegiatan Teknis, Administrasi dan kegiatan dari hasil inovasi, yang mengacu pada peta proses bisnis BPS', '1. Seluruh dokumen SOP Teknis dan Non Teknis/ Administrasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)\r\n2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1358, '1102', '2025', '23', NULL, '3', '3', 'https://drive.bps.go.id/s/i8DyEXzitnR3Xo2', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Dokumen monitoring pelaksanaan penerapan SOP               \n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Singkil telah melaksanakan penerapan SOP dalam setiap kegiatan teknis dan non-teknis, serta melakukan inovasi berupa monitoring dan evaluasi terhadap penerapan SOP', '1. Dokumen monitoring pelaksanaan penerapan SOP sesuai Perka BPS Nomor 19 Tahun 2013 tentang Pedoman Penyusunan Standar Operasional Prosedur Administrasi Pemerintah di Lingkungan BPS, halaman 47\r\n2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
