	(1386, '1102', '2025', '62', NULL, '4,7,10,12', '4', 'https://drive.bps.go.id/s/mGXpsjbmi4srHa7', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Kepala Kabupaten Aceh Singkil telah terlibat dalam setiap tahapan kegiatan, mulai dari penyusunan perencanaan, monitoring pelaksanaan rencana kerja dan anggaran, evaluasi capaian kinerja dan anggaran setiap triwulanan, hingga monitoring tindak lanjut hasil evaluasi kerja', 'Undangan, notula (disertai kendala, solusi, tindak lanjut, PIC tindak lanjut, dan batas waktu tindak lanjut), daftar hadir, foto rapat monitoring capaian kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
