	(1430, '1102', '2025', '119', NULL, '9', NULL, 'https://drive.bps.go.id/s/dCWP8K6rXtEcAAS', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'pemenuhan bukti dukung belum sesuai terkait :\n-dokumen narasi pelayanan BPS terintegrasi\n- realisasi dan progress pelaksanaan masih kosong', NULL, 'BPS Kabupaten Aceh Singkil telah membangun database pelayanan yang ada sehingga konsumen tidak bingung ketika mengakses pelayanan BPS Kabupaten Aceh Singkil.', '1. Dokumen narasi terkait sistem pelayanan BPS yang terintegrasi menggunakan PST, dimana databasenya tersentralisir dan jenis layanannya dapat berupa pemanfaatan website BPS, aplikasi mobile Allstat, dan layanan konsultasi offline yang menggunakan tabel dinamis, dll)', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
