	(1443, '1102', '2025', '148', NULL, NULL, NULL, 'https://drive.bps.go.id/s/igAzM6y4ma4KyLf', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'Hasil assement telah dijadikan pertimbangan untuk mutasi dan pengembangan karir pegawai', '1. Dokumen hasil assessment atau hasil uji kompetensi pegawai;\r\n2. Unit Kerja berupa notulensi rapat Baperjakat yang memuat:\r\n   - Hasil assessment/hasil uji kompetensi pegawai;\r\n   - Pertimbangan untuk mutasi atau pengembangan karir berdasarkan hasil assessment/uji kompetensi\r\n3. Bagi BPS Kabupaten/Kota berupa surat usulan terkait mutasi dan/atau pengembangan karir pegawai yang didasarkan pada hasil assessment/uji kompetensi.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1444, '1102', '2025', '150', NULL, NULL, NULL, 'https://drive.bps.go.id/s/dnCfz4b2SbbENne', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'Tidak ada pelanggaran disiplin dan kode etik pegawai di BPS Kabupaten Aceh Singkil selama tahun 2025', '1. Laporan penanganan pelanggaran disiplin (rekap)\r\n2. SK Hukuman Disiplin (jika ada)', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1445, '1102', '2025', '156', NULL, '12', NULL, 'https://drive.bps.go.id/s/DRxxyYqDnR8Nyy4', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'BPS Kabupaten Aceh Singkil telah membuat Laporan Kinerja 2025 yang sudah ditandatangani oleh pimpinan', '1. Dokumen Laporan Kinerja 2025 (disusun 2026) yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1446, '1102', '2025', '160', NULL, '12', NULL, 'https://drive.bps.go.id/s/xr7bM4XBwFeLLc6', NULL, NULL, NULL, NULL, NULL, NULL, '2', NULL, NULL, 'BPS Kabupaten Aceh Singkil telah membuat Laporan Kinerja 2025 yang sudah ditandatangani oleh pimpinan dan melampirkan narasi terkait reward penghargaan yang telah diraih oleh Kabupaten Aceh Singkil.', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\r\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID\r\n3. Narasi tentang reward untuk organisasi/satker yang menerima kinerja di atas target, baik dari pihak internal maupun eksternal BPS (disertakan piagam/sertifikatnya).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
