	(1448, '1102', '2025', '165', NULL, '6,9,12', NULL, 'https://drive.bps.go.id/s/jcTsoiNCYqYJ2xw', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada dokumen yang dilampirkan', NULL, 'Terdapat pengendalian aktivitas utama organisasi yang tersistem berupa mekanisme monitoring dan lembar kerja yang berisi perencanaan  hingga laporan yang dinoomitoring secara berkala. Monitoring dan evaluasi dilakukan secara berkala dengan mitigasi risiko di setiap kegiatan sehingga BPS Kabupaten Aceh Singkil dapat mencapai target kerja organisasi pada tahun 2025 yang terlapor pada  bukti dukung dokumen FRA', 'Laporan mekanisme pengendalian aktivitas secara berjenjang yang memuat: perencanaan penilaian risiko, pelaksanaan, monitoring, pelaporan dan telah menghasilkan peningkatan kinerja, mekanisme kerja baru yang lebih efektif, efisien, dan terkendali.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1449, '1102', '2025', '167', NULL, '6,9,12', NULL, 'https://drive.bps.go.id/s/tt6brnGNQHFgwkA', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada dokumen yang dilampirkan', NULL, 'Telah dilakukan pengendalian penanganan pengaduan masyarakat selama tahun 2025 dengan hasil jumlah laporan pengaduan NIHIL.', '1. Laporan pengelolaan pengaduan', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1450, '1102', '2025', '172', NULL, '12', NULL, 'https://drive.bps.go.id/s/STee3Y7mAr2GmnS', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada dokumen yang dilampirkan', NULL, 'Pegawai yang wajib lapor LHKPN telah melaporkan kewajibannya yaitu Kepala Satuan Kerja (Kepala BPS Kabupaten Aceh Singkil), Pejabat Pembuat Komitmen, Pejabat Pengadaan, dan Bendahara dengan jumlah 4 orang pegawai', '1. Lampiran surat Inspektur Utama perihal Proses Pelaporan LHKAN Periode 2025\n2. Lampiran surat Inspektur Utama perihal Proses Pelaporan LHKAN Periode 2025\n3. Screenshot bukti penyampaian LHKPN', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1451, '1102', '2025', '179', NULL, '12', NULL, 'https://drive.bps.go.id/s/ZqKfkWTkrn44kSr', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada dokumen yang dilampirkan', NULL, 'Pegawai yang wajib lapor SPT telah melaporkan kewajibannya  sebanyak 20 orang pada wajib lapor tahun 2026 untuk periode pelaporan 2025', '1. Lampiran surat Inspektur Utama perihal Proses Pelaporan LHKAN Periode 2025\n2. Daftar pegawai yang wajib mengisi SPT (ASN yang tidak wajib LHKPN) dan dilegalisasi oleh kepala satuan/unit kerja; dan\n3. Screenshot bukti penyampaian SPT', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
