	(1478, '1103', '2025', '35', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Kebutuhan pegawai yang telah disusun oleh BPS Kabupaten Aceh Singkil sudah mengacu pada peta jabatan dan hasil ABK pada setiap jabatan sesuai Kepka BPS Nomor 281 tahun 2021 tentang Rekapitulasi Jabatan Hasil Analisis Beban Kerja di Lingkungan Badan Pusat Statistik 2021.\nBPS Kabupaten Aceh Singkil juga telah melakukan rapat pembinaan kepegawaian mengenai rencana mutasi dan rencana penerimaan/pengadaan pegawai.', '1. Dokumen Perencanaan SDM BPS Kabupaten Aceh Singkil Tahun 2024\n2. Perka No. 182 Tahun 2024_ABK BPS yang telah disahkan sebagai Perka\n3. Perka No. 281 Tahun 2021_ABK BPS yang telah disahkan sebagai Perka\n4. Dokumen Komposisi SDM existing \n5. Notulensi Hasil Rapat Pembina Kepegawaian mengenai Rencana mutasi', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1479, '1103', '2025', '36', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Komposisi pegawai BPS Kabupaten Aceh Singkil sebagian besar telah mengacu pada hasil analisis kebutuhan pegawai.', '1. Perka No. 182 Tahun 2024_ABK BPS yang telah disahkan sebagai Perka\n2. Perka No. 281 Tahun 2021_ABK BPS yang telah disahkan sebagai Perka\n3. Dokumen Komposisi SDM existing pada satker dengan Mengcapture data pada SIMPEG BPS dan lakukan Rekapitulasi terhadap jabatan\n4. SK penempatan dan jabatan syahrul yuanda\n5. Analisis sederhana terkait kesesuaian formasi dengan komposisi pegawai\n6. SK penempatan dan jabatan Muhammad Azzam \n7. Surat Perintah Melaksanakan Tugas', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1480, '1103', '2025', '37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan monitoring dan evaluasi hasil mutasi dan kompetensi pegawai yang telah menghasilkan perbaikan kinerja.', '1. Laporan monitoring dan evaluasi pegawai yang mutasi/rotasi\n2. Notulensi Rapat BaperJakat 2\n3. SK Mutasi _ Rotasi Internal\n4. Analisis kesesuaiaan kompetensi\n5. Analisis kesesuaiaan kompetensi dengan melampirkan data riwayat pegawai', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1481, '1103', '2025', '39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Pada tahun 2024, telah ada 2 orang pegawai yang mutasi di BPS Kabupaten Aceh Singkil: 1 orang diantaranya adalah pegawai mutasi masuk; 1 orang pegawai pindah keluar.', '1. Notulensi Rapat Baperjakat\n2. SK Mutasi / Rotasi Internal', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1482, '1103', '2025', '40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Seluruh mutasi pegawai antar jabatan di BPS Kabupaten Aceh Singkil telah mempertimbangkan dan memperhatikan kompetensi jabatan dan mengikuti pola mutasi yang telah ditetapkan organisasi', '1. Notulensi Rapat BaperJakat\n2. SK Mutasi / Rotasi Internal\n3. analisis ketepatan kompetensi pada posisi jabatan\n4. 3.2.c.(i) Laporan berupa rekapitulasi mutasi_rotasi pada tahun periode berjalan.pdf', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1483, '1103', '2025', '41', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan monitoring dan evaluasi hasil mutasi dan kompetensi pegawai yang telah menghasilkan perbaikan kinerja.', '1. Laporan monitoring dan evaluasi pegawai yang mutasi/rotasi\n2. Notulensi Rapat BaperJakat 2\n3. SK Mutasi _ Rotasi Internal\n4. Analisis kesesuaiaan kompetensi\n5. Analisis kesesuaiaan kompetensi dengan melampirkan data riwayat pegawai', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1484, '1103', '2025', '43', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Melakukan Training Need Analysis untuk pengembangan kompetensi sesuai dengan nilai-nilai dasar ASN yang akuntabel dan kompeten.', '1. Dokumen Analisa kebutuhan diklat/bimtek/pengembangan pegawai (Training Need Analysis).', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
