	(1487, '1103', '2025', '46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Memberikan kesempatan/hak seluruh pegawai di Unit Kerja untuk mengikuti diklat maupun pengembangan kompetensi lainnya sesuai dengan nilai-nilai dasar ASN yang akuntabel, harmonis, dan kompeten.', '1. Dokumen rekap data pegawai yang mengikuti pelatihan/diklat/pengembangan kompetensi lainnya dilengkapi dengan link bukti sertifikat/usulan diklat/undangan', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
