	(1490, '1103', '2025', '50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Penetapan kinerja untuk seluruh pegawai telah sesuai dan selaras dengan kinerja organisasi serta Sasaran Kinerja Pegawai (SKP)', '1. Dokumen SKP bulanan seluruh pegawai dari KipApp;\n2. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan;\n3. Dokumen penjelasan cascading indikator kinerja mulai dari Visi, misi, PK sampai IKI.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
