	(1522, '1103', '2025', '93', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'Penanganan Benturan Kepentingan telah diimplementasikan ke seluruh layanan seperti penguatan komitmen pegawai dalam bentuk surat pernyataan bebas benturan kepentingan, pakta integritas, dan pelaporan wajib LHKPN oleh pejabat terkait', '1. Dokumen surat pernyataan bebas dari benturan kepentingan untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 22\n2. Laporan Benturan Kepentingan berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 24.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
