	(1580, '1102', '2025', '19', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1UgocpWHqh1e9NWcWwOyOvdBJbXHkJ_CT?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'BPS Kabupaten Aceh Singkil telah melibatkan seluruh pegawai dalam kegiatan Pembangunan ZI menuju WBK/WBBM', '1. Dokumen pakta integritas seluruh pegawai\r\n2. Dokumen pelaksanaan rapat Monev ZI triwulanan\r\n3. Dokumen yang memuat usulan-usulan anggota dan tindak lanjutnya', NULL, NULL, NULL, NULL, 'ita.meriati', NULL, NULL, NULL, NULL, NULL),
	(1581, '1102', '2025', '22', NULL, '1', '1', 'https://drive.bps.go.id/s/Bm95QrHqcbtHFTZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. SOP yang di ttd oleh eselon 2         \n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun SOP seluruh kegiatan, meliputi kegiatan Teknis, Administrasi dan kegiatan dari hasil inovasi, yang mengacu pada peta proses bisnis BPS', '1. Seluruh dokumen SOP Teknis dan Non Teknis/ Administrasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)\r\n2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1582, '1102', '2025', '23', NULL, '3', '3', 'https://drive.bps.go.id/s/i8DyEXzitnR3Xo2', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Dokumen monitoring pelaksanaan penerapan SOP               \n2. SOP inovasi', NULL, 'BPS Kabupaten Aceh Singkil telah melaksanakan penerapan SOP dalam setiap kegiatan teknis dan non-teknis, serta melakukan inovasi berupa monitoring dan evaluasi terhadap penerapan SOP', '1. Dokumen monitoring pelaksanaan penerapan SOP sesuai Perka BPS Nomor 19 Tahun 2013 tentang Pedoman Penyusunan Standar Operasional Prosedur Administrasi Pemerintah di Lingkungan BPS, halaman 47\r\n2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1583, '1102', '2025', '24', NULL, '1', '1', 'https://drive.bps.go.id/s/FFYpAzMep7HZCBZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Bukti pelaksanaan rapat evaluasi (Undangan, daftar hadir, notulen)          \n2. Kertas kerja evaluasi\n3. Jika ada perbaikan SOP (Dok awal & dok perbaikan)', NULL, 'Dokumen SOP Kegiatan selama tahun 2025 tidak terdapat\r\nperubahanmasih tetap sesuai dengan SOP Awal', 'Surat Pernyataan ZI SOP 2025', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1584, '1102', '2025', '26', NULL, '7', '7', 'https://drive.bps.go.id/s/oZs7CGkZy2Ya3yi', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan :\n1. Daftar TI yang digunakan terkait pengukuran kinerja (SImonev, FRA)\n2. Screenshot aplikasi yang digunakan\n3. Inovasi tidak dilengkapi dengan laporan (latar belakang aplikasi, pemanfaatan, buku pedoman/SOP penggunaan)', NULL, 'BPS Kabupaten Aceh Singkil telah melakukan pengukuran kinerja yang berbasis TI, diantaranya adalah Simonev, FRA, Monev Bappenas, KipApp, E-Sakip, dan lain sebagainya, serta telah menerapkan inovasi yang berbasis TI, yaitu dokumentasi administrasi perkantoran yang terintegrasi melalui Website DIGULIS (Digitalisasi Urusan Laporan Terintegrasi).', '1. Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pengukuran kinerja unit (seperti Simonev, FRA, dan atau inovasi lainnya jika ada)\r\n2. Dokumen Screenshot aplikasi terkait pengukuran kinerja unit dan sudah berjalan (Simonev, FRA, dll) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pengukuran kinerja unit\r\n3. Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman penggunaan aplikasi', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
