	(1608, '1102', '2025', '60', NULL, '1', '1', 'https://drive.bps.go.id/s/QgN7ecyXGj9Y5yS', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'Kepala BPS Kabupaten Aceh Singkil telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Penetapan Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor proses revisi anggaran', '1. Undangan, notula, daftar hadir, foto rapat perencanaan kegiatan dan anggaran;\n2. Dokumen Perjanjian Kinerja (PK) 2025\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Dokumen perencanaan anggaran dan kegiatan dalam Petunjuk Operasional Kegiatan (POK)', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1609, '1102', '2025', '61', NULL, '1', '1', 'https://drive.bps.go.id/s/sZYMp9NdZrMGsX3', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'Kepala BPS Kabupaten Aceh Singkil telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Perjanjian Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor penyusunan matriks peran hasil setiap pegawai', '1. Undangan, notula disertai kertas kerja dasar hitung dalam penentuan target kinerja, daftar hadir, dan foto rapat penyusunan penetapan kinerja\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1610, '1102', '2025', '62', NULL, '4,7,10,12', '4', 'https://drive.bps.go.id/s/mGXpsjbmi4srHa7', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Kepala Kabupaten Aceh Singkil telah terlibat dalam setiap tahapan kegiatan, mulai dari penyusunan perencanaan, monitoring pelaksanaan rencana kerja dan anggaran, evaluasi capaian kinerja dan anggaran setiap triwulanan, hingga monitoring tindak lanjut hasil evaluasi kerja', 'Undangan, notula (disertai kendala, solusi, tindak lanjut, PIC tindak lanjut, dan batas waktu tindak lanjut), daftar hadir, foto rapat monitoring capaian kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1611, '1102', '2025', '64', NULL, '1', '1', 'https://drive.bps.go.id/s/5yFxbmcGTAWnG5J', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'BPS Kabupaten Aceh Singkil telah menyusun Renstra 2020-2024 dan sudah dilakukan reviu, serta telah menyusun Perjanjian Kinerja yang sudah diupload di web PPID', '1. Rencana Strategis (Renstra) 2025–2029 dan Reviu Renstra 2025-2029\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link Renstra 2025–2029, Reviu Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
