	(1613, '1102', '2025', '66', NULL, '2', '2', 'https://drive.bps.go.id/s/C75Xaj2sxo46ZLS', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah tercapai di triwulan I', NULL, 'BPS telah menerbitkan Perka Nomor 3 Tahun 2022 tentang reviu IKU sebagai landasan penyusuna Perjanjian Kinerja (PK)', '1. Dokumen Peraturan Kepala BPS Nomor 3 Tahun 2022 terkait Reviu IKU di Lingkungan BPS Tahun 2020-2024;\n2. Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1614, '1102', '2025', '67', NULL, '12', NULL, 'https://drive.bps.go.id/s/qQCEDLPiXqeJEML', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak Ada Target', NULL, 'Berdasarkan LAKIN BPS Kabupaten Aceh Singkil 2025, seluruh indikator kinerja telah Spesifik (Spesific), Terukur (Measurable), Dapat Dicapai (Achievable), Relevan (Relevant), serta memiliki Batas Waktu (Time-Bound)', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
