	(1662, '1102', '2025', '139', NULL, NULL, NULL, 'https://drive.bps.go.id/s/Zp2o49zXA43qon7', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada target', NULL, 'Implementasi SPBE telah terintegrasi dan mampu mendorong pelaksanaan pelayanan internal organisasi yang lebih cepat dan efisien', '1. Daftar Layanan pada pelayanan internal organisasi yang mengimplementasikan SPBE dan disertai narasi dampak implementasi SPBE (hanya yang bersifat internal), seperti Back Office Selindo/BOS, Kipapp, Sipecut, dan lain-lain\r\n2. Dokumen narasi penjelasan SPBE\r\n3. Dokumen yang menyatakan bahwa SPBE telah terintegrasi', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1663, '1102', '2025', '141', NULL, NULL, NULL, 'https://drive.bps.go.id/s/RiHk4aFjXrpgc5d', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada target', NULL, 'Transformasi digital pada bidang proses bisnis utama telah dilakukan dan memberikan manfaat bagi BPS Kabupaten Aceh Singkil. Transformasi digital telah dilakukan validasi dan evaluasi serta telah ditindaklanjuti secara berkelanjutan.', '1. Narasi alasan perubahan metode pencacahan dari PAPI menjadi CAPI\r\n2. Buku Pedoman penggunaan PAPI dan CAPI pada kegiatan Survei Angkatan Kerja Nasional (Sakernas)\r\n3. Surat edaran BPS Pusat terkait pencacahan menggunakan CAPI\r\n4. Screen shot pemanfaatan CAPI pada berbagai survei di masing-masing satker\r\n5. Dokumen evaluasi atas transformasi digital PAPI ke CAPI', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1664, '1102', '2025', '142', NULL, NULL, NULL, 'https://drive.bps.go.id/s/AAYJixykyibjPEp', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada target', NULL, 'Transformasi digital pada bidang administrasi pemerintahan telah dilakukan dan memberikan manfaat bagi BPS Kabupaten Aceh Singkil. Transformasi digital tersebut juga telah dilakukan validasi dan evaluasi serta telah ditindaklanjuti secara berkelanjutan.', '1. Narasi pemanfaatan BOS dan Kipapp dari buku pedoman BOS dan Kipapp\r\n2. Buku pedoman penggunaan BOS dan Kipapp\r\n3. Surat edaran BPS Pusat terkait pemanfaatan BOS dan Kipapp\r\n4. Screen shot pemanfaatan BOS dan Kipapp\r\n5. Dokumen evaluasi atas pemanfaatan BOS, dan Kipapp', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(1665, '1102', '2025', '143', NULL, NULL, NULL, 'https://drive.bps.go.id/s/WKiGAox59p3boZT', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada target', NULL, 'Transformasi digital pada bidang pelayanan publik telah dilakukan dan memberikan manfaat bagi BPS Kabupaten Aceh Singkil. Transformasi digital telah dilakukan validasi dan evaluasi serta telah ditindaklanjuti secara berkelanjutan.', '1. Narasi/buku pedoman pemanfaatan website, Silastik, Romantik, PPID, SIRUP, dll\r\n2. Screen shot pemanfaatan website, Silastik, Romantik, PPID, SIRUP, dll\r\n3. Dokumen evaluasi atas pemanfaatan website, Silastik, Romantik, PPID, SIRUP, dll', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
