	(1672, '1102', '2025', '165', NULL, '6,9,12', NULL, 'https://drive.bps.go.id/s/jcTsoiNCYqYJ2xw', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tidak ada dokumen yang dilampirkan', NULL, 'Terdapat pengendalian aktivitas utama organisasi yang tersistem berupa mekanisme monitoring dan lembar kerja yang berisi perencanaan  hingga laporan yang dinoomitoring secara berkala. Monitoring dan evaluasi dilakukan secara berkala dengan mitigasi risiko di setiap kegiatan sehingga BPS Kabupaten Aceh Singkil dapat mencapai target kerja organisasi pada tahun 2025 yang terlapor pada  bukti dukung dokumen FRA', 'Laporan mekanisme pengendalian aktivitas secara berjenjang yang memuat: perencanaan penilaian risiko, pelaksanaan, monitoring, pelaporan dan telah menghasilkan peningkatan kinerja, mekanisme kerja baru yang lebih efektif, efisien, dan terkendali.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
