	(1712, '1103', '2025', '47', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Melakukan upaya pengembangan kompetensi kepada seluruh pegawai sesuai dengan nilai-nilai dasar ASN yang akuntabel, harmonis, dan kompeten.', '1. Laporan pelaksanaan Pelatihan/Diklat/Bimtek/Capacity building yang diselenggarakan oleh unit/satuan kerja terkait atau bukti usulan unit/satuan kerja perihal pengikutsertaan pegawai pada Pelatihan/Diklat/Bimtek/Capacity building (jika ada).', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1713, '1103', '2025', '48', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Melakukan monitoring dan evaluasi terhadap hasil pengembangan kompetensi dalam kaitannya dengan perbaikan kinerja telah dilakukan secara berkala sesuai dengan nilai-nilai dasar ASN yang akuntabel dan kompeten.', '1. Laporan monitoring berupa matriks rekap jumlah Pelatihan/Diklat/Bimtek/Capacity building/Coaching selama periode 1 tahun serta evaluasi peningkatan kinerja.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1714, '1103', '2025', '50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, 'Penetapan kinerja untuk seluruh pegawai telah sesuai dan selaras dengan kinerja organisasi serta Sasaran Kinerja Pegawai (SKP)', '1. Dokumen SKP bulanan seluruh pegawai dari KipApp;\n2. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan;\n3. Dokumen penjelasan cascading indikator kinerja mulai dari Visi, misi, PK sampai IKI.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
	(1715, '1103', '2025', '51', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
