	(1718, '1103', '2025', '55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link Bukti dukung', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
