	(1744, '1103', '2025', '91', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'Telah dilakukan identifikasi/pemetaan benturan kepentingan pada seluruh tugas fungsi utama sesuai dengan pedoman  Perka BPS No.36 Tahun 2023', '1. Dokumen hasil identifikasi potensi benturan kepentingan dalam tugas fungsi utama untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 23\n2. Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1745, '1103', '2025', '92', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1746, '1103', '2025', '93', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'Penanganan Benturan Kepentingan telah diimplementasikan ke seluruh layanan seperti penguatan komitmen pegawai dalam bentuk surat pernyataan bebas benturan kepentingan, pakta integritas, dan pelaporan wajib LHKPN oleh pejabat terkait', '1. Dokumen surat pernyataan bebas dari benturan kepentingan untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 22\n2. Laporan Benturan Kepentingan berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 24.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
