	(1749, '1103', '2025', '98', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah menetapkan standar pelayanan terhadap seluruh jenis pelayanan, dan sesuai asas serta komponen standar pelayanan publik yang berlaku. Standar Pelayanan ditetapkan melalui Keputusan Kepala BPS Kabupaten Aceh Selatan', '1. Perka BPS No.65 Tahun 2024 tentang Standar Pelayanan Statistik Terpadu\n2. Keputusan Pejabat Pengelola Informasi dan Dokumentasi Badan Pusat Statistik No. B-323/02400/HK.200/07/2022 tentang Standar Layanan Informasi Publik di lingkungan Badan Pusat Statistik\n3. Dokumen SK standar pelayanan publik', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(1750, '1103', '2025', '99', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah memaklumatkan standar pelayanan pada seluruh jenis pelayanan dan dipublikasikan di media cetak, media sosial, website bps, dan website PPID.', '1. Dokumen maklumat standar pelayanan yang ditandatangani kepala satker paling lambat 7 hari setelah SK standar pelayanan terbit\n2. Capture/foto dokumen maklumat standar pelayanan di tempat pelayanan misal PST, website, dan media lainnya (social media)\n3. (iii) SK Maklumat Pelayanan', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
	(1751, '1103', '2025', '100', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan telah melakukan reviu dan perbaikan atas standar pelayanan dengan melibatkan stakeholders serta memanfaatkan masukan hasil SKM dan pengaduan masyarakat.', '1. Dokumentasi rapat reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders dan masyarakat (dilengkapi Undangan, Daftar Hadir, Notulensi, Dokumentasi Rapat)\n2. Dokumen reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders (antara lain : tokoh masyarakat, akademisi, dunia usaha, dan lembaga swadaya masyarakat), serta memanfaatkan masukan hasil SKM/SKD dan pengaduan masyarakat', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
