	(1948, '1103', '2025', '65', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun Matriks Peran Hasil (MPH) setiap pegawai yang sesuai dengan dokumen Perencanaan Kinerja', '1. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link PK 2025 yang diupload di PPID\n3. Seluruh dokumen MPH dari aplikasi Kipapp yang ditandatangani oleh pimpinan', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1949, '1103', '2025', '66', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS telah menerbitkan Perka Nomor 3 Tahun 2022 tentang reviu IKU sebagai landasan penyusuna Perjanjian Kinerja (PK)', '1. Dokumen Peraturan Kepala BPS Nomor 3 Tahun 2022 terkait Reviu IKU di Lingkungan BPS Tahun 2020-2024;\n2. Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
