	(1951, '1103', '2025', '68', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun Laporan Kinerja (LAKIN) periode 2025 secara tepat waktu, dibuktikan dengan screenshot unggah dokumen LAKIN ke Simonev yang tepat waktu', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan secara tepat waktu;\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID;\n3. Screenshot bukti unggah Laporan Kinerja 2025 secara tepat waktu', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1952, '1103', '2025', '69', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Dokumen Laporan Kinerja (LAKIN) periode 2025 yang telah disusun sudah memberikan informasi yang lengkap mengenai kinerja dari BPS Kabupaten Aceh Selatan selama periode 2025', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1953, '1103', '2025', '70', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah menyusun sistem akuntabilitas kinerja yang dimulai dari pembentukan Tim Sistem Akuntabilitas Kinerja Instansi Pemerintah (SAKIP) di lingkungan BPS Kabupaten Aceh Selatan serta melakukan penyusunan SOP pengumpulan data Capaian Kinerja yang dikumpulkan secara periodik', '1. Peraturan Kepala Badan Pusat Statistik Nomor 9 Tahun 2015 tentang Pedoman Penyusunan Sistem Akuntabilitas Kinerja Instansi Pemerintah di Lingkungan Badan Pusat Statistik\n2. SK Tim SAKIP Tahun 2025\n3. SOP Pengumpulan Data Kinerja sesuai dengan kondisi masing-masing satuan kerja yang ditandatangani oleh pimpinan (mengacu pada surat Sekretaris Utama terkait Pelaporan Capaian Kinerja Triwulanan Tahun 2025).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1954, '1103', '2025', '71', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum ada link bukti dukung', NULL, 'Sebanyak 14 dari 20 orang pegawai yang tergabung dalam Tim SAKIP BPS Kabupaten Aceh Selatan Tahun', '1. SK Tim SAKIP Tahun 2025\n2. Dokumen daftar data individu seluruh anggota Tim SAKIP yang memuat data kompetensi dan sertifikat pembinaan terkait akuntabilitas kinerja (akumulasi kompetensi hingga tahun 2025).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(1955, '1103', '2025', '74', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah melakukan public campaign terkait pengendalian gratifikasi dan telah dipublikasikan secara berkala, diantaranya melalui: sosialisasi di media sosial setiap sebulan sekali, pemasangan banner dan spanduk tentang larangan gratifikasi, serta melakukan sosialisasi larangan gratifikasi pada rapat internal pegawai', '1. Dokumentasi atau screenshoot banner/spanduk/media sosial yang menunjukan pengendalian gratifikasi telah dipublikasikan secara berkala (per bulan/triwulan/semester)\n2. Dokumen sosialisasi larangan gratifikasi dalam rapat internal maupun eksternal (undangan, notulen, daftar hadir)', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1956, '1103', '2025', '75', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah membentuk Unit Pengendalian Gratifikasi (UPG) yang telah menyusun mekanisme pengendalian gratifikasi di lingkungan BPS Kabupaten Aceh Selatan, serta telah dilaksanakan dan dilakukan evaluasi terhadap upaya pengendalian gratifikasi', '1. SK terkait unit pengendalian gratifikasi (UPG);\n2. Mekanisme atau SOP terkait pengendalian gratifikasi;\n3. Laporan implementasi pengendalian gratifikasi.', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
	(1957, '1103', '2025', '77', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah melakukan sosialisasi SPIP kepada seluruh pegawai, dilanjutkan dengan membetuk Tim SPIP yang bertugas melakukan pengendalian internal di linkungan BPS Kabupaten Aceh Selatan. Beberapa upaya pengendalian yang telah dilakukan diantaranya adalah: \n- Sosialisasi terkait rencana pengendalian internal\n- Pengendalian dan Pengelolaan atas Sistem Informasi\n- Pengendalian atas Aset Fisik\n- Kegiatan Pengawasan dan Monitoring Kualitas yang memuat inovasi dari BPS Kabupaten Aceh Selatan\n- serta melakukan Monitoring dan evaluasi atas pelaksanaan upaya pengendalian', '1. Dokumen sosialisasi SPIP (undangan, notulen, materi/ paparan, daftar hadir, dokumentasi/foto)\n2. SK tim SPIP ;\n3. Dokumen laporan penyelenggaraan SPIP (tambahkan subbab terkait inovasi, jika ada).', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
