	(1961, '1103', '2025', '82', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Belum mengisi target dan realisasi serta belum ada link bukti dukung', NULL, 'BPS Kabupaten Aceh Selatan telah mengimplementasikan seluruh kebijakan pengaduan masyarakat, diantaranya yaitu:\n1. Pengaduan melalui link Form Pengaduan BPS Kabupaten Aceh Selatan yang informasinya ditampilkan pada website\n2. Pengaduan melalui website SP4N -LAPOR! yang informasinya ditampilkan pada banner di halaman kantor\n3. Pengaduan melalui WA BPS Kabupaten Aceh Selatan yang informasinya ditampilkan pada medsos\n4. Pengaduan melalui kotak saran yang diletakkan di ruang PST BPS Kabupaten Aceh Selatan', '1. SK petugas Pengelola Pengaduan Masyarakat\n2. Dokumen kebijakan pengaduan\n3. Dokumentasi media/sarana pengaduan masyarakat yang dilengkapi dengan narasi\n4. Dokumentasi spanduk/banner/flyer informasi sarana penyampaian pengaduan yang dilengkapi dengan narasi; dan\n5. Laporan pengelolaan pengaduan', NULL, NULL, NULL, NULL, 'dewirahayu', NULL, NULL, NULL, NULL, NULL),
