	(1982, '1103', '2025', '108', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'link bukti dukung tidak ada', NULL, 'BPS Kabupaten Aceh Selatan memiliki inovasi pelayanan berupa kolase aktualisasi', '1. Laporan inovasi pelayanan publik (Inovasi tidak harus yang berupa pengembangan aplikasi berbasis IT', NULL, NULL, NULL, NULL, 'nyimas.hasnita', NULL, NULL, NULL, NULL, NULL),
