	(2168, '1105', '2025', '60', NULL, '2', '2', 'https://drive.bps.go.id/s/yDBMm68c56fGJqZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'isian sudah sesuai', NULL, 'Kepala BPS Kabupaten Aceh Timur telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Penetapan Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor proses revisi anggaran', '1. Undangan, notula, daftar hadir, foto rapat perencanaan kegiatan dan anggaran;\n2. Dokumen Perjanjian Kinerja (PK) 2025\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Dokumen perencanaan anggaran dan kegiatan dalam Petunjuk Operasional Kegiatan (POK)', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(2169, '1105', '2025', '61', NULL, '2', '2', 'https://drive.bps.go.id/s/5EwMTaJ89tEyDrK', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Untuk Matriks Peran Hasil (MPH) mohon diupload file pdf yang sudah bertanda tangan pimpinan', NULL, 'Kepala BPS Kabupaten Aceh Timur telah terlibat dalam setiap tahapan kegiatan penyusunan perencanaan, mulai dari memimpin rapat perencanaan kinerja dan anggaran, memonitor proses penyusunan dokumen Perjanjian Kinerja (PK) yang dapat diakses melalui PPID, serta memonitor penyusunan matriks peran hasil setiap pegawai', '1. Undangan, notula disertai kertas kerja dasar hitung dalam penentuan target kinerja, daftar hadir, dan foto rapat penyusunan penetapan kinerja\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link PK 2025 yang diupload di PPID\n4. Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(2170, '1105', '2025', '62', NULL, '4,7,10,12', '4,7,10', 'https://drive.google.com/drive/folders/1kCQ-w8KAUPpP4cBQogmHx4EVWDKHTUfV?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Mohon Upload Dokumen FRA Triwulan IV', NULL, 'Kepala Kabupaten Aceh Timur telah terlibat dalam setiap tahapan kegiatan, mulai dari penyusunan perencanaan, monitoring pelaksanaan rencana kerja dan anggaran, evaluasi capaian kinerja dan anggaran setiap triwulanan, hingga monitoring tindak lanjut hasil evaluasi kerja', 'Undangan, notula (disertai kendala, solusi, tindak lanjut, PIC tindak lanjut, dan batas waktu tindak lanjut), daftar hadir, foto rapat monitoring capaian kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(2171, '1105', '2025', '64', NULL, '2,11', '2,11', 'https://drive.bps.go.id/s/bf6F6riqyH7kGJr', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'harap upload Perka nomor 163 Tahun 2025 tentang IKU di BPS 2025-2029 ( sementara renstra belum ada )', NULL, 'BPS Kabupaten Aceh Timur telah menyusun Renstra 2020-2024 dan sudah dilakukan reviu, serta telah menyusun Perjanjian Kinerja yang sudah diupload di web PPID', '1. Rencana Strategis (Renstra) 2025–2029 dan Reviu Renstra 2025-2029\n2. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n3. Dokumen daftar link Renstra 2025–2029, Reviu Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(2172, '1105', '2025', '65', NULL, '2', '2', 'https://drive.bps.go.id/s/763dHia4aHDBJZt', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Untuk Matriks Peran Hasil (MPH) mohon diupload file pdf yang sudah bertanda tangan pimpinan', NULL, 'BPS Kabupaten Aceh Timur telah menyusun Matriks Peran Hasil (MPH) setiap pegawai yang sesuai dengan dokumen Perencanaan Kinerja', '1. Dokumen PK 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link PK 2025 yang diupload di PPID\n3. Seluruh dokumen MPH dari aplikasi Kipapp yang ditandatangani oleh pimpinan', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(2173, '1105', '2025', '66', NULL, '1', '1', 'https://drive.bps.go.id/s/2DicfNEgcRoPnrL', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'harap upload Perka nomor 163 Tahun 2025 tentang IKU di BPS 2025-2029 ( sementara renstra belum ada )', NULL, 'BPS telah menerbitkan Perka Nomor 3 Tahun 2022 tentang reviu IKU sebagai landasan penyusuna Perjanjian Kinerja (PK)', '1. Dokumen Peraturan Kepala BPS Nomor 3 Tahun 2022 terkait Reviu IKU di Lingkungan BPS Tahun 2020-2024;\n2. Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(2174, '1105', '2025', '67', NULL, '12', '12', 'https://drive.google.com/drive/folders/1towX6u3ypAexYJNgONOi_uHUOxEuSnvB?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum ada bukti dukung yang di upload', NULL, 'Berdasarkan LAKIN BPS Kabupaten Aceh Timur 2025, seluruh indikator kinerja telah Spesifik (Spesific), Terukur (Measurable), Dapat Dicapai (Achievable), Relevan (Relevant), serta memiliki Batas Waktu (Time-Bound)', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
	(2175, '1105', '2025', '68', NULL, '12', '12', 'https://drive.google.com/drive/folders/1ZSPaqv8Mk3hl7aq_9EqUcZO7DlDGKQxR?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'BPS Kabupaten Aceh Timur telah menyusun Laporan Kinerja (LAKIN) periode 2025 secara tepat waktu, dibuktikan dengan screenshot unggah dokumen LAKIN ke Simonev yang tepat waktu', '1. Dokumen Laporan Kinerja 2025 yang ditandatangani oleh pimpinan secara tepat waktu;\n2. Dokumen daftar link Laporan Kinerja 2025 yang diupload di PPID;\n3. Screenshot bukti unggah Laporan Kinerja 2025 secara tepat waktu', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
