	(2177, '1105', '2025', '70', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1-LRPYKDRHBR-aSRC62mRVwhYvRXeHjtb?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'BPS Kabupaten Aceh Timur telah menyusun sistem akuntabilitas kinerja yang dimulai dari pembentukan Tim Sistem Akuntabilitas Kinerja Instansi Pemerintah (SAKIP) di lingkungan BPS Kabupaten Aceh Timur serta melakukan penyusunan SOP pengumpulan data Capaian Kinerja yang dikumpulkan secara periodik', '1. Peraturan Kepala Badan Pusat Statistik Nomor 9 Tahun 2015 tentang Pedoman Penyusunan Sistem Akuntabilitas Kinerja Instansi Pemerintah di Lingkungan Badan Pusat Statistik\n2. SK Tim SAKIP Tahun 2025\n3. SOP Pengumpulan Data Kinerja sesuai dengan kondisi masing-masing satuan kerja yang ditandatangani oleh pimpinan (mengacu pada surat Sekretaris Utama terkait Pelaporan Capaian Kinerja Triwulanan Tahun 2025).', NULL, NULL, NULL, NULL, 'ferfi.hamdina', NULL, NULL, NULL, NULL, NULL),
