	(2369, '1107', '2025', '27', NULL, '1', '1', 'https://drive.google.com/drive/folders/1hTY9fy0mcVR8ByDGIF8ZiY2-yhZ7HjXC?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', '1. Tidak ada dok screenshot aplikasi yang digunakan\n2. Tidak ada inovasi yang dilengkapi dengan laporan', NULL, 'Membuat daftar seluruh penerapan teknologi informasi yang digunakan terkait operasionalisasi managemen SDM', 'Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait operasionalisasi manajemen SDM (Misal SIMPEG dan Sijafung, dan atau inovasi lain jika ada);\n\nDokumen Screenshot aplikasi terkait operasionalisasi manajemen SDM dan sudah berjalan\n\nInovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
	(2370, '1107', '2025', '28', NULL, '1', '1', 'https://drive.google.com/drive/folders/1cyop7eb3CIRgaAX_gBtBgfSp_ihZxu5A', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Membuat daftar seluruh penerapan teknologi informasi yang digunakan terkait pemberian pelayanan publik', '(i) Daftar seluruh pelayanan publik yang sudah menggunakan teknologi informasi\n\n(ii) Dokumen Screenshoot terkait pemberian pelayanan publik yang sudah menggunakan teknologi informasi seperti Website, Romantik, Indah, dll', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
