	(2390, '1107', '2025', '55', NULL, '7,12', '7,12', 'https://drive.google.com/drive/folders/1q-D_Aq4LTePzqQ4Y37O8BpGiv_6q0Sdg', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung belum di upload', NULL, '1. Dapatkan peraturan aturan disiplin/kode etik/kode perilaku; \n2. Dapatkan laporan penegakan hukuman atas pelanggaran aturan disiplin/kode etik/kode perilaku;\n3. Teliti apakah sudah seluruh/sebagain aturan disiplin/kode etik/kode perilaku telah dilaksakan/diimplemetasikan; \n4. Dapatkan dokumen inovasi terkait aturan disiplin/kode etik/kode perilaku (jika ada);\n5. Pastikan  inovasi yang dilakukan terkait implementasi aturan disiplin/kode etik/kode perilaku yang sesuai dengan karakteristik unit kerja.', '1. Peraturan aturan disiplin/kode etik/kode perilaku, dll (internal);\n2. Laporan penegakan hukuman atas pelanggaran aturan disiplin/kode etik/kode perilaku;\n3. Dokumen inovasi terkait aturan disiplin/kode etik/kode perilaku.', NULL, NULL, NULL, NULL, 'nova.misrina', NULL, NULL, NULL, NULL, NULL),
