	(2927, '1112', '2025', '24', NULL, '1,12', '1,12', 'https://drive.google.com/drive/folders/1xH7iF8zHTt66JoAI8nh62v0wr1Sfv3xk?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada dokumen \nSOP sebelum \nevaluasi \ndan setelah \nevaluasi', NULL, 'Monitoring dan evaluasi penerapan SOP Kegiatan Utama.', '1. Laporan review dan tindak lanjut penerapan SOP.\n2. Undangan, notulen, daftar hadir rapat awal tahun dan evaluasi SOP\n3. Dokumen SOP sebelum evaluasi dan setelah evaluasi', NULL, NULL, NULL, NULL, 'nasliyah.husna', NULL, NULL, NULL, NULL, NULL),
