	(3067, '1113', '2025', '64', NULL, '1,2', '1,2', '4.ii.a. Dokumen perencanaan kinerja sudah ada', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat link bukti dukung', NULL, 'Memiliki kertas kerja seperti Form Rencana Aksi (FRA) yang dituangkan kedalam Perjanjian Kinerja (PK) Tahunan.', '(i) PK 2025\n(ii) Surat undangan, notulen, daftar hadir, dan dokumetasi rapat penetapan target PK\n(iii) Surat undangan, notulen, daftar hadir, dan dokumetasi rapat reviu renstra\n(iv) Dokumen Renstra dan Reviu Renstra', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
