	(3069, '1113', '2025', '66', NULL, '1', '1', '4.ii.c. Terdapat penetapan Indikator Kinerja Utama (IKU)', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat link bukti dukung', NULL, 'Perka IKU yang tertuang didalam Peraturan Kepala BPS Nomor 38 Tahun 2025 tentang IKU Tahun 2025-2029.', '(i) Keselarasan Perka IKU dan PK Tahun 2025\n(ii) Perka IKU BPS \n(iii) Perjanjian Kinerja Tahun 2025', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3070, '1113', '2025', '67', NULL, '1,2', '1,2', '4.ii.d. Indikator kinerja telah telah memenuhi kriteria SMART', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat link bukti dukung', NULL, 'Memiliki indikator kinerja yang SMART (Spesific, Measurable, Achivable, Relevant, Timely/ Continuity) yang dituangkan didalam IKU dan Laporan Kinerja', '(i) Keselarasan Perka IKU dan PK Tahun 2025\n(ii) Perka IKU BPS \n(iii) Laporan Kinerja Tahun 2024 dan 2025\n(iv) Simonev Laporan Kinerja Tahun 2024 dan 2025', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3071, '1113', '2025', '68', NULL, '2', '2', '4.ii.e. Laporan kinerja telah disusun tepat waktu', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat link bukti dukung', NULL, 'Menyusun LAKIP secara tepat waktu dan diunggah di dalam website BPS Kabupaten Gayo Lues (https://gayolueskab.bps.go.id/) sesuai dengan Peraturan Kepala BPS Nomor 9 Tahun 2015 tentang Pedoman Penyusunan Sistem Akuntabilitas Kinerja Instansi Pemerintah di lingkungan BPS.', '(i) Laporan Kinerja 2024 dan 2025\n(ii) Screenshoot bukti unggah ke SiMonev dan/atau Web secara tepat waktu\n(iii) Berita acara deadline penyusunan laporan kinerja', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3072, '1113', '2025', '69', NULL, '1,2', '1,2', '4.ii.f. Laporan kinerja telah memberikan informasi tentang kinerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat link bukti dukung', NULL, 'Menyusun Laporan Kinerja secara tepat waktu dan diunggah di dalam website BPS Kabupaten Gayo Lues (https://gayolueskab.bps.go.id). Laporan Kinerja tersebut menyajikan informasi tentang kinerja yang telah dilakukan oleh pegawai di Kabupaten Gayo Lues.', '(i) Laporan Kinerja 2024 dan 2025\n(ii) PK 2024\n(iii) Hasil Evaluasi AKIP 2025', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3073, '1113', '2025', '70', NULL, '1,5', '1,5', '4.ii.g. Terdapat sistem informasi/mekanisme informasi kinerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat link bukti dukung', NULL, 'Memiliki mekanisme kinerja yang disusun dalam Standar Operasional Prosedur (SOP) dan juga SK Tim Pengumpulan Data Kinerja 2025-2026', '(i) Sertifikat Workshop Evaluasi atas Implementasi SAKIP 2025\n(ii) SK Tim Pengumpulan Data Kinerja 2025\n(iii)Dokumen tindak lanjut upaya peningkatan kapasitaas SDM\n(iv) Monitoring matriks rekap jumlah pelatihan\n(v) SOP Pengumpulan Data Kinerja Triwulanan Tahun 2025', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3074, '1113', '2025', '71', NULL, '1,5', '1,5', '4.ii.h. Unit kerja telah berupaya meningkatkan kapasitas SDM yang menangangi akuntabilitas kinerja', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat link bukti dukung', NULL, 'Meningkatkan kapasitas SDM yang menangani akuntabilitas kinerja, dengan cara melakukan/mengikutsertakan dalam bimtek/diklat dan melakukan rapat evaluasi teknis.', '(i) Sertifikat berbagai kegiatan peningkatan kapasitas SDM\n(ii) Rapat evaluasi kegiatan \n(iii) Surat undangan, notula, daftar hadir, dan dokumetasi pembinaan administrasi dan keuangan tahun 2024\n(iv) Dokumen tindak lanjut upaya peningkatan kapasitaas SDM', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
