	(3173, '1114', '2025', '53', NULL, '8,12', '8', 'https://drive.google.com/open?id=1lqGqJUeYC0BbtlpnSvcx1HkJvFtCVc32&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak terdapat evaluasi dan bukti dukung', NULL, 'Menyusun mekanisme Penilaian Pegawai berprestasi; Pemberian Tunjangan Kinerja berdasarkan nilai CKP dan kedisiplinan.', '1. Form daftar usulan pegawai teladan (IST)\n 2. Undangan dan kriteria pemberian award pegawai\n 3. Sertifikat pegawai yang mendapatkan award\n 4. Kertas kerja pemilihan pegawai teladan\n 5. SKP Bulanan', NULL, NULL, NULL, NULL, 'su.miati', NULL, NULL, NULL, NULL, NULL),
	(3174, '1114', '2025', '55', NULL, '1,12', '1', 'https://drive.google.com/open?id=1S-nneu6rVDXJS6tcGaOFu2w2DhzDa_LD&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak terdapat evaluasi dan bukti dukung', NULL, 'Implementasi seluruh aturan disiplin/kode etik/kode perilaku yang ditetapkan organisasi dan juga membuat inovasi terkait aturan disiplin/kode etik/kode perilaku yang sesuai dengan karakteristik unit kerja', '1. Peraturan aturan kode etik \n 2. Laporan monitoring dan evaluasi penegakan disiplin\n 3. Laporan Inovasi hukuman disiplin', NULL, NULL, NULL, NULL, 'su.miati', NULL, NULL, NULL, NULL, NULL),
	(3175, '1114', '2025', '57', NULL, '1', '1', 'https://drive.google.com/open?id=1LRvgkqF0PYVChIUlfMsZ5vHF-yEIuXjF&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak terdapat evaluasi dan bukti dukung', NULL, 'Tersedianya data informasi kepegawaian unit kerja yang telah dimutakhirkan secara berkala di SIMPEG', '(i) Laporan Pemutakhiran data informasi kepegawaian yang ditanda tangani oleh pimpinan\n(ii) Dokumen Entri Data Rekap Aktivitas dari SIMPEG\n(iii) Screencapture Pemutakhiran Data Informasi Kepegawaian pada SIMPEG', NULL, NULL, NULL, NULL, 'su.miati', NULL, NULL, NULL, NULL, NULL),
	(3176, '1114', '2025', '60', NULL, '3', '3', 'https://drive.google.com/open?id=1q3JnAPzqmdHJYf_8KBJch6B8oET-c3kj&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Rapat perencanaan Anggaran dan Kegiatan di pimpin langsung oleh atasan', '(i) Undangan, notula, daftar hadir, foto rapat\n  perencanaan kegiatan dan anggaran; \n  (ii) Dokumen perencanaan kegiatan dan anggaran\n  yang memuat Perjanjian Kinerja (PK) 2025; \n  (iii) Dokumen daftar link PK 2025 yang diupload di\n  PPID; \n  (iv) Dokumen perencanaan kegiatan dan anggaran\n  yang memuat Petunjuk Operasional Kegiatan\n  (POK).', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3177, '1114', '2025', '61', NULL, '1,3', '1,3', 'https://drive.google.com/open?id=1D1iUhiFcUf2AaZKQ7UCbcd6_xPD8nv48&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Pimpinan terlibat langsung pada saat Rapat Penyusunan  penetapan PK 2025', '(i) Undangan, notula disertai kertas kerja dasar hitung \n  dalam penentuan target kinerja, daftar hadir, dan\n  foto rapat penyusunan penetapan kinerja; \n  (ii) Dokumen PK 2025 yang ditandatangani oleh\n  pimpinan; \n  (iii) Dokumen daftar link PK 2025 yang diupload di\n  PPID; \n  (iv) Seluruh dokumen Matriks Peran Hasil (MPH) dari\n  aplikasi Kipapp yang ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3178, '1114', '2025', '62', NULL, '3,4,7,10', '3,4,7,10', 'https://drive.google.com/open?id=1X3ANmJMQliZIIJv5sPGL_YLy9vRTyhNY&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Pimpinan terlibat langsung pada saat Rapat Penyusunan PK dan Rapat FRA', '(i) Undangan, notula (disertai kendala, solusi, tindak \n  lanjut, PIC tindak lanjut, dan batas waktu tindak\n  lanjut), daftar hadir, foto rapat monitoring capaian\n  kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3179, '1114', '2025', '64', NULL, '3', '3', 'https://drive.google.com/open?id=1nmWJiSevBWcAatX6kk6794Tm7Vk_Y3wv&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum tersedia Renstra 2025-2029', NULL, 'Membuat dokumen Resntra 2025-2029 dan Perjanjian Kinerja 2025', '(i) Rencana Strategis (Renstra) 2025–2029;\n  (ii) Dokumen PK 2025 yang ditandatangani oleh \n  pimpinan; \n  (iii)   Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3180, '1114', '2025', '65', NULL, '1,3', '1,3', 'https://drive.google.com/open?id=1AD5zYMPfvu_w9_NUDz-dMlepD-A8k3uo&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Dokumen Perencanaan harus berorientasi pada hasil', '(i) Dokumen PK 2025 yang ditandatangani oleh \n  pimpinan;\n  (ii) Dokumen daftar link PK 2025 yang diupload di \n  PPID;\n  iii) Seluruh dokumen MPH dari aplikasi Kipapp yang \n  ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3181, '1114', '2025', '66', NULL, '3', '3', 'https://drive.google.com/open?id=18mYNKUDYPrMOGuXUduSedUS2K3QtAcue&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum tersedia surat terkait penyusunan Perjanjian Kinerja 2025', NULL, 'Memenuhi IKU BPS Kabupaten Aceh Tamiang', '(i) Dokumen Peraturan Kepala BPS;   (ii) Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3182, '1114', '2025', '67', NULL, '3', '3', 'https://drive.google.com/open?id=1fxwxin0lOaOEPrQ8lUD3-OV0hthZqBDH&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum tersedia Laporan Kinerja 2025 dan daftar link Laporan Kinerja 2025 yang \n  diupload di PPID.', NULL, 'IKU telah dilaksanakan dengan prinsip SMART', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3183, '1114', '2025', '68', NULL, '3', '3', 'https://drive.google.com/open?id=1RP8-1U_63TmC_Q-0MAZl50NUTnuouSZg&usp=drive_fs', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum tersedia Dokumen Laporan Kinerja 2025,\n daftar link Laporan Kinerja 2025 yang \n  diupload di PPID dan Screenshot bukti unggah Laporan Kinerja 2025', NULL, 'LAKIN disusun tepat waktu', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan secara tepat waktu;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID;\n  (iii) Screenshot bukti unggah Laporan Kinerja 2025 \n  secara tepat waktu.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
