	(3187, '1114', '2025', '74', NULL, '6', '6', 'https://drive.google.com/drive/u/2/folders/1IpChg2EAiTcW-NVXjpuOjjvNGmoQd9V3', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sudah sesuai', NULL, 'Pelaksanaan public campaign pengendalian gratifikasi', '(i) Dokumentasi atau screenshoot \nbanner/spanduk/media sosial yang menunjukan\npengendalian gratifikasi telah dipublikasikan secara\r\nberkala (per bulan/triwulan/semester); \n(ii) Dokumen sosialisasi larangan gratifikasi dalam\nrapat internal maupun eksternal (undangan,\nnotulen, daftar hadir).', NULL, NULL, NULL, NULL, 'elisa.ismi', NULL, NULL, NULL, NULL, NULL),
