	(3203, '1114', '2025', '94', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1EUzuiBue3wUR4N-By2eyC7ib9trV-QDN?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan terdapat bukti dukung pada link', NULL, 'Evaluasi penanganan benturan kepentingan', '(i) Laporan monitoring dan evaluasi penanganan\r\nbenturan kepentingan berdasarkan lampiran Perka\r\nBPS Nomor 36 Tahun 2023 tentang Pedoman\r\nPenanganan Benturan Kepentingan di Lingkungan\r\nBadan Pusat Statistik halaman 25.', NULL, NULL, NULL, NULL, 'elisa.ismi', NULL, NULL, NULL, NULL, NULL),
