	(3307, '1115', '2025', '84', NULL, '3,6,9,12', '3,6,9,12', 'https://drive.google.com/drive/folders/1h812_qzo00yDDzHm7Mb6QkdiwLtY6Kyd?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum terdapat Dokumentasi pelaksanaan rapat evaluasi dan monitoring (undangan, daftar hadir, notulen)', NULL, 'Laporan Tindak Lanjut Pengaduan Setiap Triwulan', '(i) Laporan pengelolaan pengaduan dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis aduan)\nb. Tindak lanjut aduan\nc. Kendala dan solusi dalam penanganan aduan\nd. Hasil evaluasi atas tindak lanjut penanganan pengaduan masyarakat\n(ii) Dokumentasi pelaksanaan rapat evaluasi dan monitoring (undangan, daftar hadir, notulen);', NULL, NULL, NULL, NULL, 'elisa.ismi', NULL, NULL, NULL, NULL, NULL),
