	(3317, '1115', '2025', '98', NULL, '1,6', '1,6', 'https://drive.google.com/drive/folders/14s-xe-qWv4xFM3_JPyY43ChkuK2QKM_A?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung sudah sesuai', NULL, 'Melakukan Penetapan Standar Pelayanan Publik dengan mengundang 5 unsur masyarakat, yaitu Penyelenggara Layanan, Akademisi/Peneliti, Organisasi Masyarakat, Pengguna Layanan, Media Massa dan diilakukan reviu atas Standar Pelayanan Sebelumnya serta melakukan penandatanganan Maklumat Pelayanan', '(i) Perka BPS No.65 Tahun 2024 tentang Standar Pelayanan Statistik Terpadu;\r\n(ii) Keputusan Pejabat Pengelola Informasi dan Dokumentasi Badan Pusat Statistik No. B323/02400/HK.200/07/2022 tentang Standar Layanan Informasi Publik di lingkungan Badan Pusat Statistik;\r\n(iii) Dokumen SK standar pelayanan publik..', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3318, '1115', '2025', '99', NULL, '1,6', '1,6', 'https://drive.google.com/drive/folders/1sxmN3NlNl6RL-f0jZLs5p1wVSdL59Iku?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung sudah sesuai', NULL, 'Melakukan Penetapan Standar Pelayanan Publik dengan mengundang 5 unsur masyarakat, yaitu Penyelenggara Layanan, Akademisi/Peneliti, Organisasi Masyarakat, Pengguna Layanan, Media Massa dan diilakukan reviu atas Standar Pelayanan Sebelumnya serta melakukan penandatanganan Maklumat Pelayanan', '(i) Dokumen maklumat standar pelayanan yang ditandatangani kepala satker paling lambat 7 hari setelah SK standar pelayanan terbit;\r\n(ii) Capture/foto dokumen maklumat standar pelayanan di tempat pelayanan misal PST, website, dan media lainnya (social media);\r\n(iii) SK Maklumat Pelayanan.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3319, '1115', '2025', '100', NULL, '3,6,9,12', '3,6,9,12', 'https://drive.google.com/drive/folders/1dCs-1uD3PY5ia0osNNIqbOVRMWjLjo92?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung sudah sesuai', NULL, 'Melakukan Penetapan Standar Pelayanan Publik dengan mengundang 5 unsur masyarakat, yaitu Penyelenggara Layanan, Akademisi/Peneliti, Organisasi Masyarakat, Pengguna Layanan, Media Massa dan diilakukan reviu atas Standar Pelayanan Sebelumnya serta melakukan penandatanganan Maklumat Pelayanan', '(i) Dokumentasi rapat reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders dan masyarakat (dilengkapi Undangan, Daftar Hadir, Notulensi, Dokumentasi Rapat);\r\n(ii) Dokumen reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders (antara lain : tokoh masyarakat, akademisi, dunia usaha, dan lembaga swadaya masyarakat), serta memanfaatkan masukan hasil SKM/SKD dan pengaduan masyarakat.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3320, '1115', '2025', '101', NULL, '1,6', '1,6', 'https://drive.google.com/drive/folders/1Ya3v9b6dmvg0Mmvsj9lY6LQB3UxzzwzK?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung sudah sesuai', NULL, 'Standar Pelayanan yang telah ditetapkan dipublikasikan di berbagai kanal digital serta media lainnya di lingkungan BPS Kabupaten Nagan Raya', '(i) Dokumen bukti maklumat pelayanan telah dipublikasikan di berbagai media;\r\n(ii) Dokumen bukti standar pelayanan telah dipublikasikan di berbagai media.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3321, '1115', '2025', '103', NULL, '6,12', '6,12', 'https://drive.google.com/drive/folders/1UztKSBtuqzFnI8DenXO5q3XEBQPyRALX?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambhakan bukti dukung pada alink beruka:\n1. Dokumen pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan, antara lain: - rapat (undangan, daftar hadir, notulen);\r\n\r\n2. Laporan dan materi pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan.\r\n\r\n3. Dokumen jadwal pelatihan/sosialisasi yang menunjukkan bahwa pelatihan/sosialisasi diakukan secara berkelanjutan dan terjadwal;\r\n\r\n4. Dokumen monitoring dan evaluasi atas pegawai/petugas layanan.', NULL, 'Petugas Pelayanan dan Seluruh Pegawai telah disosialisasi atau dilakukan briefing terkait Pelayanan yang Prima', '(i) Dokumen pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan, antara lain:\r\n- rapat (undangan, daftar hadir, notulen);\r\n(ii) laporan dan materi pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan.\r\n(iii) Dokumen jadwal pelatihan/sosialisasi yang menunjukkan bahwa pelatihan/sosialisasi dilakukan secara berkelanjutan dan terjadwal;\r\n(iv) Dokumen monitoring dan evaluasi atas kualitas layanan yang diberikan oleh pegawai/petugas layanan.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3322, '1115', '2025', '104', NULL, '6,12', '6,12', 'https://drive.google.com/drive/folders/1ZI4nYJ80HLbY63I5td0sJD_x_IbiiSYU?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tambahkan bukti dukung berupa :\nDokumen Capture sarana informasi tentang pelayanan yang disediakan telah terdaftar dan muncul pada SIPPN.', NULL, NULL, '(i) Dokumen Capture sarana informasi tentang pelayanan yang disediakan pada berbagai media;\r\n(ii) Dokumen Capture sarana informasi tentang pelayanan yang disediakan telah terdaftar dan muncul pada SIPPN', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3323, '1115', '2025', '105', NULL, '6,12', '6,12', 'https://drive.google.com/drive/folders/1iRMgPvfCNUsJ_eSsqDXiZqbRIfI0wLzN?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung sudah sesuai', NULL, 'Pegawai atau Petugas Pelayanan diberikan Perhargaan atau Apresiasi dengan mekanisme yang sudah dibuat beserta sanksi jika diperlukan', '(i) Dokumen mekanisme reward dan punishment yang minimal memenuhi unsur penilaian disiplin, kinerja, dan hasil penilaian pengguna layanan;\r\n(ii) Dokumen penghargaan atas pelaksanaan pelayanan yang baik secara tahunan.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3324, '1115', '2025', '106', NULL, '6,12', '6,12', 'https://drive.google.com/drive/folders/1B2VUII6M7pBfRXgMP8rxbG8u48_E-niH?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tambahkan bukti dukung berupa:\n1. Dokumen mekanisme pemberian kompensasi pada setiap jenis layanan;\r\n\r\n2. Dokumentasi bukti kompensasi kepada penerima layanan (jika ada).', NULL, NULL, '(i) Dokumen mekanisme pemberian kompensasi pada setiap jenis layanan;\r\n(ii) Dokumentasi bukti pemberian kompensasi kepada penerima layanan (jika ada).', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3325, '1115', '2025', '107', NULL, '1,6', '1,6', 'https://drive.google.com/drive/folders/1z4lx6_PFRvHgOONE86Zd7gkQur-yMtfw?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tambahkan bukti dukung berupa :\n1. Dokumentasi aplikasi layanan PST;\r\n\r\n2. Dokumentasi layanan berbasis online (website);\r\n\r\n3. Dokumentasi layanan berbasis aplikasi (Allstat).', NULL, 'Sarana layanan dapat diakses oleh pengguna layanan dan dipublikasikan serta pengguna layanan yang datang secara langsung dapat terlayani', '(i) Dokumentasi aplikasi layanan PST;\r\n(ii) Dokumentasi layanan berbasis online (website);\r\n(iii) Dokumentasi layanan berbasis aplikasi (Allstat).', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3326, '1115', '2025', '108', NULL, '1', '1', 'https://drive.google.com/drive/folders/1nZxyUbPtzRXSVFMYPnfM9_6vEzR1PBTi?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'tambahkan bukti dukung berupa:\n1. Dokumen bukti bahwa inovasi telah direplikasi', NULL, 'Inovasi pelayanan telah dipersiapkan dan diimplementasikan', '(i) Laporan inovasi pelayanan publik (Inovasi tidak harus yang berupa pengembangan aplikasi berbasis IT, namun dapat berupa penambahan dekoratif pada ruang layanan, penyediaan layanan bagi disabilitas, pemberian layanan secara jemput bola seperti pojok statistik, road show/sosialisasi terkait pemberian layanan) yang dilegalisir oleh pimpinan;\r\n(ii) Dokumen bukti bahwa inovasi telah direplikasi.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
