	(3341, '1115', '2025', '138', NULL, '9', '9', 'https://drive.google.com/drive/folders/1d8NxT5Bx-Td2Um5AMEzOPmSIHg_rMx4O?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Menyusun laporan layanan pada pelayanan publik', '(i) Daftar Layanan pada pelayanan publik yang mengimplementasikan SPBE \n\n(ii) Dokumen narasi penjelasan SPBE;\n\n(iii) Dokumen yang menyatakan bahwa SPBE telah terintegrasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3342, '1115', '2025', '139', NULL, '9', '9', 'https://drive.google.com/drive/folders/1vjzuykH0C2NZieR3w1O00Q48vP8j-lIP?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Menyusun laporan layanan pada pelayanan internal organisasi', '(i) Daftar Layanan pada pelayanan internal organisasi yang mengimplementasikan SPBE dan disertai narasi dampak implementasi SPBE (hanya yang bersifat internal), seperti Back Office Selindo/BOS, Kipapp, Sipecut, dan lain-lain;\n\n(ii) Dokumen narasi penjelasan SPBE;\n\n(iii) Dokumen yang menyatakan bahwa SPBE telah terintegrasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3343, '1115', '2025', '141', NULL, '1,2,8', '1,2,8', 'https://drive.google.com/drive/folders/1RDpp8qvUQMB21wkIPyIBtcjDccCVRtOf?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'ada 1 bukti dukung yang belum ada \n1. Screen shot pemanfaatan CAPI pada berbagai \r\nsurvei di masing-masing satker', NULL, 'Menyusun laporan transformasi digital pada bidang proses bisnis utama', '(i) Narasi alasan perubahan metode pencacahan dari PAPI menjadi CAPI;\n\n(ii) Buku Pedoman penggunaan PAPI dan CAPI pada kegiatan Survei Angkatan Kerja Nasional Sakernas);\n\n(iii) Surat edaran BPS Pusat terkait pencacahan menggunakan CAPI;\n\n(iv) Screen shot pemanfaatan CAPI pada berbagai survei di masing-masing satker;\n\n(v) Dokumen evaluasi atas transformasi digital PAPI ke CAPI.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3344, '1115', '2025', '142', NULL, '1,3', '1,3', 'https://drive.google.com/drive/folders/1nSBGaUZfSKckKLCmG-MXx2itRNGtBCi7?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Masih terdapat 2 bukti dukung yang belum lengkap\n1. Narasi pemanfaatan BOS dan Kipapp dari buku \r\npedoman BOS dan Kipapp\n2. Dokumen evaluasi atas pemanfaatan BOS, dan \r\nKipapp.', NULL, 'Menyusun laporan transformasi digital pada bidang administrasi', '(i) Narasi pemanfaatan BOS dan Kipapp dari buku pedoman BOS dan Kipapp;\n\n(ii) Buku pedoman penggunaan BOS dan Kipapp;\n\n(iii) Surat edaran BPS Pusat terkait pemanfaatan BOS dan Kipapp;\n\n(iv) Screenshot pemanfaatan BOS dan Kipapp;\n\n(v) Dokumen evaluasi atas pemanfaatan BOS, dan Kipapp.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
