	(3545, '1117', '2025', '103', NULL, '2', NULL, 'https://drive.google.com/drive/folders/1LtByXMKNmC7IqvFG5s8ag2ZK8WY0RpLU?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambajkan Bukti Dukung:\r\n(i) Dokumen pelatihan/sosialisasi pelayanan prima\r\nkepada pegawai/petugas layanan, antara lain:\r\n- rapat (undangan, daftar hadir, notulen);\r\n(ii) laporan dan materi pelatihan/sosialisasi pelayanan\r\nprima kepada pegawai/petugas layanan.\r\n(iii) Dokumen jadwal pelatihan/sosialisasi yang\r\nmenunjukkan bahwa pelatihan/sosialisasi dilakukan\r\nsecara berkelanjutan dan terjadwal;\r\n(iv) Dokumen monitoring dan evaluasi atas kualitas\r\nlayanan yang diberikan oleh pegawai/petugas\r\nlayanan.\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPubli\r\nk_2a_bps', NULL, 'Pelatihan/Sosialisasi Pelayanan Prima Kepada Pegawai/Petugas\r\nLayanan', '(i) Sosialisasi Pelayanan Prima\r\n(ii) Materi Sosialisasi Pelayanan Prima ke Pegawai\r\n(iii) Laporan Monev ZI Triwulan 1 Tahun 2025\r\n(iv) Laporan Monev ZI Triwulan 2 Tahun 2025\r\n(v) Laporan Monev ZI Triwulan 3 Tahun 2025\r\n(vi) Laporan Monev ZI Triwulan 4 Tahun 2025', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3546, '1117', '2025', '104', NULL, '4,7,10,12', NULL, 'https://drive.google.com/drive/folders/19baISlOrSbE0aj-8yk1H-aWGAp2SaQ_u?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\r\n(i) Dokumen Capture sarana informasi tentang\r\npelayanan yang disediakan pada berbagai media;\r\n(ii) Dokumen Capture sarana informasi tentang\r\npelayanan yang disediakan telah terdaftar dan\r\nmuncul pada SIPPN\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPublik\r\n_2b_bps', NULL, 'Monitoring dan Evaluasi Atas Kualitas Layanan Yang Diberikan', '(i) Dokumen Capture sarana informasi tentang pelayanan yang disediakan pada berbagai media\r\n(ii) Dokumen Capture sarana informasi tentang pelayanan yang disediakan telah terdaftar dan muncul pada SIPPN', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
