	(3686, '1118', '2025', '160', NULL, '6,12', '6,12', 'https://drive.bps.go.id/s/82qsB8HgSx8LySx', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung 2024', NULL, 'Melakukan rekapan reward organisasi yang diperoleh dari internal maupun eksternal', '1. Dokumen LAKIN 2025 yang diTTD pimpinan\n2. Dokumen daftar link LAKIN 2025 yang diupload di PPID\n3. Narasi tentang reward untuk organisasi/satker yang menerima kinerja di atas target, baik dari pihak internal maupun eksternal BPS (disertakan piagam/sertifikatnya)', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
