	(3689, '1118', '2025', '167', NULL, '12', '12', 'https://drive.bps.go.id/s/asaWgDNqew28Wys', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget dan realisasi', NULL, 'Melakukan rekapan pengaduan masyarakat', 'Laporan pengelolaan pengaduan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
