	(3691, '1118', '2025', '179', NULL, '12', '12', 'https://drive.bps.go.id/s/Z3XqwkkkSaYzCHE', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget dan realisasi', NULL, 'Memastikan pelaporan SPT 100 persen', '1. Lampiran surat Inspektur Utama perihal Proses Pelaporan LHKAN Periode 2025\n2. (Daftar pegawai yang wajib mengisi SPT (ASN yang tidak wajib LHKPN) dan dilegalisasi oleh kepala satuan/unit kerja \n3. Screenshot bukti penyampaian LHKPN', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3692, '1118', '2025', '188', NULL, '12', '12', 'https://drive.bps.go.id/s/CFjizy3HR6BwsqC', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung 2025:\n1. Dokumen narasi yang menggambarkan dampak dari inovasi yang ada di satuan/unit kerja terhadap perbaikan pelayanan publik yang prima;', NULL, '- Menyederhanakan dokumen persyaratan\n- Standarisasi hasil layanan\n- Penyediaan kotak saran, kanal pengaduan online, dan layanan konsultasi langsung.\n- Tindak lanjut pengaduan secara sistematis dan transparan.', '- Daftar persyaratan yang dipublikasikan (website, brosur)\n- Dokumen standar mutu produk layanan\n- Sistem pengaduan aktif (website, hotline, email).\n- Laporan bulanan pengaduan dan tindak lanjutnya.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3693, '1118', '2025', '189', NULL, '10,11,12', '10,11,12', 'https://drive.bps.go.id/s/YfxMnE8qRfpz2K8', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan bukti dukung 2025:\n1. Dokumen daftar jumlah perijinan/pelayanan yang terdata/terdaftar di satuan/unit kerja (sesuai Perka BPS Nomor 65 Tahun 2024);\n\n2. Dokumen daftar jumlah perijinan/pelayanan di satuan/unit kerja yang telah dipermudah.', NULL, '1. Mencatat inovasi, kebijakan internal, atau instruksi yang menyebabkan kemudahan layanan.\n2. Membuat rekap jumlah konsumen yang berkunjung ke PST\n3. Membuat rekap jumlah permintaan data dan konsultasi', '1. SK, surat edaran, atau notula perubahan layanan dan profil inovasi layanan\n2. Membuat laporan jumlah kunjungan PST secara berkala\n3. Membuat laporan jumlah permintaan data dan konsultasi secara berkala', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
