	(3769, '1171', '2025', '103', NULL, '6', '6', 'https://drive.google.com/drive/folders/1YDeCu1jNomgFnRCKxEwwquYh_fw4BlVf?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'melakukan pelatihan/sosialisasi pelayanan prima secara berkelanjutan dan terjadwal, dan terdapat monev yang melihat kemampuan/kecakapan petugas/pelaksana layanan sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan dan kompeten.', '1. Dokumen pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan, antara lain:  - rapat (undangan, daftar hadir, notulen); \n2. laporan dan materi pelatihan/sosialisasi pelayanan prima kepada pegawai/petugas layanan. \n3. Dokumen jadwal pelatihan/sosialisasi yang menunjukkan bahwa pelatihan/sosialisasi diakukan secara berkelanjutan dan terjadwal \n4. Dokumen monitoring dan evaluasi atas pegawai/petugas layanan yang terhadap kualitas layanan yang diberikan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
