	(3771, '1171', '2025', '105', NULL, NULL, NULL, 'https://drive.google.com/drive/folders/1Wz5vM5mMgWK7uhegp7EJ69VlNTb0NwsZ?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'menyusun kebijakan pemberian penghargaan dan sanksi yang minimal memenuhi unsur penilaian: disiplin, kinerja, dan hasil penilaian pengguna layanan, dan telah diterapkan secara rutin/berkelanjutan sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan, loyal, akuntabel dan kompeten.', '1. Dokumen mekanisme reward dan punishment yang minimal memenuhi unsur penilaian disiplin, kinerja, dan hasil penilaian pengguna layanan\n2. Dokumen penghargaan atas pelaksanaan pelayanan yang baik secara tahunan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3772, '1171', '2025', '106', NULL, '1', '1', 'https://drive.google.com/drive/folders/1_O-txtQZjUtZHli3lH1Y5HbmZwv_6ech?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'membuat sistem pemberian kompensasi bila layanan tidak sesuai standar bagi penerima layanan di seluruh jenis layanan sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan.', '1. Dokumen mekanisme pemberian kompensasi pada setiap jenis layanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3773, '1171', '2025', '107', NULL, '1', '1', 'https://drive.google.com/drive/folders/1LaR62QP37EuTVqnE1QQqJ1-NmjhWGxTZ?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'mewujudkan seluruh pelayanan yang sudah dilakukan secara terpadu/terintegrasi sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan dan adaptif.', '1. Dokumentasi aplikasi layanan PST\n2. Dokumentasi layanan berbasis online (website)\n3. Dokumentasi layanan berbasis aplikasi (Allstat)', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3774, '1171', '2025', '108', NULL, '5', '5', 'https://drive.google.com/drive/folders/1zDWnvFlvEeLRKmd507iSnhANtsNamsIz?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'membentuk inovasi pelayanan yang  berbeda dengan unit kerja lain dan mendekatkan pelayanan dengan masyarakat sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan dan adaptif.', '1. Laporan inovasi pelayanan publik berupa pengembangan aplikasi berbasisIT, penambahan dekoratif pada ruang layanan, penyediaan layanan bagi disabilitas, pemberian layanan secara jemput bola seperti pojok statistik, road show/sosialisasi terkait pemberian layanan) yang dilegalisir oleh pimpinan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3775, '1171', '2025', '110', NULL, '1', '1', 'https://drive.google.com/drive/folders/1D7wR2x06UNnnMXfstK7qZFAyeEURQuzm?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'membuat media konsultasi dan pengaduan secara offline dan online, memiliki petugas khusus yang menangani, dan terintegrasi dengan SP4N-LAPOR!  sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan dan adaptif.', '1. SK/surat tugas Tim/Petugas khusus yg menangani aduan\n2. Screenshot profil instansi BPS pada lapor.go.id\n3. Dokumentasi akses admin SP4N-LAPOR!\n4. Dokumentasi laporan dari kotak pengaduan ataupun media lainnya secara online dan offline', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3776, '1171', '2025', '111', NULL, '1', '1', 'https://drive.google.com/drive/folders/1ftiAKdXVqmK3OjWkUfk54aVfRPKH3Fjd?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'membentuk unit pengelola khusus untuk konsultasi dan pengaduan, serta surat penugasan pengelola SP4N-LAPOR! di level unit kerja sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan dan adaptif.', '1. Dokumentasi akses admin SP4N-LAPOR!\n2. Surat Keputusan/SK pengelola SP4N-LAPOR! di level unit kerja', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
