	(3780, '1171', '2025', '116', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Tambahkan  Dilakukan tindak lanjut atas hasil survei kepuasan\r\nmasyarakat.\r\nRekomendasi Jawaban terkait Kriteria Nilai:\r\nA. Jika dilakukan tindak lanjut atas seluruh hasil\r\nsurvei kepuasan masyarakat.\r\nBukti Dukung:\r\n(i) Dokumen rencana tindak lanjut/rekomendasi hasil\r\nSKD;\r\n(ii) Dokumentasi bukti tindak lanjut telah dilaksanakan.\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PelayananPublik_4c_bps', NULL, 'menindaklanjuti seluruh hasil survei kepuasan masyarakat sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan dan akuntabel.', '1. Dokumen rencana tindak lanjut/rekomendasi hasil SKD\n2. Dokumentasi bukti tindak lanjut telah dilaksanakan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
