	(3821, '1172', '2025', '22', NULL, '1', '1', 'https://drive.google.com/drive/folders/1CUVmpkxDHQjX1vkHqw6UQHmUvUoONniT?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum ada', NULL, 'Sebagai instansi pemerintah yang berorientasi pelayanan, BPS Kota Langsa terus melakukan optimalisasi pelayanan salah satunya adalah dengan memastikan semua Prosedur Operasional Tetap (SOP) unit telah mengacu peta proses bisnis. Hal ini bertujuan untuk meningkatkan efektivitas, transparansi, dan akuntabilitas layanan publik sehingga pelayanan yang diterima publik sudah terjamin kualitasnya.', 'Daftar bukti dukung:\n1. SOP teknis dan administrasi\n2. Laporan Inovasi SOP', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3822, '1172', '2025', '23', NULL, '1', '1', 'https://drive.google.com/drive/folders/1YLiJ0r8KWR14ddt8p-_5eEQD2f3Y5Dcu?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum ada', NULL, 'Setelah memastikan semua Prosedur Operasional Tetap (SOP) unit BPS Kota Sabang telah mengacu pada peta proses bisnis organisasi, langkah selanjutnya yang dilakukan BPS Kota Sabangadalah menerapkan seluruh SOP yang telah ditetapkan organisasi tersebut dalam setiap kegiatan yang dilakukan', 'Daftar bukti dukung:\n1. Memorandum pelaksanaan tugas sesuai SOP\n2. Laporan pelaksanaan kegiatan yang memuat SOP (belumi selesai semua survei selama tahun 2025)\n3. Dokumen rapat evaluasi kegiatan yang membahas penerapan SOP\n4. SOP teknis dan administrasi', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3823, '1172', '2025', '24', NULL, '6,12', '6', 'https://drive.google.com/drive/folders/1YbfqO14VFiURh7KbZWazCIoENG5Y1Ecr?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum ada', NULL, 'BPS Kota Sabang berkomitmen untuk selalu menerapkan salah satu core value ASN yaitu berorientasi pelayanan yang diwujudkan dengan melakukan perbaikan tiada henti. BPS Kota Sabang dengan rutin mengevaluasi Prosedur Operasional Tetap (SOP) seluruh unit yang telah diterapkan dalam setiap kegiatan. Hasil evaluasi ini kemudian akan digunakan sebagai bahan perbaikan  SOP untuk kegiatan-kegiatan di tahun selanjutnya.', 'Daftar bukti dukung:\n1. Undangan, notulen, daftar hadir rapat awal tahun dan evaluasi SOP (evaluasi SOP akan dilaksanakan pada bulan November)\n2. Dokumen SOP sebelum evaluasi dan setelah evaluasi (belum dilakukan rapat evaluasi SOP)', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3824, '1172', '2025', '26', NULL, '6,12', '6', 'https://drive.google.com/drive/folders/1ohkvwLpWA1Ux5c6SXkip4ebBJm_I1rKg?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum ada', NULL, 'Penggunaan/Pemanfaatan Aplikasi TI dalam Pengukuran Kinerja Unit', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pengukuran kinerja unit (seperti Simonev, FRA, dan atau inovasi lainnya jika ada);\n(ii) Dokumen Screenshot aplikasi terkait pengukuran kinerja unit dan sudah berjalan (Simonev, FRA, dll) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pengukuran kinerja unit;\n(iii) Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3825, '1172', '2025', '27', NULL, '6,12', '6', 'https://drive.google.com/drive/folders/1HO7AAhtpBq5jMrPPvxVl5uldv_U-nrcT?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum ada', NULL, 'Penggunaan/Pemanfaatan Aplikasi TI dalam Operasional Manajemen SDM', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait operasionalisasi manajemen SDM (Misal SIMPEG dan Sijafung, dan atau inovasi lain jika ada);\r\n(ii) Dokumen Screenshot aplikasi terkait operasionalisasi manajemen SDM dan sudah berjalan (Misal SIMPEG dan Sijafung, dan/atau inovasi lain jika ada) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam operasionalisasi manajemen SDM;\r\n(iii) Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3826, '1172', '2025', '28', NULL, '6,12', '6', 'https://drive.google.com/drive/folders/1lP2uBa3Vi_mCZdtgR4P5rY2kBblUfS7t?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum ada', NULL, 'Penggunaan/Pemanfaatan Aplikasi TI dalam Pelayanan Publik', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pelayanan publik (Misal Website, Romantik, Media Sosial, Layanan Pengaduan, dan atau Inovasi lain jika ada);\n(ii) Dokumen Screenshot aplikasi terkait pelayanan publik dan sudah berjalan (seperti Website, Romantik, Media Sosial, Layanan Pengaduan) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pelayanan publik;\n(iii) Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3827, '1172', '2025', '29', NULL, '3,6,9,12', '3,6', 'https://drive.google.com/drive/folders/16HldB_g1qdFo-WAeYHE_sDM21RSaMN4r?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum ada', NULL, 'Monitoring dan Evaluasi Penggunaan/Pemanfaatan Aplikasi TI dalam Pengukuran Kinerja Unit, Operasional Manajemen SDM, dan Pelayanan Publik', '(i) Laporan monitoring dan evaluasi pemanfaatan TI (triwulanan/semesteran);\r\n(ii) Dokumentasi rapat monitoring dan evaluasi pemanfaatan TI.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
