	(3845, '1172', '2025', '53', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Pada dokumen triwulan II:\n1. Belum ada Dokumen Mekanisme pemberian reward\n2. kertas kerjanya tidak berbentuk tabel (seperti contoh pedoman)', NULL, 'Pemberian Reward Pegawai', '(i) Dokumen mekanisme pemberian reward pegawai (misalnya, Employee of the month) (ii) Kertas kerja pemberian reward                           (iii) Bukti reward (misalkan: sertifikat, dll)', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
