	(3847, '1172', '2025', '57', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', '1. belum ada  Laporan pemutakhiran data informasi kepegawaian yang ditandatangani oleh pimpinan\n2, Dokumen Entri Data Rekap Aktivitas dari SIMPEG (bentuk rekapan, bukan screenshot)', NULL, 'Melakukan pemutakhiran secara berkala, minimal tiap triwulan pada aplikasi SIMPEG', '(i) Laporan pemutakhiran data informasi kepegawaian yang ditandatangani oleh pimpinan                        (ii) Dokumen Entri Data Rekap Aktivitas dari SIMPEG', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3848, '1172', '2025', '60', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sesuai tetapi belum mengisi bulan target', NULL, 'Rapat perencanaan Anggaran dan Kegiatan di pimpin langsung oleh Kepala BPS Langsa', '(i) Undangan, notulen, daftar hadir, foto rapat\n  perencanaan kegiatan dan anggaran; \n  (ii) Dokumen perencanaan kegiatan dan anggaran\n  yang memuat Perjanjian Kinerja (PK) 2025; \n  (iii) Dokumen daftar link PK 2025 yang diupload di\n  PPID; \n  (iv) Dokumen perencanaan kegiatan dan anggaran\n  yang memuat Petunjuk Operasional Kegiatan\n  (POK).', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3849, '1172', '2025', '61', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sesuai tetapi belum mengisi bulan target', NULL, 'Pimpinan terlibat langsung pada saat Rapat Penyusunan  penetapan PK 2025', '(i) Undangan, notula disertai kertas kerja dasar hitung \n  dalam penentuan target kinerja, daftar hadir, dan\n  foto rapat penyusunan penetapan kinerja; \n  (ii) Dokumen PK 2025 yang ditandatangani oleh\n  pimpinan; \n  (iii) Dokumen daftar link PK 2025 yang diupload di\n  PPID; \n  (iv) Seluruh dokumen Matriks Peran Hasil (MPH) dari\n  aplikasi Kipapp yang ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3850, '1172', '2025', '62', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sesuai tetapi belum mengisi bulan target', NULL, 'Pimpinan terlibat langsung pada saat Rapat Penyusunan PK dan Rapat FRA', '(i) Undangan, notula (disertai kendala, solusi, tindak \n  lanjut, PIC tindak lanjut, dan batas waktu tindak\n  lanjut), daftar hadir, foto rapat monitoring capaian\n  kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3851, '1172', '2025', '64', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'Membuat dokumen Resntra 2025-2029 dan Perjanjian Kinerja 2025', '(i) Rencana Strategis (Renstra) 2025–2029;\n  (ii) Dokumen PK 2025 yang ditandatangani oleh \n  pimpinan; \n  (iii)   Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3852, '1172', '2025', '65', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'Dokumen Perencanaan harus berorientasi pada hasil', '(i) Dokumen PK 2025 yang ditandatangani oleh \n  pimpinan;\n  (ii) Dokumen daftar link PK 2025 yang diupload di \n  PPID;\n  iii) Seluruh dokumen MPH dari aplikasi Kipapp yang \n  ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3853, '1172', '2025', '66', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'Memenuhi IKU BPS Sabang', '(i) Dokumen Peraturan Kepala BPS;   (ii) Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3854, '1172', '2025', '67', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'IKU telah dilaksanakan dengan prinsip SMART', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3855, '1172', '2025', '68', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'LAKIN disusun tepat waktu', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan secara tepat waktu;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID;\n  (iii) Screenshot bukti unggah Laporan Kinerja 2025 \n  secara tepat waktu.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3856, '1172', '2025', '69', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'LAKIN telah memberikan informasi tentang kinerja', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3857, '1172', '2025', '70', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'Terdapat upaya peningkatan kapasitas SDM yang menangani akuntabilitas kinerja', '(i) Peraturan Kepala Badan Pusat Statistik Nomor 9\n  Tahun 2015 tentang Pedoman Penyusunan Sistem\n  Akuntabilitas Kinerja Instansi Pemerintah di\n  Lingkungan Badan Pusat Statistik; \n  (ii) SK Tim SAKIP Tahun 2025;\n  (iii) SOP Pengumpulan Data Kinerja sesuai dengan \n  kondisi masing-masing satuan kerja yang\n  ditandatangani oleh pimpinan (mengacu pada surat\n  Sekretaris Utama terkait Pelaporan Capaian Kinerja\n  Triwulanan Tahun 2025).', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3858, '1172', '2025', '71', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum mengisi bulan target', NULL, 'Pengelolaan akuntabilitas kinerja dilaksanakan oleh SDM yang kompeten', '(i) SK Tim SAKIP Tahun 2024;\n  (ii) Dokumen daftar data individu seluruh anggota Tim \n  SAKIP yang memuat data kompetensi dan\n  sertifikat pembinaan terkait akuntabilitas kinerja\n  (akumulasi kompetensi hingga tahun 2024).', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3859, '1172', '2025', '74', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'mengunggah postingan pengendalian gratifikasi di akun IG BPS Kota Langsa dan splash screen website Langsakota', 'tangkapan layar dan link postingan terkait', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3860, '1172', '2025', '75', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Pengendalian gratifikasi yang dilakukan oleh Unit Pengendalian Gratifikasi (UPG) telah sesuai prosedur  diimplementasikan yang dibuktikan dengan adanya SK UPG, Mekanisme atau SOP, dan laporan.', 'dokumentasi berupa salinan SK UPG, SOP dan laporan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3861, '1172', '2025', '77', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Unit kerja telah membangun lingkungan\npengendalian sesuai dengan yang ditetapkan\norganisasi dan juga membuat inovasi terkait\nlingkungan pengendalian yang sesuai dengan\nkarakteristik unit kerja.', 'Bukti Dukung:\n(i) Dokumen sosialisasi SPIP;\n(ii) SK tim SPIP;\n(iii) Dokumen laporan penyelenggaraan SPIP.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3862, '1172', '2025', '78', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Unit kerja telah melakukan penilaian risiko atas\nseluruh pelaksanaan kebijakan sesuai dengan\nyang ditetapkan organisasi dan juga membuat\ninovasi terkait lingkungan pengendalian yang\nsesuai dengan karakteristik unit kerja.', 'Bukti Dukung:\n(i) Laporan Manajemen Risiko SPIP;\n(ii) Laporan inovasi terkait SPIP;\n(iii) Laporan Quality Gates tahun 2025.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3863, '1172', '2025', '79', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Unit kerja telah melakukan kegiatan pengendalian untuk meminimalisir resiko sesuai dengan yang\nditetapkan organisasi dan juga membuat inovasi terkait kegiatan pengendalian untuk meminimalisir resiko yang sesuai dengan karakteristik unit kerja.', 'Bukti Dukung:\n(i) Laporan Manajemen Risiko SPIP;\n(ii) Laporan inovasi terkait SPIP;\n(iii) Laporan Quality Gates tahun 2025.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3864, '1172', '2025', '80', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'SPI telah diinformasikan dan dikomunikasikan kepada seluruh pihak terkait seperti melalui kegiatan internalisasi/sosialisasi kepada pegawai.', 'Bukti Dukung:\n(i) Dokumentasi sosialisasi SPI (SPIP, MR, dll) kepada seluruh pegawai\n(ii) Sharing Knowledge Quality Gates.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3865, '1172', '2025', '82', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Kebijakan Pengaduan masyarakat telah diimplementasikan dan kebijakan pengaduan masyarakat sesuai dengan yang ditetapkan organisasi dan juga membuat inovasi terkait pengaduan masyarakat yang sesuai dengan karakteristik unit kerja.', 'Bukti Dukung:\n(i) SK Tim Pengelola Pengaduan Masyarakat;\n(ii) Dokumen kebijakan pengaduan;\n(iii) Dokumentasi media/sarana pengaduan masyarakat yang dilengkapi dengan narasi;\n(iv) Dokumentasi spanduk/banner/flyer informasi sarana penyampaian pengaduan yang dilengkapi dengan narasi; dan\n(v) Laporan pengelolaan pengaduan.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3866, '1172', '2025', '83', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Pengaduan masyarakat ditindaklanjuti yang dibuktikan dengan laporan rekapitulasi hasil aduan, tindak lanjut, dan kendala dan solusi aduan.', 'Bukti Dukung:\n(i) Laporan pengelolaan pengaduan dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis\naduan);\nb. Tindak lanjut aduan;\nc. Kendala dan solusi dalam penanganan aduan.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3867, '1172', '2025', '84', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Telah dilakukan monitoring dan evaluasi atas penanganan pengaduan masyarakat dan penanganan pengaduan masyarakat dimonitoring dan evaluasi secara berkala yang dibuktikan dengan laporan rekapitulasi hasil aduan, tindak lanjut, dan kendala dan solusi aduan.', 'Bukti Dukung:\n(i) Laporan pengelolaan pengaduan dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis\naduan)\nb. Tindak lanjut aduan\nc. Kendala dan solusi dalam penanganan aduan\nd. Hasil evaluasi atas tindak lanjut penanganan\npengaduan masyarakat\n(ii) Dokumentasi pelaksanaan rapat evaluasi dan\nmonitoring.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3868, '1172', '2025', '85', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Hasil evaluasi atas penanganan pengaduan masyarakat telah ditindaklanjuti dan seluruh hasil evaluasi atas penanganan pengaduan telah ditindaklanjuti oleh unit kerja yang dibuktikan dengan laporan rekapitulasi hasil aduan, tindak lanjut, dan kendala dan solusi aduan.', 'Bukti Dukung:\n(i) Laporan pengelolaan pengaduan dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis\naduan)\nb. Tindak lanjut aduan\nc. Kendala dan solusi dalam penanganan aduan\nd. Hasil evaluasi atas tindak lanjut penanganan\npengaduan masyarakat.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3869, '1172', '2025', '87', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Unit kerja telah menerapkan seluruh kebijakan\nWhistle Blowing System sesuai dengan yang\nditetapkan organisasi dan juga membuat inovasi\nterkait pelaksanaan Whistle Blowing System yang\nsesuai dengan karakteristik unit kerja', 'Bukti Dukung:\n(i) SK Tim WBS;\n(ii) Keputusan Kepala BPS No 185 Tahun 2020 Tentang Tim Pengelola Sistem Pengelolaan Pengaduan Pelayanan Publik Nasional Berbasis Online Dengan Menggunakan Aplikasi Lapor Pada Badan Pusat Statistik.\n(ii) Keputusan Inspektur Utama No. B146/BPS/8000/10/2019 Tahun 2019 tentang\nSistem Pengelolaan Pengaduan di Lingkungan\nBadan Pusat Statistik;\n(iii) Dokumentasi spanduk/banner/flyer/media/sarana\nWBS yang dilengkapi dengan narasi;\n(iv) Screenshot aplikasi WBS;\n(v) Laporan pengelolaan WBS.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3870, '1172', '2025', '88', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Penerapan Whistle Blowing System\ndimonitoring dan evaluasi secara berkala. yaitu\ndengan menyediakan laporan hasil evaluasi atas\npenerapan Whistle Blowing System.', 'Bukti Dukung:\n(i) Laporan pengelolaan WBS dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis\naduan);\nb. Rekapitulasi jumlah aduan per bulan (jenis\naduan);\nc. Tindak lanjut WBS;\nd. Kendala dan solusi dalam penanganan WBS;', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3871, '1172', '2025', '89', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Seluruh hasil evaluasi atas penerapan Whistle Blowing System telah ditindaklanjuti oleh unit kerja dengan melampirkan dokumen pelaksanaan tindak lanjut atas hasil monitoring dan evaluasi WBS.', 'Bukti Dukung:\n(i) Laporan pengelolaan WBS dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis\naduan);\nb. Tindak lanjut WBS;\nc. Kendala dan solusi dalam penanganan WBS;\nd. Hasil evaluasi atas tindak lanjut penanganan\nWBS.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3872, '1172', '2025', '91', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Terdapat identifikasi/pemetaan benturan\nkepentingan pada seluruh tugas fungsi utama.', 'Bukti Dukung:\n(i) Dokumen hasil identifikasi potensi benturan\nkepentingan dalam tugas fungsi utama untuk\nseluruh pegawai berdasarkan lampiran Perka\nBPS Nomor 36 Tahun 2023 tentang Pedoman\nPenanganan Benturan Kepentingan di\nLingkungan Badan Pusat Statistik halaman 23;\n(ii) Perka BPS Nomor 36 Tahun 2023 tentang\nPedoman Penanganan Benturan Kepentingan di\nLingkungan Badan Pusat Statistik.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3873, '1172', '2025', '92', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Penanganan Benturan Kepentingan\ndisosialiasikan/ diinternalisasikan ke seluruh\nlayanan.', 'Bukti Dukung:\n(i) Dokumentasi internalisasi penanganan benturan\nkepentingan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3874, '1172', '2025', '93', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Penanganan Benturan Kepentingan\ndiimplementasikan ke seluruh layanan.', 'Bukti Dukung:\n(i) Dokumen surat pernyataan bebas dari benturan\nkepentingan untuk seluruh pegawai berdasarkan\nlampiran Perka BPS Nomor 36 Tahun 2023\ntentang Pedoman Penanganan Benturan\nKepentingan di Lingkungan Badan Pusat Statistik\nhalaman 22.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3875, '1172', '2025', '94', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Penanganan Benturan Kepentingan dievaluasi\nsecara berkala oleh unit kerja.', 'Bukti Dukung:\n(i) Laporan monitoring dan evaluasi penanganan\nbenturan kepentingan berdasarkan lampiran Perka\nBPS Nomor 36 Tahun 2023 tentang Pedoman\nPenanganan Benturan Kepentingan di Lingkungan\nBadan Pusat Statistik halaman 25.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(3876, '1172', '2025', '95', NULL, NULL, NULL, '1172 Sabang', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Seluruh hasil evaluasi atas Penanganan Benturan Kepentingan telah ditindaklanjuti oleh unit\nkerja.', 'Bukti Dukung:\n(i) Laporan Bukti Tindak Lanjut Penanganan Benturan\nKepentingan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
