	(3878, '1172', '2025', '99', NULL, '4,5', '4,5', 'https://drive.google.com/drive/folders/1iowpq-OMWdtK6y0Usc9wlngIQ0hIqtEX?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'Sosialisasi Maklumat Pelayanan', '(i) Dokumen maklumat standar pelayanan yang ditandatangani kepala satker paling lambat 7 hari setelah SK standar pelayanan terbit                                     (ii) Capture/foto dokumen maklumat standar pelayanan di tempat pelayanan misal PST, website, dan media lainnya (social media)                           (iii) SK Maklumat Pelayanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3879, '1172', '2025', '100', NULL, '4,5', '4,5', 'https://drive.google.com/drive/folders/1hDmUe7gSGoiBX3VrnkVUUI1rDyOvUE0a?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'Rapat Reviu Standar Pelayanan', '(i) Dokumentasi rapat reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders dan masyarakat (dilengkapi Undangan, Daftar Hadir, Notulensi, Dokumentasi Rapat)             (ii) Dokumen reviu standar pelayanan yang dilakukan dengan melibatkan stakeholders (antara lain : tokoh masyarakat, akademisi, dunia usaha, dan lembaga swadaya masyarakat), serta memanfaatkan masukan hasil SKM/SKD dan pengaduan masyarakat', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(3880, '1172', '2025', '101', NULL, '4,5', '4,5', 'https://drive.google.com/drive/folders/1wuHqDIeCyQ1_s2mZyI3nmv2JDKq2trh9?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'Rapat Pembuatan Maklumat Pelayanan', '(i) Dokumen bukti maklumat pelayanan telah dipublikasikan di berbagai media                                   (ii) Dokumen bukti standar pelayanan telah dipublikasikan di berbagai media', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
