	(3929, '1173', '2025', '16', NULL, '12', '10', 'a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung belum di upload', NULL, 'Penerapan Nilai-nilai Organisasi (Berakhlak) oleh Pimpinan sebagai Role Model/Change Leader', 'Laporan pimpinan sebagai role model', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(3930, '1173', '2025', '17', NULL, '1', '1', 'b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung telah di upload', NULL, 'menetapkan agen perubahan dan berkontribusi terhadap perubahan pada unit kerjanya sesuai dengan nilai-nilai dasar ASN yang Kompeten, Adaptif dan Kolaboratif.', '1 SK Agen Perubahan\n2 Laporan Agen Perubahan', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(3931, '1173', '2025', '18', NULL, '12', '11', 'c', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung belum di upload', NULL, 'melakukan upaya pembangunan budaya kerja dan pola pikir dan mampu mengurangi resistensi atas perubahan sesuai dengan nilai-nilai dasar ASN yang Harmonis dan Kolaboratif.', '1 Laporan penerapan budaya kerja\n2 matriks dampak penerapan budaya kerja', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(3932, '1173', '2025', '19', NULL, '9,10', '9,10', 'd', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung belum di upload', NULL, 'melibatkan semua anggota dalam pembangunan Zona Integritas menuju WBK/WBBM dan usulan-usulan dari anggota diakomodasikan dalam keputusan sesuai dengan nilai-nilai dasar ASN yang Akuntabel, Harmonis, dan Kolaboratif.', '1 Pakta Integritas Pegawai\n2 Undangan, dokumentasi, daftar hadir, notulen rapat monitoring ZI semester 1 dan 2', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(3933, '1173', '2025', '22', NULL, '3,11', '1,11', '2.i.a. SOP Mengacu pada Peta Proses Bisnis Instansi', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. SOP yang di ttd eselon 2\n2. SOP inovasi', NULL, 'Sebagai instansi pemerintah yang berorientasi pelayanan, BPS Kota Langsa terus melakukan optimalisasi pelayanan salah satunya adalah dengan memastikan semua Prosedur Operasional Tetap (SOP) unit telah mengacu peta proses bisnis. Hal ini bertujuan untuk meningkatkan efektivitas, transparansi, dan akuntabilitas layanan publik sehingga pelayanan yang diterima publik sudah terjamin kualitasnya.', 'Daftar bukti dukung:\n1. SOP teknis dan administrasi\n2. Dokumen SOP Inovasi', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3934, '1173', '2025', '23', NULL, '1,12', '1,11', '2.i.b SOP Telah diterapkan', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'bukti dukung belum di upload 1.Dokumen monitoring pelaksanaan penerapan SOP sesuai Perka BPS Nomor 19 Tahun 2013 tentang Pedoman Penyusunan Standar Operasional Prosedur Administrasi Pemerintah di Lingkungan BPS, halaman 47 2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker).', NULL, 'Setelah memastikan semua Prosedur Operasional Tetap (SOP) unit BPS Kota Langsa telah mengacu pada peta proses bisnis organisasi, langkah selanjutnya yang dilakukan BPS Kota Langsa adalah menerapkan seluruh SOP yang telah ditetapkan organisasi tersebut dalam setiap kegiatan yang dilakukan', 'Daftar bukti dukung:\n1. Dokumen monitoring pelaksanaan penerapan SOP sesuai Perka BPS Nomor 19 Tahun 2013 tentang Pedoman Penyusunan Standar Operasional Prosedur Administrasi Pemerintah di Lingkungan BPS, halaman 47;\n2. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker).', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3935, '1173', '2025', '24', NULL, '1,12', '1,11', '2.i.c SOP Telah Dievaluasi', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'dokumen notulen rapat evaluasi sop punyak tahun 2024', NULL, 'BPS Kota Langsa berkomitmen untuk selalu menerapkan salah satu core value ASN yaitu berorientasi pelayanan yang diwujudkan dengan melakukan perbaikan tiada henti. BPS Kota Langsa dengan rutin mengevaluasi Prosedur Operasional Tetap (SOP) seluruh unit yang telah diterapkan dalam setiap kegiatan. Hasil evaluasi ini kemudian akan digunakan sebagai bahan perbaikan  SOP untuk kegiatan-kegiatan di tahun selanjutnya.', 'Daftar bukti dukung:\n1. Undangan, notulen, daftar hadir rapat awal tahun dan evaluasi SOP (evaluasi SOP akan dilaksanakan pada bulan November)\n2. Dokumen SOP sebelum evaluasi dan setelah evaluasi (belum dilakukan rapat evaluasi SOP)', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3936, '1173', '2025', '26', NULL, '11', '11', 'https://drive.google.com/drive/folders/16S0XBis9nEdPYPnLZeMclouXG6sO0IAU?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'masih terdapat dokumen yang belum di upload 1. Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, 'Penggunaan/Pemanfaatan Aplikasi TI dalam Pengukuran Kinerja Unit', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pengukuran kinerja unit (seperti Simonev, FRA, dan atau inovasi lainnya jika ada);\n(ii) Dokumen Screenshot aplikasi terkait pengukuran kinerja unit dan sudah berjalan (Simonev, FRA, dll) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pengukuran kinerja unit;\n(iii) Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3937, '1173', '2025', '27', NULL, '11', NULL, 'https://drive.google.com/drive/folders/1KDaIMuiTHFU0uWD8S-ZkdcmtG0KrfMVI?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, 'Penggunaan/Pemanfaatan Aplikasi TI dalam Operasional Manajemen SDM', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait operasionalisasi manajemen SDM (Misal SIMPEG dan Sijafung, dan atau inovasi lain jika ada);\r\n(ii) Dokumen Screenshot aplikasi terkait operasionalisasi manajemen SDM dan sudah berjalan (Misal SIMPEG dan Sijafung, dan/atau inovasi lain jika ada) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam operasionalisasi manajemen SDM;\r\n(iii) Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3938, '1173', '2025', '28', NULL, '11', NULL, 'https://drive.google.com/drive/folders/1RtqBb5yeMvQlN7V63dWXSyq_dF-aSoFY?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, 'Penggunaan/Pemanfaatan Aplikasi TI dalam Pelayanan Publik', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pelayanan publik (Misal Website, Romantik, Media Sosial, Layanan Pengaduan, dan atau Inovasi lain jika ada);\n(ii) Dokumen Screenshot aplikasi terkait pelayanan publik dan sudah berjalan (seperti Website, Romantik, Media Sosial, Layanan Pengaduan) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pelayanan publik;\n(iii) Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3939, '1173', '2025', '29', NULL, '11', NULL, 'https://drive.google.com/drive/folders/1n-hdY2JprZ_b1WlsTIecTnH0iD020R9f?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, 'Monitoring dan Evaluasi Penggunaan/Pemanfaatan Aplikasi TI dalam Pengukuran Kinerja Unit, Operasional Manajemen SDM, dan Pelayanan Publik', '(i) Laporan monitoring dan evaluasi pemanfaatan TI (triwulanan/semesteran);\n(ii) Dokumentasi rapat monitoring dan evaluasi pemanfaatan TI.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3940, '1173', '2025', '31', NULL, '1,11', '1,11', '2.iii.a. Kebijakan tentang keterbukaan informasi publik telah diterapkan', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'ada bukti dukung yang belum di upload 1. Daftar informasi publik satker yang dapat diakses (website satker, Sirup, PPID, dan lain-lain) sesuai Perka Nomor 1 Tahun 2021.  2. Screenshot media pengelolaan informasi publik satker.', NULL, 'menunjuk Pejabat Pengelola Informasi Publik (PPID) yang menyebarkan seluruh informasi yang dapat diakses secara mutakhir dan lengkap sesuai dengan nilai-nilai dasar ASN yang berorientasi pelayanan dan adaptif.', 'v 1. SK Unit Pendukung PPID 2024 tiap satker\nv 2. Daftar informasi publik satker yang dapat diakses sesuai Perka Nomor 1 Tahun 2021\nv 3. Screen shot media pengelolaan informasi publik satker', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3941, '1173', '2025', '32', NULL, '9', '9', '2.iii.b. Telah dilakukan monitoring dan evaluasi pelaksanaan kebijakan keterbukaan informasi publik', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, 'Monitoring dan Evaluasi Pelaksanaan Kebijakan Keterbukaan Informasi Publik', 'Laporan berkala monitoring dan evaluasi pelaksanaan kebijakan keterbukaan informasi publik dan bukti tindak lanjutnya (triwulanan/semesteran).', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(3942, '1173', '2025', '35', NULL, '1', '11', '3.i.a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum ada Notulensi hasil rapat evaluasi Pembina Kepegawaian Rencana mutasi, Penerimaan/pengadaan pegawai', NULL, 'Rapat Pembina Kepegawaian Mengenai Rencana Mutasi, Penerimaan/Pengadaan Pegawai', '(i) Kepka Nomor 182 Tahun 2024 tentang ABK 2024\n(ii) Dokumen Komposisi SDM ABK dan existing pegawai;                        (iii) Notulensi Hasil Rapat Pembina Kepegawaian mengenai Rencana mutasi, Penerimaan/pengadaan pegawai.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3943, '1173', '2025', '36', NULL, '11', '11', '3.i.b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada dokumen SPMT dari Kepala Unit Kerja', NULL, 'Analisi Kebutuhan Pegawai', '(i) Analisis Kebutuhan Pegawai;                        (ii) Surat Perintah melaksanakan tugas dari kepala unit kerja;           (iii) SK Penempatan dan Jabatan.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3944, '1173', '2025', '37', NULL, '11', '11', '3.i.c', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'isi dokumen sudah benar, hanya perlu menyesuaikan judul dokumennya saja', NULL, 'Monitoring dan Evaluasi Terhadap Penempatan Pegawai hasil Rekrutmen untuk Memenuhi Kebutuhan Jabatan dalam Organisasi', '(i) Laporan monitoring dengan menampilkan perubahan formasi antara ABK dan Existing pegawai dengan Matriks rekap setahun berapa yang masuk, berapa yang pindah atau rotasi jabatan dst', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3945, '1173', '2025', '39', NULL, '11', '11', '3.ii.a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada dokumen Notulensi Rapat BaperJakat yang memuat pertimbangan Rotasi dan pelaksanaan Rotasi', NULL, 'Usulan Mutasi Internal Pejabat Fungsional Statistisi dan Fungsional Umum', '(i) Notulensi Rapat BaperJakat yang memuat pertimbangan Rotasi dan pelaksanaan Rotasi telah berorientasi pada pengembangan karir pegawai;                        (ii) SK Mutasi / Rotasi Internal.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3946, '1173', '2025', '40', NULL, '11', '11', '3.ii.b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada dokumen :\n1. Notulensi Rapat BaperJakat\n2. Analisis kesenjangan kompetensi seluruh pegawai', NULL, 'Monitoring dan Evaluasi Terhadap Mutasi Pegawai', '(i) Notulensi Rapat BaperJakat yang memuat pertimbangan Rotasi dan pelaksanaan Rotasi telah memperhatikan kompetensi jabatan dan mengikuti pola mutasi yang ditetapkan organisasi dan juga satuan/unit kerja memberikan pertimbangan terkait hal ini;                                  (ii) SK Mutasi / Rotasi Internal;                         (iii) Analisis kesenjangan kompetensi seluruh pegawai.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3947, '1173', '2025', '41', NULL, '11', '11', '3.ii.c', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Belum ada dokumen yang diupload', NULL, 'Rapat Baperjakat', '(i) Laporan monitoring dan evaluasi pegawai yang mutasi/rotasi.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3948, '1173', '2025', '43', NULL, '8,12', NULL, '3.iii.a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'kolom realisasi belum diisi dan belum ada dokumen yang diupload', NULL, 'Analisa Kebutuhan Diklat/Bimtek/Pengembangan Pegawai (Training Need Analysis)', '(i) Dokumen Analisa kebutuhan diklat/bimtek/ pengembangan pegawai (Training Need Analysis)', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3949, '1173', '2025', '44', NULL, '8,12', NULL, '3.iii.b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'kolom realisasi belum diisi dan belum ada dokumen yang diupload', NULL, 'Rencana Pengembangan Kompetensi Pegawai', '(i) Analisis kesenjangan kompetensi seluruh pegawai;                        (ii) Rencana pengembangan kompetensi pegawai;     (iii) Analisa kebutuhan diklat.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3950, '1173', '2025', '45', NULL, '8,12', NULL, '3.iii.c', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'kolom realisasi belum diisi dan belum ada dokumen yang diupload', NULL, 'Analisis Kesenjangan Kompetensi Seluruh Pegawai', '(i) Laporan Analisis Kesenjangan Kompetensi Jabatan Pegawai.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3951, '1173', '2025', '46', NULL, '8,10', NULL, '3.iii.d', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'kolom realisasi belum diisi dan belum ada dokumen yang diupload', NULL, 'Rekap Data Pegawai yang mengikuti Pelatihan/ Diklat/Pengembangan Kompetensi Lainnya', '(i) Dokumen rekap data pegawai yang mengikuti pelatihan/diklat/pengembangan kompetensi lainnya dilengkapi dengan link bukti sertifikat/usulan diklat/undangan.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3952, '1173', '2025', '47', NULL, '8,12', NULL, '3.iii.e', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'kolom realisasi belum diisi dan belum ada dokumen yang diupload', NULL, 'Laporan Pelaksanaan Pelatihan/Diklat/Bimtek/ Capacity Building yang diselenggarakan oleh Unit/Satuan Kerja Terkait', '(i) Laporan pelaksanaan Pelatihan/Diklat/Bimtek /Capacity building yang diselenggarakan oleh unit/satuan kerja terkait atau bukti usulan unit/satuan kerja perihal pengikutsertaan pegawai pada Pelatihan/Diklat/Bimtek/Capacity building (jika ada).', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3953, '1173', '2025', '48', NULL, '8,11', NULL, '3.iii.f', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'kolom realisasi belum diisi dan belum ada dokumen yang diupload', NULL, 'Monitoring Rekap Jumlah Pelatihan/ Diklat/Bimtek/Capacity Building/Coaching selama Periode 1 Tahun serta Evaluasi Peningkatan Kinerja', '(i) Laporan monitoring berupa matriks rekap jumlah Pelatihan/Diklat/Bimtek/Capacity building/Coaching selama periode 1 tahun serta evaluasi peningkatan kinerja.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3954, '1173', '2025', '50', NULL, '8,11', '8,11', 'iv.a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'SKP Bulanan Seluruh Pegawai', '(i) Dokumen SKP bulanan seluruh pegawai dari KipApp                           (ii) Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan;                  (iii) Dokumen penjelasan cascading indikator kinerja mulai dari Visi, misi, PK sampai IKI.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3955, '1173', '2025', '51', NULL, '8,10', '8,10', 'iv.b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'dokumen sudah sesuai', NULL, 'Matriks Peran Hasil (MPH)', '(i) Seluruh dokumen Matriks Peran Hasil (MPH) dari aplikasi Kipapp yang ditandatangani pimpinan', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3956, '1173', '2025', '52', NULL, '8,11', '8,11', 'iv.c', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'dokumen sudah sesuai', NULL, 'Monitoring dan Evaluasi SKP Bulanan Seluruh Pegawai', '(i) Dokumen SKP bulanan seluruh pegawai dari KipApp.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3957, '1173', '2025', '53', NULL, '1,4,7,10', '1,4,7,10', 'iv.d', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Pemberian Reward Pegawai', '(i) Dokumen mekanisme pemberian reward pegawai (misalnya, Employee of the month) (ii) Kertas kerja pemberian reward                           (iii) Bukti reward (misalkan: sertifikat, dll)', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3958, '1173', '2025', '55', NULL, '11', '12', '3.v.a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum ada Dokumen inovasi terkait aturan disiplin/kode etik/kode perilaku', NULL, 'Penegakan Hukuman Atas Pelanggaran Aturan Disiplin/ Kode Etik/Kode Perilaku', '(i) Peraturan aturan disiplin/kode etik/kode perilaku, dll (internal)      (ii) Laporan penegakan hukuman atas pelanggaran aturan disiplin/kode etik/kode perilaku', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3959, '1173', '2025', '57', NULL, '1,4,7', '1,4,7,12', 'vi Sistem Informasi Kepegawaian', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, 'Melakukan pemutakhiran secara berkala, minimal tiap triwulan pada aplikasi SIMPEG', '(i) Laporan pemutakhiran data informasi kepegawaian yang ditandatangani oleh pimpinan                        (ii) Dokumen Entri Data Rekap Aktivitas dari SIMPEG', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
	(3960, '1173', '2025', '60', NULL, '1,4,7', '1,4,7', 'a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Rapat perencanaan Anggaran dan Kegiatan di pimpin langsung oleh Kepala BPS Langsa', '(i) Undangan, notulen, daftar hadir, foto rapat\n  perencanaan kegiatan dan anggaran; \n  (ii) Dokumen perencanaan kegiatan dan anggaran\n  yang memuat Perjanjian Kinerja (PK) 2025; \n  (iii) Dokumen daftar link PK 2025 yang diupload di\n  PPID; \n  (iv) Dokumen perencanaan kegiatan dan anggaran\n  yang memuat Petunjuk Operasional Kegiatan\n  (POK).', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3961, '1173', '2025', '61', NULL, '1,11', '1,11', 'b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Pimpinan terlibat langsung pada saat Rapat Penyusunan  penetapan PK 2025', '(i) Undangan, notula disertai kertas kerja dasar hitung \n  dalam penentuan target kinerja, daftar hadir, dan\n  foto rapat penyusunan penetapan kinerja; \n  (ii) Dokumen PK 2025 yang ditandatangani oleh\n  pimpinan; \n  (iii) Dokumen daftar link PK 2025 yang diupload di\n  PPID; \n  (iv) Seluruh dokumen Matriks Peran Hasil (MPH) dari\n  aplikasi Kipapp yang ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3962, '1173', '2025', '62', NULL, '1,11', '1,11', 'c', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Link bukti dukung FRA tidak bisa diakses', NULL, 'Pimpinan terlibat langsung pada saat Rapat Penyusunan PK dan Rapat FRA', '(i) Undangan, notula (disertai kendala, solusi, tindak \n  lanjut, PIC tindak lanjut, dan batas waktu tindak\n  lanjut), daftar hadir, foto rapat monitoring capaian\n  kinerja (FRA triwulanan), sesuai pada Simonev.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3963, '1173', '2025', '64', NULL, '1,4,7', '1,4,7', 'a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Membuat dokumen Resntra 2025-2029 dan Perjanjian Kinerja 2025', '(i) Rencana Strategis (Renstra) 2025–2029;\n  (ii) Dokumen PK 2025 yang ditandatangani oleh \n  pimpinan; \n  (iii)   Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3964, '1173', '2025', '65', NULL, '1,4,7', '1,4,7', 'b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Dokumen Perencanaan harus berorientasi pada hasil', '(i) Dokumen PK 2025 yang ditandatangani oleh \n  pimpinan;\n  (ii) Dokumen daftar link PK 2025 yang diupload di \n  PPID;\n  iii) Seluruh dokumen MPH dari aplikasi Kipapp yang \n  ditandatangani oleh pimpinan.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3965, '1173', '2025', '66', NULL, '3', '3,4,10', 'c', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Memenuhi IKU BPS Langsa', '(i) Dokumen Peraturan Kepala BPS;   (ii) Surat terkait penyusunan Perjanjian Kinerja 2025.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3966, '1173', '2025', '67', NULL, '3,11', '3,11', 'd', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen Lakin 2024', NULL, 'IKU telah dilaksanakan dengan prinsip SMART', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3967, '1173', '2025', '68', NULL, '3,11', '3,11', 'e', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen Lakin 2024', NULL, 'LAKIN disusun tepat waktu', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan secara tepat waktu;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID;\n  (iii) Screenshot bukti unggah Laporan Kinerja 2025 \n  secara tepat waktu.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3968, '1173', '2025', '69', NULL, '3,12', '3,11', 'f', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen Lakin 2024', NULL, 'LAKIN telah memberikan informasi tentang kinerja', '(i) Dokumen Laporan Kinerja 2025 yang \n  ditandatangani oleh pimpinan;\n  (ii) Dokumen daftar link Laporan Kinerja 2025 yang \n  diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3969, '1173', '2025', '70', NULL, '3,11', '3,11', 'g', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Terdapat upaya peningkatan kapasitas SDM yang menangani akuntabilitas kinerja', '(i) Peraturan Kepala Badan Pusat Statistik Nomor 9\n  Tahun 2015 tentang Pedoman Penyusunan Sistem\n  Akuntabilitas Kinerja Instansi Pemerintah di\n  Lingkungan Badan Pusat Statistik; \n  (ii) SK Tim SAKIP Tahun 2025;\n  (iii) SOP Pengumpulan Data Kinerja sesuai dengan \n  kondisi masing-masing satuan kerja yang\n  ditandatangani oleh pimpinan (mengacu pada surat\n  Sekretaris Utama terkait Pelaporan Capaian Kinerja\n  Triwulanan Tahun 2025).', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
	(3970, '1173', '2025', '71', NULL, '1', '1', 'h', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Sesuai', NULL, 'Pengelolaan akuntabilitas kinerja dilaksanakan oleh SDM yang kompeten', '(i) SK Tim SAKIP Tahun 2024;\n  (ii) Dokumen daftar data individu seluruh anggota Tim \n  SAKIP yang memuat data kompetensi dan\n  sertifikat pembinaan terkait akuntabilitas kinerja\n  (akumulasi kompetensi hingga tahun 2024).', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
