	(3981, '1173', '2025', '87', NULL, '2', '2', 'https://drive.google.com/drive/folders/1xkuKvlTXHZgTQKd786iovmGXCTTOcjzy?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Unit kerja telah menerapkan seluruh kebijakan\nWhistle Blowing System sesuai dengan yang\nditetapkan organisasi dan juga membuat inovasi\nterkait pelaksanaan Whistle Blowing System yang\nsesuai dengan karakteristik unit kerja', 'Bukti Dukung:\n(i) SK Tim WBS;\n(ii) Keputusan Kepala BPS No 185 Tahun 2020 Tentang Tim Pengelola Sistem Pengelolaan Pengaduan Pelayanan Publik Nasional Berbasis Online Dengan Menggunakan Aplikasi Lapor Pada Badan Pusat Statistik.\n(ii) Keputusan Inspektur Utama No. B146/BPS/8000/10/2019 Tahun 2019 tentang\nSistem Pengelolaan Pengaduan di Lingkungan\nBadan Pusat Statistik;\n(iii) Dokumentasi spanduk/banner/flyer/media/sarana\nWBS yang dilengkapi dengan narasi;\n(iv) Screenshot aplikasi WBS;\n(v) Laporan pengelolaan WBS.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
