	(3990, '1173', '2025', '99', NULL, '3,6', '3,6', 'b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan bukti dukung berupa :\n(ii) Capture/foto dokumen maklumat standar pelayanan\r\ndi tempat pelayanan misal PST, website, dan media\r\nlainnya (social media);', NULL, 'Sosialisasi Maklumat Pelayanan', '(i) Dokumen maklumat standar pelayanan yang ditandatangani kepala satker paling lambat 7 hari setelah SK standar pelayanan terbit                                     (ii) Capture/foto dokumen maklumat standar pelayanan di tempat pelayanan misal PST, website, dan media lainnya (social media)                           (iii) SK Maklumat Pelayanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
