	(4024, '1173', '2025', '165', NULL, '1,12', '1', 'https://drive.google.com/drive/folders/1E-TTLDhcWYoJww20UNkEax_y51etO2Cd?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Terdapat pengendalian aktivitas utama organisasi yang tersistem mulai dari perencanaan, penilaian risiko, pelaksanaan, monitoring, dan pelaporan oleh penanggung jawab aktivitas serta pimpinan unit kerja namun belum berdampak pada peningkatan kinerja unit kerja', '(i) Laporan mekanisme pengendalian aktivitas secara berjenjang yang memuat: perencanaan penilaian risiko, pelaksanaan, monitoring, pelaporan dan telah menghasilkan peningkatan kinerja, mekanisme kerja baru yang lebih efektif, efisien, dan terkendali', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4025, '1173', '2025', '167', NULL, '1,12', '1', 'https://drive.google.com/drive/folders/1LFbWej-EnvQxJ9ValQeWMCbupgudyi3M?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, NULL, '(i) Laporan pengelolaan pengaduan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4026, '1173', '2025', '172', NULL, '1,11', '1', 'https://drive.google.com/drive/folders/1j0jCPds4J0_GGpRlm_CwUFq1w1xpW9Tq?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, NULL, '(i) Lampiran surat Inspektur Utama perihal Proses Pelaporan LHKAN Periode 2025                                  (ii) Daftar pegawai yang wajib mengisi LHKPN (nama pegawai, jabatan) satuan kerja yang dilegalisasi oleh kepala satuan/unit kerja (Jumlah yang harus melaporkan LHKPN = KPA, Bendahara, PPK, Pejabat Pengadaan. Untuk BPS Provinsi, jumlah yang harus melaporkan LHKPN termasuk pegawai BPS Provinsi yang ditugaskan menjadi Pejabat Pengadaan pada BPS Kabupaten/Kota)                           (iii) Screenshot bukti penyampaian LHKPN', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4027, '1173', '2025', '179', NULL, '1,11', '1', 'https://drive.google.com/drive/folders/1SRGtA5PtYVAlVJtwRTQOL6xt_zFtuxJN?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, NULL, '(i) Lampiran surat Inspektur Utama perihal Proses Pelaporan LHKAN Periode 2025                                     (ii) Daftar pegawai yang wajib mengisi SPT (ASN yang tidak wajib LHKPN) dan dilegalisasi oleh kepala satuan/unit kerja                               (iii) Screenshot bukti penyampaian SPT', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4028, '1173', '2025', '188', NULL, '1,10', '1,10', 'a', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\r\n(i) Narasi yang menggambarkan dampak dari inovasi\r\nyang ada di satuan/unit kerja terhadap perbaikan\r\npelayanan publik yang prima\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PelayananPublik_R1a_bps', NULL, '- Menyederhanakan dokumen persyaratan\r\n- Standarisasi hasil layanan\r\n- Penyediaan kotak saran, kanal pengaduan online, dan layanan konsultasi langsung.\r\n- Tindak lanjut pengaduan secara sistematis dan transparan.', '(i) Narasi yang menggambarkan dampak dari inovasi yang ada di satuan/unit kerja terhadap perbaikan pelayanan publik yang prima', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4029, '1173', '2025', '189', NULL, '1,12', '1,12', 'b', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\r\n(i) Dokumen daftar jumlah perijinan/pelayanan yang\r\nterdata/terdaftar di satuan/unit kerja (sesuai Perka\r\nBPS Nomor 65 Tahun 2024);\r\n(ii) Dokumen daftar jumlah perijinan/pelayanan di\r\nsatuan/unit kerja yang telah dipermudah\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PelayananPublik_R1b_bps', NULL, 'Mencatat inovasi, kebijakan internal, atau instruksi yang menyebabkan kemudahan layanan.', '(i) Dokumen daftar jumlah perijinan/pelayanan yang terdata/terdaftar di satuan/unit kerja (sesuai Perka BPS Nomor 65 Tahun 2024);                                          (ii) Dokumen daftar jumlah perijinan/pelayanan di satuan/unit kerja yang telah dipermudah', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4030, '1173', '2025', '190', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, 'Membuat rekap jumlah konsumen yang berkunjung ke PST', 'Membuat laporan jumlah kunjungan PST setiap bulan\n4 Pelayanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4031, '1173', '2025', '191', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, 'Membuat rekap jumlah permintaan data dan konsultasi', 'Membuat laporan jumlah permintaan data dan konsultasi setiap bulan\n4 Pelayanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4032, '1173', '2025', '193', NULL, '1,6', '1,6', 'ii', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti Dukung:\r\n(i) Laporan monitoring, evaluasi, dan tindak lanjut\r\npenanganan pengaduan dari berbagai media\r\nlayanan;\r\n(ii) Dokumentasi Penanganan Pengaduan secara\r\noffline dan online (jika ada aduan maka tampilkan\r\nscreen shoot dari berbagai media layanan\r\npengaduan, seperti sarana pengaduan offline, WA,\r\nmedia sosial, atau email pengaduan).\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PelayananPublik_Reform2_BPS', NULL, 'Menyiapkan berbagai media pengaduan, seperti: kotak saran, layanan hotline, email resmi, website, media sosial, dan aplikasi pengaduan.', '(i) Laporan monitoring, evaluasi, dan tindak lanjut penanganan pengaduan dari berbagai media layanan                                                (ii) Dokumentasi Penanganan Pengaduan secara offline dan online (jika ada aduan maka tampilkan screen shoot dari berbagai media layanan pengaduan, seperti sarana pengaduan offline, WA, media sosial, atau email pengaduan)', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4033, '1174', '2025', '5', NULL, '2', '2', 'https://drive.google.com/drive/folders/17RMyzO0GktsNhVQToExDQBO1W_28HFTQ?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Bukti dukung telah sesuai', NULL, 'Rapat Pembentukan Tim Kerja Pembangunan ZI BPS Kota Lhokseumawe Tahun 2025\nTopik: Struktur serta Uraian Tugas dan Fungsi Tim Kerja Pembangunan ZI BPS Kota Lhokseumawe Tahun 2025', '(i) SK Tim Kerja Pembangunan ZI BPS Kota Lhokseumawe Tahun 2025', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4034, '1174', '2025', '6', NULL, '2', '2', 'https://drive.google.com/drive/folders/1-7uxlEjJESgdBNOodx0iKcPgf9-dTCQl?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'SOP Pembentukan Tim Kerja Pembangunan ZI Tahun 2025 belum diupload', NULL, 'Rapat Pembentukan Tim Kerja ZI BPS Kota Lhokseumawe Tahun 2025\nTopik: Struktur serta Uraian Tugas dan Fungsi Tim Kerja', '(i) Notula/laporan pelaksanaan rapat pembentukan Tim Kerja Pembangunan ZI Tahun 2025\n(ii) Mekanisme yang menjelaskan tata cara pemilihan anggota Tim\n(iii) Kertas Kerja Penentuan Anggota Tim Kerja Pembangunan ZI Tahun 2025', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4035, '1174', '2025', '8', NULL, '3', '3', 'https://drive.google.com/drive/folders/1MjoKzR3YUuctCHO56skNr9yEmURToWu1?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Link bukti dukung tidak ditemukan', NULL, 'Menyusun dokumen rencana pembangunan Zona Integritas BPS Kota Lhokseumawe menuju WBK/WBBM', 'Dokumen rencana pembangunan ZI BPS Kota Lhokseumawe yang mencakup:\n- Susunan Tim Pembangunan ZI\n- Target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- Rencana kerja dan rencana aksi\n- Rencana dan realisasi timeline pelaksanaan pembangunan ZI\n- Legalisasi pimpinan', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4036, '1174', '2025', '9', NULL, '3', '3', 'https://drive.google.com/drive/folders/1R1ZomE7cd4Xgy43YScKZKq0H0tw52Voj?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Link bukti dukung masih kosong', NULL, 'Penyusunan rencana kerja pembangunan ZI yang berisi target-target prioritas yang relevan dengan tujuan pembangunan WBK/WBBM', '(i) Dokumen rencana pembangunan ZI yang mencakup:\n- Susunan Tim Pembangunan ZI\n- Target prioritas yang ingin dicapai (bisa berupa narasi atau penandaan pada tabel rencana kerja\n- Rencana kerja dan rencana aksi\n- Rencana dan realisasi timeline pelaksanaan pembangunan ZI\n- Legalisasi pimpinan', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4037, '1174', '2025', '10', NULL, '12', '12', 'https://drive.google.com/drive/folders/1MtqZTx_DoytFAJeRJmtEGfTzEE0AFmHk?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Link bukti dukung tidak ditemukan', NULL, 'Melakukan sosialisasi secara berkala tentang pembangunan WBK/WBBM kepada internal dan stakeholder dengan memanfaatkan media dan aktivitas interaktif yang efektif, sesuai dengan nilai-nilai dasar ASN', '(i) Laporan pelaksanaan sosialisasi pembangunan WBK/WBBM yang mencakup : sosialisasi offline dan online (Screen Capture website, media sosial, ataupun foto kegiatan terkait serta link terkait)', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4038, '1174', '2025', '12', NULL, '3,12', '3,12', 'https://drive.google.com/drive/folders/1fWC2AvQSNDofKPkRE6ykKa9UC1b9zbGj?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, 'Penyusunan laporan pelaksanaan kegiatan pembangunan ZI BPS Kota Lhokseumawe Tahun 2025', '(i) Dokumen rencana kerja pembangunan ZI BPS Kota Lhokseumawe Tahun 2025;\n(ii) Laporan pelaksanaan kegiatan pembangunan ZI BPS Kota Lhokseumawe Tahun 2025.', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4039, '1174', '2025', '13', NULL, '1,4,7,10', '1,4,7,10', 'https://drive.google.com/drive/folders/1ih3-jS1AnxhbCOAa1dRuzjWhIDTrbCOs?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, 'Rapat Monitoring dan Evaluasi Pembangunan ZI BPS Kota Lhokseumawe Tahun 2025 (triwulanan) yang melibatkan pimpinan dan pegawai organik', '(i) Laporan monitoring dan evaluasi pelaksanaan kegiatan pembangunan ZI yang memuat analisa kendala, solusi, dan rencana tindak lanjut atas masing-masing rencana aksi;\r\n(ii) Undangan, daftar hadir, dan notulen pelaksanaan rapat evaluasi.', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4040, '1174', '2025', '14', NULL, '1,4,7,10', '1,4,7,10', 'https://drive.google.com/drive/folders/1ZxjefXCBRrLNBOf-p2VhltoNkhZxcdQF?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, '(i) Menindaklanjuti catatan/rekomendasi hasil  monitoring dan evaluasi tim internal atas persiapan dan pelaksanaan kegiatan Unit WBK/WBBM\n(ii) Rapat pelaporan dan penyusunan laporan hasil tindak lanjut pembangunan ZI BPS Kota Lhokseumawe Tahun 2025', '(i) Notulen/laporan monitoring dan evaluasi yang memuat rekomendasi;\r\n(ii) Laporan hasil tindak lanjut rekomendasi;\r\n(iii) Dokumentasi pelaksanaan tindak lanjut.', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4041, '1174', '2025', '16', NULL, '12', '12', 'https://drive.google.com/drive/folders/1NbcAIYF1LXpdK643cpCFPgHCDDEqX0Po?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, 'Melibatkan pimpinan dalam setiap kegiatan pembangunan WBK/WBBM dan kegiatan BPS Kota Lhokseumawe agar dapat memberikan contoh langsung penerapan nilai-nilai organisasi (BerAKHLAK) sebagai role model/change leader kepada yang dipimpin', 'Laporan tahunan penerapan nilai-nilai organisasi (BerAKHLAK) oleh pimpinan sebagai role model/change leader.', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4042, '1174', '2025', '17', NULL, '1,7,12', '1,7,12', 'https://drive.google.com/drive/folders/1PGw895nHZxm72_wI9dQ_xRDs21I_lWtn?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, '(i) Melakukan seleksi dan memilih Agen Perubahan BPS Kota Lhokseumawe tahun 2025 (Change Champion dan/ Change Ambassador);\n\n(ii) Agen perubahan menentukan dan melaksanakan program kerja yang berkontribusi terhadap perubahan pada BPS Kota Lhokseumawe', '(i) SK Agen Perubahan BPS Kota Lhokseumawe tahun 2025 (Change Champion dan/ Change Ambassador);\n\n(ii) Laporan agen perubahan BPS Kota Lhokseumawe tahun 2025 yang memuat penjelasan detail perubahan konkret dari program kerja agen perubahan.', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4043, '1174', '2025', '18', NULL, '12', '12', 'https://drive.google.com/drive/folders/1Wg7NUQkMzI5VLmZNfyqHJGUGxI1QCWDQ?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, '(i) Menentukan dan melaksanakan upaya pembangunan budaya kerja dan pola pikir untuk meminimalkan resistensi terhadap perubahan.\n\n(ii) Menyusun matriks dampak penerapan perubahan budaya kerja dan pola pikir.', '(i) Laporan penerapan budaya kerja;\n\n(ii) Matriks dampak penerapan perubahan budaya kerja dan pola pikir.', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4044, '1174', '2025', '19', NULL, '1,4,7,10', '1,4,7,10', 'https://drive.google.com/drive/folders/1zmGUqmXK5YmGNPxWPZjXfJkQ_42OSI42?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada target dan realisasi pelaksanaan ZI serta bukti dukung belum di upload', NULL, '(i) Melaksanakan penandatanganan pakta integritas oleh seluruh pegawai BPS Kota Lhokseumawe untuk terlibat dalam pembangunan Zona Integritas menuju WBK/WBBM.\n\n(ii) Menyelenggarakan rapat monitoring dan evaluasi Zona Integritas secara berkala (triwulanan) yang melibatkan pimpinan dan seluruh pegawai BPS Kota Lhokseumawe.\n\n(iii) Menghimpun usulan, masukan, dan rekomendasi dari pimpinan dan pegawai BPS Kota Lhokseumawe serta menyusun tindak lanjutnya.', '(i) Dokumen pakta integritas seluruh pegawai BPS Kota Lhokseumawe;\n\n(ii) Dokumen pelaksanaan rapat Monitoring dan evaluasi ZI triwulanan;\n\n(iii) Dokumen yang memuat usulan-usulan anggota dan tindak lanjutnya.', NULL, NULL, NULL, NULL, 'alfisyah', NULL, NULL, NULL, NULL, NULL),
	(4045, '1174', '2025', '22', NULL, '1', '1', 'https://drive.google.com/drive/folders/1Rr84lW7p2Sylb76u5trqc-qCOOIhYQHC?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen belum sesuai, belum dilengkapi dengan : \n1. SOP yang di ttd eselon 2\n2. SOP inovasi', NULL, '(i) Menyusun dan menetapkan dokumen SOP BPS Kota Lhokseumawe yang mengacu peta proses bisnis serta melakukan inovasi yang selaras', '(i) Seluruh dokumen SOP Teknis dan Non Teknis/Administrasi BPS Kota Lhokseumawe yang ditandatangani kepala satuan kerja (Satker);\n- SOP Kegiatan Diseminasi Statistik\n- SOP Kegiatan Pembinaan Statistik Sektoral\n- SOP Kegiatan  Pengolahan dan TI\n- SOP Kegiatan Tata Usaha\n- SOP Kegiatan Tim Distribusi\n- SOP Kegiatan Tim NSW\n- SOP Kegiatan Tim Produksi\n- SOP Kegiatan Sosial\n\n(ii) Dokumen SOP Inovasi BPS Kota Lhokseumawe yang ditandatangani kepala satuan kerja (Satker)', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(4046, '1174', '2025', '23', NULL, '1', '1', 'https://drive.google.com/drive/folders/1oxusHw0bHeziEcfYr1c9r0N_enNReO5J?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Terdapat bukti dukung yang belum di upload 1. Dokumen SOP Inovasi BPS Provinsi/Kabupaten/Kota yang ditandatangani kepala satuan kerja (Satker)', NULL, 'Rapat Monitoring pelaksanaan penerapan SOP', '(i) Dokumen monitoring pelaksanaan penerapan SOP sesuai Perka BPS Nomor 19 Tahun 2013 tentang Pedoman Penyusunan Standar Operasional Prosedur Administrasi Pemerintah di Lingkungan BPS, halaman 47;\n\n(ii) Dokumen SOP Inovasi BPS Kota Lhokseumawe yang ditandatangani kepala satuan kerja (Satker).', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(4047, '1174', '2025', '24', NULL, '1', '1', 'https://drive.google.com/drive/folders/17dYhZ6IqqFoh7uVqz-nf9wtOfNvv9fFy?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'terdapat bukti dukung yang belum di upload 1. Dokumen SOP awal dan SOP perbaikan.\n2. untuk Bukti pelaksanaan rapat evaluasi SOP (Undangan, Daftar Hadir, Notulen ) berkas punyak tahun 2024', NULL, '(i) Melaksanakan rapat evaluasi SOP\n(ii) Mengisi kertas kerja evaluasi SOP\n(iii) Menindaklanjuti hasil rapat evaluasi melalui penyusunan SOP perbaikan.', '(i) Bukti pelaksanaan rapat evaluasi SOP (Undangan, Daftar Hadir, Notulen);\r\n\r\n(ii) Kertas kerja evaluasi SOP;\r\n\r\n(iii) Dokumen SOP awal dan SOP perbaikan.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
	(4048, '1174', '2025', '26', NULL, '1', '1', 'https://drive.google.com/drive/folders/1oWTZTVi2pgg-wgY81sUKd1Z0XHc8186C?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, '(i) Menggunakan dan memanfaatkan sistem pengukuran kinerja yang berbasis teknologi dan menambah tools (jika dibutuhkan)\n\n(ii) Menyusun laporan inovasi', '(i) Daftar seluruh penerapan teknologi informasi yang digunakan satker terkait pengukuran kinerja unit (seperti Simonev, FRA, dan atau inovasi lainnya jika ada);\n\n(ii) Dokumen Screenshot aplikasi terkait pengukuran kinerja unit dan sudah berjalan (Simonev, FRA, dll) yang dilengkapi dengan narasi penjelasan penggunaan/pemanfaatan aplikasi TI dalam pengukuran kinerja unit;\n\n(iii) Inovasi dilengkapi dengan Laporan Pemanfaatan Aplikasi yang berisi latar belakang/alasan pengembangan aplikasi, pemanfaatan aplikasi tersebut (dilengkapi dengan screenshot aplikasi) serta buku pedoman/SOP penggunaan aplikasi.', NULL, NULL, NULL, NULL, 'maulidin', NULL, NULL, NULL, NULL, NULL),
