	(4054, '1174', '2025', '35', NULL, '3', '3', 'https://drive.google.com/drive/folders/1iwFiBZgZwvwgbT54cGIjh69h5hqTcr3X?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'sudah sesuai', NULL, '(i) Menyusun analisis kebutuhan pegawai yang mengacu kepada peta jabatan dan hasil analisis beban kerja untuk masing-masing jabatan\n\n(ii) Melaksanakan Rapat Pembina Kepegawaian mengenai Rencana mutasi, Penerimaan/pengadaan pegawai.', '(i) Kepka BPS Nomor 281 tahun 2024 tentang Rekapitulasi Jabatan Hasil Analisis Beban Kerja di Lingkungan Badan Pusat Statistik 2021;\n\n(ii) Dokumen Komposisi SDM ABK dan existing pegawai BPS Kota Lhokseumawe;\n\n(iii) Notulensi Hasil Rapat Pembina Kepegawaian mengenai Rencana mutasi, Penerimaan/pengadaan pegawai.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
