	(4057, '1174', '2025', '39', NULL, '6', '6', 'https://drive.google.com/drive/folders/1-jOnCHc_lySjxViqN-v10WA8YAiG0QNs?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'belum ada dokumen Notulensi Rapat BaperJakat yang memuat pertimbangan Rotasi dan pelaksanaan Rotasi', NULL, '(i) Melaksanakan Rapat BaperJakat terkait pertimbangan rotasi\n(ii) Melakukan mutasi pegawai antar jabatan', '(i) Notulensi Rapat BaperJakat yang memuat pertimbangan Rotasi dan pelaksanaan Rotasi telah berorientasi pada pengembangan karir pegawai;\n\n(ii) SK Mutasi / Rotasi Internal.', NULL, NULL, NULL, NULL, 'saiful.ambiya', NULL, NULL, NULL, NULL, NULL),
