	(4075, '1174', '2025', '64', NULL, '3,4', '3,4', 'https://drive.bps.go.id/s/so6JHBaBND7MW2t', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen tahun 2024', NULL, 'Menyusun perencanaan kinerja BPS Kota Lhokseumawe tahun 2025', '(i) Rencana Strategis (Renstra) 2025–2029 dan Reviu Renstra 2025-2029;\n\n(ii) Dokumen PK 2024 yang ditandatangani oleh pimpinan;\n\n(iii) Dokumen daftar link Renstra 2025–2029, Reviu Renstra 2025–2029, dan PK 2025 yang diupload di PPID.', NULL, NULL, NULL, NULL, 'zukhra', NULL, NULL, NULL, NULL, NULL),
