	(4093, '1174', '2025', '87', NULL, '2,12', '2,12', 'https://drive.bps.go.id/s/QXFHKS5PESPFRFZ', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, '(i) Rapat pembentukan tim Whistle-Blowing System (WBS)\n\n(ii) Pengelolaan WBS\n\n(iii) Pembuatan dan pengunggahan media (foto atau video) yang memuat tentang WBS\n\n(iv) Pembuatan dan/atau penempatan media cetak yang memuat tentang WBS', '(i) SK Tim WBS;\r\n\r\n(ii) Keputusan Inspektur Utama No.B146/BPS/8000/10/2019 Tahun 2019 tentang Sistem Pengelolaan Pengaduan di Lingkungan Badan Pusat Statistik;\r\n\r\n(iii) Dokumentasi spanduk/banner/flyer/media/sarana WBS yang dilengkapi dengan narasi;\r\n\r\n(iv) Screenshot aplikasi WBS;\r\n\r\n(v) Laporan pengelolaan WBS.', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
