	(4097, '1174', '2025', '92', NULL, '7', '7', 'https://drive.bps.go.id/s/x8TX88nZnQxBGeo', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'isi link tidak ada bukti dukung', NULL, 'Sosialisasi/internalisasi penanganan benturan kepentingan', 'Dokumentasi internalisasi penanganan benturan kepentingan, antara lain: (1) rapat (undangan, daftar hadir, notulen, foto). (2) bimtek (laporan, foto). (3) apel pagi/sore (foto, teks arahan pimpinan).', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
