	(4102, '1174', '2025', '99', NULL, '1', '1', 'https://drive.bps.go.id/s/SPmtDQwfXo4TFW7', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Dokumen sudah sesuai', NULL, 'Memaklumatkan Standar pelayanan pada seluruh jenis pelayanan dan memublikasikan di website dan media lainnya', '(i) Dokumen maklumat standar pelayanan yang ditandatangani kepala satker paling lambat 7 hari setelah SK standar pelayanan terbit;\r\n\r\n(ii) Capture/foto dokumen maklumat standar pelayanan di tempat pelayanan misal PST, website, dan media lainnya (media sosial);\r\n\r\n(iii) SK Maklumat Pelayanan.', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
