	(4200, '1175', '2025', '80', NULL, '5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Internalisasi/sosialisasi pegawai di seluruh BPS Kota Subulussalam', 'Dokumentasi Pelaksanaan internalisasi seluruh pegawai bps kota subulussalam dokumentasi dan poto', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4201, '1175', '2025', '82', NULL, '1,12', '1', 'https://drive.google.com/drive/folders/1-Hn0_Nz4TTOgvqkg8vUhLM2HD-t2L65E?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Penyusunan SK Petugas Pengelola Pengaduan Masyarakat, pembuatan dokumen kebijakan pengaduan, serta pendokumentasian media atau sarana penyampaian pengaduan yang dilengkapi narasi. Selain itu, dilakukan pengumpulan hasil SKD 2025 sebagai bahan evaluasi dan penyusunan laporan pengelolaan pengaduan masyarakat sebagai bentuk akuntabilitas dan upaya peningkatan kualitas layanan publik.', '(i) SK Petugas Pengelola Pengaduan Masyarakat\n(ii) Dokumen kebijakan pengaduan\n(iii) Dokumentasi media/sarana penyampaian pengaduan yang dilengkapi dengan narasi\n(iv) Hasil SKD 2025\n(v) Laporan pengelolaan pengaduan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4202, '1175', '2025', '83', NULL, '3,6,9,12', '3', 'https://drive.google.com/drive/folders/1DA5cvpIz2qGYDNIClqUp1HedvCXinioF?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Menyusun laporan bulanan mengenai jenis aduan, langkah penyelesaian, kendala, dan solusi yang dilakukan.', '(i) Laporan pengelolaan pengaduan dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis aduan)\nb. Tindak lanjut aduan\nc. Kendala dan solusi dalam penanganan aduan\n(ii) Layanan permintaan data melalui pesan WA', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4203, '1175', '2025', '84', NULL, '3,6,9,12', '3', 'https://drive.google.com/drive/folders/1n4JWYi-DbLim-06HnDbsCnUNeeqymHzL?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak realisasi dan bukti dukung', NULL, 'Melaksanakan kegiatan monitoring dan evaluasi terhadap proses penanganan pengaduan masyarakat secara berkala, termasuk pengumpulan data aduan, analisis tindak lanjut, identifikasi kendala dan solusi, serta penyusunan laporan hasil evaluasi dan inovasi perbaikan layanan.', '(i) Laporan pengelolaan pengaduan dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis aduan)\nb. Tindak lanjut aduan\nc. Kendala dan solusi dalam penanganan aduan\nd. Hasil evaluasi atas tindak lanjut penanganan pengaduan masyarakat\n(ii) Dokumentasi pelaksanaan rapat evaluasi dan monitoring (undangan, daftar hadir, notulen)\n(iii) Inovasi dalam penanganan aduan\n(iv) Hasil SKD 2025', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4204, '1175', '2025', '85', NULL, '3,6,9,12', '3', 'https://drive.google.com/drive/folders/1Y46-zGAJsU5HDQ8GEXIYGeNUzipyo6dX?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Menindaklanjuti hasil evaluasi penanganan pengaduan masyarakat melalui penerapan rekomendasi perbaikan, penguatan mekanisme tindak lanjut, serta pengembangan inovasi untuk meningkatkan efektivitas layanan pengaduan.', '(i) Laporan pengelolaan pengaduan dengan ouline:\na. Rekapitulasi jumlah aduan per bulan (jenis aduan)\nb. Tindak lanjut aduan\nc. Kendala dan solusi dalam penanganan aduan\nd. Hasil evaluasi atas tindak lanjut penanganan pengaduan masyarakat\n(ii) Inovasi dalam penanganan aduan\n(iii) Hasil SKD 2025', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4205, '1175', '2025', '87', NULL, '1,3,6,9,12', '1,3', 'https://drive.google.com/drive/folders/1mpkAhxAYBY8iNPbje_kW8Fwg5rCzUbjT?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Menerapkan sistem Whistle-Blowing System (WBS) melalui pembentukan tim, penyediaan sarana pelaporan, dan pelaporan hasil pengelolaan WBS secara berkala', '(i) SK Tim WBS\n(ii) Keputusan Inspektur Utama No. B-146/BPS/8000/10/2019 Tahun 2019 tentang Sistem Pengelolaan Pengaduan di Lingkungan Badan Pusat Statistik\n(iii) Dokumentasi media/sarana pengaduan WBS\n(iv) Screenshots aplikasi WBS\n(v) Laporan pengelolaan WBS', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4206, '1175', '2025', '88', NULL, '3,6,9,12', '3', 'https://drive.google.com/drive/folders/1aTNp1QmHmlReRG2P9yecUgfVg2kGnhR4?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Melakukan monitoring dan evaluasi terhadap pelaksanaan Whistle-Blowing System serta menyusun laporan hasil evaluasi pengelolaan WBS.', '(i) Laporan pengelolaan WBS dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis aduan)\nb. Tindak lanjut WBS\nc. Kendala dan solusi dalam penanganan WBS', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4207, '1175', '2025', '89', NULL, '3,6,9,12', '3', 'https://drive.google.com/drive/folders/12dfDsLyP-KpOmEUC9toLLgX3QVX0PZGW?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Melaksanakan tindak lanjut atas hasil evaluasi penerapan Whistle-Blowing System melalui penerapan rekomendasi perbaikan dan penyusunan laporan hasil tindak lanjut WBS', '(i) Laporan pengelolaan WBS dengan outline:\na. Rekapitulasi jumlah aduan per bulan (jenis aduan)\nb. Tindak lanjut WBS\nc. Kendala dan solusi dalam penanganan WBS\nd. Hasil evaluasi atas tindak lanjut penanganan WBS', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4208, '1175', '2025', '91', NULL, '1', '1', 'https://drive.google.com/drive/folders/1d0Goy2vLY1O3uWAhAnaFoKDxHjX6dmno?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tidak ada terget, realisasi dan bukti dukung', NULL, 'Melakukan identifikasi dan pemetaan potensi benturan kepentingan dalam pelaksanaan tugas dan fungsi seluruh pegawai sesuai dengan pedoman Perka BPS Nomor 36 Tahun 2023, serta menyusun dokumen hasil identifikasi dan penetapan melalui surat keputusan.', '(i) Dokumen hasil identifikasi potensi benturan kepentingan dalam tugas dan fungsi utama untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 23\n(ii) Perka BPS Nomor 36 Tahun 2023 tentang pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik\n(iii) SK Benturan Kepentingan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4209, '1175', '2025', '92', NULL, '12', NULL, 'https://drive.google.com/drive/folders/1_0YD_fKaaQ7wLuutD12J5o7GDf6dC_MS?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Melakukan sosialisasi dan internalisasi pedoman penanganan benturan kepentingan kepada seluruh pegawai melalui rapat, bimtek, dan arahan pimpinan.', '(i) Dokumentasi internalisasi penanganan benturan kepentingan, antara lain:\n(1) rapat (undangan, daftar hadir, notulen, foto)\n(2) bimtek (laporan, foto)\n(3) apel pagi/sore (foto, teks arahan pimpinan)', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4210, '1175', '2025', '93', NULL, '12', NULL, 'https://drive.google.com/drive/folders/1Zvc4Lwd7p5TS9Aw5TPlIIsL6TzWcGC-9?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Melaksanakan penerapan penanganan benturan kepentingan di lingkungan kerja melalui pengisian dan penandatanganan surat pernyataan bebas dari benturan kepentingan oleh seluruh pegawai serta penetapan melalui surat keputusan sesuai pedoman Perka BPS Nomor 36 Tahun 2023.', '(i) Dokumen surat pernyataan bebas dari benturan kepentingan untuk seluruh pegawai berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 22\n(ii) SK Benturan Kepentingan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4211, '1175', '2025', '94', NULL, '12', NULL, 'https://drive.google.com/drive/folders/1VtPxUuw9DR3E3pEz10sj1RYAVygXPj4G?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Melakukan monitoring dan evaluasi terhadap pelaksanaan penanganan benturan kepentingan serta menyusun laporan hasil evaluasi sesuai pedoman Perka BPS Nomor 36 Tahun 2023.', '(i) Laporan monitoring dan evaluasi penanganan benturan kepentingan berdasarkan lampiran Perka BPS Nomor 36 Tahun 2023 tentang Pedoman Penanganan Benturan Kepentingan di Lingkungan Badan Pusat Statistik halaman 25', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4212, '1175', '2025', '95', NULL, '12', NULL, 'https://drive.google.com/drive/folders/1V62hpQ0QfA2piHWfiTls-vajufAIJNWr?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', '-', NULL, 'Melaksanakan tindak lanjut hasil evaluasi penanganan benturan kepentingan melalui penerapan rekomendasi perbaikan dan penyusunan laporan bukti tindak lanjut', '(i) Laporan Bukti Tindak Lanjut Penanganan Benturan Kepentingan', NULL, NULL, NULL, NULL, 'mreza', NULL, NULL, NULL, NULL, NULL),
	(4213, '1175', '2025', '98', NULL, '1', '1', 'https://drive.google.com/drive/folders/1IW1_PXTFk00N2w6cEqc_M5UyKgvKaX2g?usp=sharing', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\r\n(i) Perka BPS No.65 Tahun 2024 tentang Standar\r\nPelayanan Statistik Terpadu;\r\n(ii) Keputusan Pejabat Pengelola Informasi dan\r\nDokumentasi Badan Pusat Statistik No. B323/02400/HK.200/07/2022 tentang Standar\r\nLayanan Informasi Publik di lingkungan Badan\r\nPusat Statistik;\r\n(iii) Dokumen SK standar pelayanan publik..\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPublik\r\n_1a_bps', NULL, 'Membuat SK Standar Pelayanan Publik', 'SK Standar Pelayanan Publik', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4214, '1175', '2025', '99', NULL, '1', '1', 'https://drive.google.com/drive/folders/1D9NoC4yBiYwIPfKGnmPqQ8JWSugksIv5?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\r\n(i) Dokumen maklumat standar pelayanan yang\r\nditandatangani kepala satker paling lambat 7 hari\r\nsetelah SK standar pelayanan terbit;\r\n(ii) Capture/foto dokumen maklumat standar pelayanan\r\ndi tempat pelayanan misal PST, website, dan media\r\nlainnya (social media);\r\n(iii) SK Maklumat Pelayanan.\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPublik\r\n_1b_bps', NULL, 'Membuat Maklumat Pelayanan', '- SK Maklumat Pelayanan\n- Dokumentasi Publikasi Maklumat Pelayanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4215, '1175', '2025', '100', NULL, '12', NULL, 'https://drive.google.com/drive/folders/1A5mHF_vMMvTK0JcDZD-CiHiAVw3m2iEc?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\r\n(i) Dokumentasi rapat reviu standar pelayanan yang\r\ndilakukan dengan melibatkan stakeholders dan\r\nmasyarakat (dilengkapi Undangan, Daftar Hadir,\r\nNotulensi, Dokumentasi Rapat);\r\n(ii) Dokumen reviu standar pelayanan yang dilakukan\r\ndengan melibatkan stakeholders (antara lain :\r\ntokoh masyarakat, akademisi, dunia usaha, dan\r\nlembaga swadaya masyarakat), serta\r\nmemanfaatkan masukan hasil SKM/SKD dan\r\npengaduan masyarakat.\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPublik_\r\n1c_bps', NULL, 'Melakukan FGD Standar Pelayanan', 'Dokumentasi FGD', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4216, '1175', '2025', '101', NULL, '1,2', '1,2', 'https://drive.google.com/drive/folders/1KA7DJozBYcJcE-VsbIBz6aDnMwyRF4mL?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\n(i) Dokumen bukti maklumat pelayanan telah\ndipublikasikan di berbagai media;\n(ii) Dokumen bukti standar pelayanan telah\ndipublikasikan di berbagai media.\nLink Contoh Bukti Dukung:\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPublik\n_1d_bps', NULL, 'Mempublikasikan Standar Pelayanan dan Maklumat Pelayanan melalui berbagai media', '- Dokumentasi Publikasi Standar Pelayanan dan Maklumat Pelayanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
	(4217, '1175', '2025', '103', NULL, '1,11', NULL, 'https://drive.google.com/drive/folders/1r2lpy3kOVX5tqRgxWYexDfVZb3VFF0mZ?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\n(i) Dokumen pelatihan/sosialisasi pelayanan prima\nkepada pegawai/petugas layanan, antara lain:\n- rapat (undangan, daftar hadir, notulen);\n(ii) laporan dan materi pelatihan/sosialisasi pelayanan\nprima kepada pegawai/petugas layanan.\n(iii) Dokumen jadwal pelatihan/sosialisasi yang\nmenunjukkan bahwa pelatihan/sosialisasi dilakukan\nsecara berkelanjutan dan terjadwal;\n(iv) Dokumen monitoring dan evaluasi atas kualitas\nlayanan yang diberikan oleh pegawai/petugas\nlayanan.\nLink Contoh Bukti Dukung:\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPubli\nk_2a_bps', NULL, 'Sosialisasi budaya pelayanan prima kepada petugas pelayanan', '- Dokumen Sosialisasi', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
