	(4446, '1175', '2025', '108', NULL, '1', '1', 'https://drive.google.com/drive/folders/1WW-5TAl969ONlfwzH6DX7ICFa_NxXNYA?usp=drive_link', NULL, NULL, NULL, NULL, NULL, NULL, '3', 'Tambahkan Bukti Dukung:\r\n(i) Laporan inovasi pelayanan publik (Inovasi tidak\r\nharus yang berupa pengembangan aplikasi berbasis\r\nIT, namun dapat berupa penambahan dekoratif pada\r\nruang layanan, penyediaan layanan bagi disabilitas,\r\npemberian layanan secara jemput bola seperti pojok\r\nstatistik, road show/sosialisasi terkait pemberian\r\nlayanan) yang dilegalisir oleh pimpinan;\r\n(ii) Dokumen bukti bahwa inovasi telah direplikasi.\r\nLink Contoh Bukti Dukung:\r\nhttp://s.bps.go.id/PeningkatanKualitasPelayananPublik_\r\n2f_bps', NULL, 'Menyusun laporan inovasi pelayanan', 'Laporan inovasi pelayanan', NULL, NULL, NULL, NULL, 'reyhan.octavianri', NULL, NULL, NULL, NULL, NULL),
